INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:35:49', '2015-07-16 22:47:04', '2015-07-16 22:47:04', 'Crinkle Mirror Flash', 'crinkle-mirror-flash', 6320, '0', null, 0, 0, '<p>Spraglete fj&aelig;r har alltid fisket godt. Her er en flash som gir et utrolig liv i vingen, og har en grizzly/spraglete effekt                         som gir et helt nytt inntrykk av liv. Dette materialet har farger og et lysspill som skiller seg ut!</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
