INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:35:49', '2015-07-16 22:41:26', '2015-07-16 22:41:26', 'DDC Connect Intermediate Head W/ S1-S2-S3 Tips', 'ddc-connect-intermediate-head-w-s1s2s3-tips', 79920, '0', null, 0, 250, '<table style="width: 100%;">
<tbody>
<tr>
<td colspan="1">En av v&aring;re mest popul&aelig;re Muliti Tip klumper kommer fra sesongen 2012 som "Ready-To-Go"! Disse linene har stadig &oslash;kt i popularitet opp gjennom &aring;rene. Flere og flere fiskere og forhandlere har bedt oss ta dem frem ferdig tilpasset med de beste lengder og vekter, og med fabrikkmonterte l&oslash;kker. Vi h&oslash;rte p&aring; dem og her er de!<br><br>S&aring; allsidig, s&aring; enkel &aring; bruke, s&aring; effektive og s&aring; g&oslash;y &aring; kaste med! Denne sn&oslash;retypen viser seg &aring; bli mer og mer brukt over hele Europa og i USA. Du kan velge et av to oppsett med enten en flytende eller en intermediate belly, med spisser inkludert i en mappe. Etter hvert kan du komplettere gjennom &aring; kj&oslash;pe l&oslash;se spisser som kommer helt ned i synk 6/7 og en ekstra synk2 belly for virkelig &aring; f&aring; flua dypt n&aring;r det trengs. Dette gir deg uendelige muligheter til &aring; kombinere og finne det eksakte oppsettet for hver spesifikke fiskesituasjon.</td>
</tr>
<tr>
<td style="text-align: center;">
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/powertaper/DDC_Connect_RTG/Connect-Profile.png?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
</tr>
<tr>
<td>Connect-linene best&aring;r av v&aring;r popul&aelig;re DC (Direct Contact) kjerne for bedre kontakt og kontroll under kasting. Den flytende bellyen kommer med 15&rsquo; lange Flyt, S1/S2 &amp; S4/S5 spisser i en mappe. Intermediate belly leveres med 15&rsquo; spisser i henholdsvis intermediate, S2/S3 &amp; S5/S6 i mappe. Alle spissene er loopet og monteres enkelt til hovedlinen.</td>
</tr>
</tbody>
</table>
<h2><br>Connect Belly S2</h2>
<table style="width: 100%;">
<tbody>
<tr>
<td style="text-align: center;">
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/powertaper/DDC_Connect_RTG/connect-belly.png?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
</tr>
<tr>
<td>Ved &aring; legge en S2 belly til ditt DDC CONNECT system vil du gj&oslash;re det enda mer allsidig og komplett. Med en S2 belly vil dette konseptet i utgangspunktet dekke alle vannstander. For eksempel, kombiner S2 bellyen med den nye S6/7 spissen, og du har en kanon rigg for dypvannsfiske etter laks, sj&oslash;&oslash;rret eller steelhead under de mest utfordrende forholdene. Mulighetene er uendelige&hellip; NB! S2 belly m&aring; tilpasses av brukeren. Det er ikke en RTG (Ready- To-Go) klump!</td>
</tr>
</tbody>
</table>
<table style="width: 100%;">
<tbody>
<tr>
<td>
<h2>Connect Tips</h2>
</td>
<td rowspan="2" colspan="1">
<table class="image-box">
<tbody>
<tr>
<td><a href="http://www.guideline.no/filestore/powertaper/DDC_Connect_RTG/DCC_tippets.png" rel="lightbox"><img src="http://www.guideline.no/filestore/powertaper/DDC_Connect_RTG/DCC_tippets.png?size=309x160" border="0" alt=""></a></td>
</tr>
</tbody>
</table>
</td>
</tr>
<tr>
<td>Kompletter ditt DDC CONNECT system med<br>l&oslash;se spisser i:<br><br>Flyt, I/S1, S1/S2, S2/S3, S4/<br>S5 og S6/S7.</td>
</tr>
</tbody>
</table>
<h2><br>Connect RTG - Lengde/vekt inkl. spiss</h2>
<table class="horizontal-user-table" style="width: 100%;">
