                                 vekter, og med fabrikkmonterte løkker. Vi hørte på dem og her er de!<br/><br/>Så allsidig, så enkel å bruke, så effektive og så gøy å kaste med! Denne snøretypen viser seg å bli mer og mer brukt over
                                 hele Europa og i USA. Du kan velge et av to oppsett med enten en flytende eller en intermediate belly, med spisser inkludert
                                 i en mappe. Etter hvert kan du komplettere gjennom å kjøpe løse spisser som kommer helt ned i synk 6/7 og en ekstra synk2
                                 belly for virkelig å få flua dypt når det trengs. Dette gir deg uendelige muligheter til å kombinere og finne det eksakte
