<p><span style="font-size: 13px;">De foldbare armene kan tas av og deles i flere deler. Motoren er den samme som p&aring; Decoys andre modeller, og leverer dermed den store kraften som de tyngere og st&oslash;rre modellene. </span></p>
<p><span style="font-size: 13px;">Duekarusellen leveres uten batteri og fartskontroll.</span></p>
