INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:13', '2015-07-16 22:49:24', '2015-07-16 22:49:24', 'Elgå Camo+Fox V2 lokkefløyte', 'elga-camofox-v2-lokkefloyte', 177440, '0', null, 0, 5, 'Perfekt dress for deg som liker å gå lange turer i skog og mark. Elgå er en lett og meget behagelig dress å gå med. Den er produsert i lydløst mikrofiber, laminert med en ventex membran. Det sørger for å holde deg tørr og behagelig varm under alle forhold. Den har vanntette glidelåser på alle utvendige lommer.<br /><br />
Spesifikasjoner:<br />
-Formsydd hette med justering i alle retninger.<br />
-Antennestropp<br />
-Varmelommerv
-Romslige frontlommer med patronholdere<br />
-Ventilering på sidene i buksen<br />
-Gode justeringsmuligheter<br />
-Sømløse skuldre<br />
-Radiolommer med vanntett glidelås<br />
-Formsydde albuer.<br />
<img src="/images/dresslogoer.jpg" /><br /><br />
Red River Bandit er en lokkefløyte som er mye brukt av nordiske jegere for å etterligne hareskrik. Fløyta har åpen membran som feks en Crit''R-Call. Fordelene med en åpen membran er at det gir store muligheter for variasjon av lyder og den vil aldri fryse. Noen synes det kan være vanskelig å få til de riktige lydene med slike fløyter, men Red River Bandit går for å være kanskje den enkleste å bruke av alle fløyter med åpen membran. <br /><br />

Lager de samme lydene som Crit''R Call Standard, men er mye mer lettblåst.<br /><br />

Funker også meget bra på kråke, skjære, ravn og nøtteskrike. Kan også brukes på lokkejakt på rådyrbukk. Ei fløyte med et utall bruksområder.
<br /><br />
<br>
<a href="/images/storrelseguide.jpg" target="_blank" >Størrelseguide Elgå Camo</a>', '', 9, 1, 0, 1, null, '', null, '', '', null, null, 0);
