<br />
<br />
<br />
Elastisiteten og fleksibiliteten i tubene er viktig for &aring; binde solide fiskefluer som t&aring;ler mange                         fisk f&oslash;r de g&aring;r i oppl&oslash;sning. Det er her F.I.T.S virkelig skiller seg fra ande typer.</div>
