INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:19', '2015-07-16 22:49:35', '2015-07-16 22:49:35', 'Fauna Elgen Stolsekk', 'faunaelgen', 79920, '0', null, 0, 4000, '<p>UTSOLGT!</p>
<p><br> Produsenten Fauna har her utviklet et knallgodt produkt, stolsekken har overbevisende gode b&aelig;reegenskaper, og her f&aring;r du mye for pengene.</p>
<p><br> Stolsekken fra Fauna er p&aring; hele 30 liter, den har et lydl&oslash;s lodenstoff med vanntett membran og b&oslash;r v&aelig;re den perfekte stolsekken til bruk under jakt.</p>
<p><br> Meget stabil ramme i st&aring;l og begge sider p&aring; rammen har beskyttelsestrekk (Se bilde), sekken har vanntett bunn og vanntette glidel&aring;ser.</p>
<p>Stolsekken fra Fauna er en stor forbedring av High Peak Moose sekken som har v&aelig;rt en bestselger i mange &aring;r, s&aring; er du p&aring; utkikk etter ny stolsekk med knallgod kvalitet til en hyggelig priss &aring; har du en her!</p>
<p>High Peak Moose var "Best i Test" , dette er den forbedrede etterkommeren!</p>
<p>Spesifikasjoner:</p>
<p>-Lydl&oslash;st stoff med membran.</p>
<p>-Stabil ramme i st&aring;l</p>
<p>-Vanntett bunn</p>
<p>-Vanntette glidel&aring;ser</p>
<p>-Volum: 30l</p>
<p>-Innvendig termoslomme</p>
<p>-2 sidelommer</p>
<p>-1 lomme p&aring; fronten av sekken.</p>
