<br />
<b>Loop Cross S1:</b><br />
Den nye serien med Loop Cross S1 fluestenger er det aller viktigste og mest revolusjonerende som har skjedd innen fluefiske siden Loop introduserte large arbor-snellene for over 20 &aring;r siden.  <br />
<br />
Hvis du er enig at large arbor-snellene ga en revolusjonerende funksjon n&aring;r den kom p&aring; markedet, s&aring; er vi sikker p&aring; at du kommer til &aring; kjenne den samme forskjellen n&aring;r du tester den nye stangserien Cross S1. Det kunne v&aelig;rt skrevet en hel bok om hvordan disse stengene ble til, men den beste m&aring;ten &aring; beskrive det p&aring; er &aring; f&oslash;le det. Pr&oslash;v den!  <br />
<br />
Disse stengene er blitt designet og testet over en 3-&aring;rs periode, og det er benyttet det nye 3M Powerlux Composites-materiale. Resultet er blitt en serie med kjemprelekre, r&aring;sterke og superlette stenger. Sammen gir deg dette en sinnsyk linekontroll.<br />
<br />
<b>Nordic Angler RX:</b> <br />
Ny snelle fra Nordic Angler i frekt nytt design. I sort blank utf&oslash;relse, men r&oslash;dt bremsehus i midten. <br />
Snella er frest ut i aluminium og veier kun 140gr i#6/7.<br />
Den fungerer utmerket til fiske av sj&oslash;&oslash;rret,&oslash;rret,harr og sm&aring;laks.<br />
Snella har en jevn og p&aring;litelig brems,medium bred spole og stor ytterdiameter. <br />
<br />
<b>Nordic Angler X1 Vadebukse:</b> <br />
Pustende vadebukser. De er myke og behagelige i stoffet som gj&oslash;r at de er behagelig &aring; ha p&aring; seg n&aring;r man st&aring;r ut i mange timer om dagen &aring; fisker. Stor frontlomme og &quot;muffe&quot; med fleece som man kan varme hendene i.  De er laget med 3-lags membran. Forsterket fra kne og ned foran og fra rumpa og ned bak.<br />
<br />
<b>Nordic Angler Flueline:</b> <br />
Du f&aring;r med Nordic Anglers WF Flueline.<br />
Meget god line.Dette fluesn&oslash;ret oppleves som meget glatt og har lite minne. <br />
<br />
<b>Flueboks: </b><br />
Flueboks i hardplast med foam.<br />
Dette er en robust og vanntett flueboks med 4 sider, med plass til opptil 400 fluer. Genial patent, der du skyver inn kroken bakover i et spor. Sk&aring;nsomt b&aring;de for skummet og flua. <br />
<br />
<b>Laminert treh&aring;v fra Nordic Angler</b><br />
Lekker laminert treh&aring;v med knutel&oslash;st nett. Nettet er dypt, og kan benyttes sj&oslash;&oslash;rret,&oslash;rret,harr etc. H&aring;ven har skulderrem med klips. <br />
<br />
-Lengde 56 cm <br />
-H&aring;v&aring;pning 20x38 cm <br />
-Dybde 45 cm. <br />
-Vekt 290 gram </p>
