<br />
Str. small og medium. <br />
<br />
Small                         passer til krok 14 og 16. Medium til 10-12.<br />
<br />
<br />
<br />
Sort er glimrende til de store maurene som svermer p&aring; forsommeren.                         Cinnamon er fargen for h&oslash;sten.</div>
