INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:39', '2015-07-16 22:43:53', '2015-07-16 22:43:53', 'Frizz Fibre', 'frizz-fibre', 3920, '0', null, 0, 0, '<p>Silkemykt materiale som egner seg godt til saltvannsfluer, men ogs&aring; til mer tradisjonelle sj&oslash;&oslash;rret- og laksefluer. Frizz fibre                         er et godt egnet materiale for &aring; lage loopwings.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:39', '2015-07-16 22:43:53', '2015-07-16 22:43:53', 'Frog hair 30m Spoler', 'frog-hair-30m-spoler', 7920, '0', null, 0, 0, '<p>Froghair monofilament lages av en ekstremt sterk co-polymer, 65 som gjennomg&aring;r en patentert GAMMA prosess i deres fabrikk i USA.<br><br> Dette &oslash;ker elastisiteten drastisk, samtidig som man oppn&aring;r en fenomenal bruddstyrke med knute i b&aring;de t&oslash;rr- og v&aring;t tilstand. Materialet er enkelt og greit utrolig slitesterkt. Vi testet materialet under varierte forhold, fra de tynneste fortomsspissene p&aring; sky &oslash;rret, til brutale fighter med Tarpon og Bonefish. For tiden fisker flere av oss med dette fortomsmaterialet.<br><br> FROG HAIR koster litt mer enn andre materialer, men det er det virkelig verdt. Materialet er selvf&oslash;lgelig UV-beskyttet for &aring; t&aring;le fiske i solrike, salte omgivelser.<br><br> 0X - 0,279mm - 6,82kg<br> 1x - 0,254mm - 5,95kg<br> 2x - 0,223mm - 5,05kg<br> 3x - 0,203mm - 3,86kg<br> 4x - 0,178mm - 2,82kg<br> 5x - 0,152mm - 2.23kg<br> 6x - 0,127mm - 1,68kg<br> 7x - 0,100mm - 1,27kg</p>', '', 8, 1, 0, 1, null, '', null, '', '', null, null, 0);
