INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:40', '2015-07-16 22:42:10', '2015-07-16 22:42:10', ' NRX Lite Presentation', 'gloomis-nrx-trout4', 639920, '0', null, 0, 1000, '<p><strong style="color: #ff0000; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;">Nyhet 2013</strong></p>
<div style="margin-top: 10px; float: left; width: 305px; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;" class="description">
<p style="margin: 0px 0px 2ex;"><br>V&aring;r nye serie NRX LP (Light Presentation) er laget for de mest delikate fiskesituasjoner med klart, gjerne lavt vann og sky fisk. Nydelig dyp gr&oslash;nn finish med s&oslash;lvsurringer og meget god kork passer godt til dette finfisket. De skal hjelpe deg n&aring;r du m&aring; legge flua som et dun p&aring; overflaten, og n&aring;r sn&oslash;replasking skremmer fisken ut p&aring; dypere vann. De skal &oslash;ke sjansene dine p&aring; n&aelig;r og mellomdistanse.&nbsp;<br><br>Stengene har en dypere og mer moderat aksjon. I kombinasjon med NRX-materialet f&aring;r vi dermed en &nbsp;stang som setter distinkte og rolige sn&oslash;rebukter. Buktene blir rundere og litt st&oslash;rre med NRX LP, og presentasjonen dermed penere. Ekstremt lettkastet serie som ikke er laget for lengdekonkurranser.<br><br>N&aring;r presentasjonen betyr alt for &aring; lykkes; NRX LP!</p>
<p style="margin: 0px 0px 2ex;"><br>V&aring;r egen G.Loomis European Pro Staff mann, Stener Skogmo, karakteriserer stengene slik:<br><strong><br>NRX LP 8&acute;8"#3<br></strong>Silkef&oslash;lelse og maksimal kontroll p&aring; bittesm&aring; nymfer og t&oslash;rrfluer. F&oslash;les veldig lett i h&aring;nden, og spenner seg opp med sv&aelig;rt korte bevegelser til tross for dyp aksjon. Jeg tror denne vil bli mange &rdquo;indianeres&rdquo; favoritt! Ordet &rdquo;lettkastet&rdquo; f&aring;r her en ny dimensjon. Har brukt stanga med WF-3 og WF-4 samt et gammelt DT-4 sn&oslash;re. Alt fungerte glimrende, men de fleste vil nok trives best med et WF-4 sn&oslash;re p&aring; korte distanser.&nbsp;<br><br><strong>NRX LP 9&acute;#4</strong><br>Denne lengden og klassen vinner stadig flere tilhengere i Norge, og ikke uten grunn. Sv&aelig;rt lette og f&oslash;lsomme stenger, som likevel takler vind og stor fisk greit. Denne f&oslash;les ogs&aring; meget lett i h&aring;nden, og krever lite kraft og bevegelse &aring; spenne opp. Ideell redskap for en &oslash;rretboms som fisker mye. Du blir ikke sliten i kastearmen av denne! Bruk en WF-4 til all round bruk, eller en WF-5 til kort og mellomdistanse.<br><br><strong>NRX LP 9&acute;#5</strong><br>Dette er stanga for fiskeren som bare vil ha en stang til alle forhold. Noe t&oslash;ffere enn sine sm&aring;s&oslash;sken, og ikke fullt s&aring; dyp aksjon. Likevel en fullblods LP med flotte presentasjonsegenskaper. Her f&aring;r du en lettkastet stang du kan bruke til fortyngede nymfer, streamere, buggers&hellip; men ogs&aring; til dunlette bittesm&aring; t&oslash;rrfluer som skal presenteres for fisk i glassklart grunt vann p&aring; n&aelig;rt hold. Her trivdes jeg best med en WF-5, men stanga t&aring;ler greit en sekser.</p>
<div>&nbsp;</div>
<p style="margin: 0px 0px 2ex;">&nbsp;</p>
<p style="margin: 0px 0px 2ex;">&nbsp;</p>
