<p style="margin: 0px 0px 2ex;">Til lettere laks- og sj&oslash;&oslash;rretfiske i rennende vann. Har vanskelig for &aring; legge denne stanga fra meg! Maken til lettkastet og behagelig stang. Til lange overhodekast eller kjappe underh&aring;ndskast i trange posisjoner, rullekast og snap-t; alt fungerer s&aring; selvf&oslash;lgelig og perfekt, og s&aring; lett. Du blir aldri trett. Min favoritt trives med alle typer sn&oslash;rer, men skal jeg anbefale noe blir det Max Taper WF7F eller NativeRun ST7I klump. &ndash;Fantastico!!!<br><br><strong>NRX 10&acute;# 8<br></strong>All round laks og sj&oslash;&oslash;rretfiske. Denne stanga er betydelig t&oslash;ffere enn lillebroren, og t&aring;ler ogs&aring; bedre synkelinefiske og st&oslash;rre fluer. Tror ikke jeg har kastet lengre med noen annen &aring;tterstang under fiskemessige forhold!&nbsp; Passer greit sammen med NativeRun klumper i klasse 8, men bruk gjerne en litt aggressiv WF-line ogs&aring;.<br><br><strong>NRX 10&acute;# 9<br></strong>N&aring; snakker vi alvor om storlaks p&aring; enh&aring;nds!&nbsp; Sett en NativeRun 9&eacute;r klump i synk 4 p&aring; snella, koble p&aring; en kort fortom og en monstertube i enden og du behersker selv tidligfisket i store tr&oslash;nderske elver. En kastekapasitet og kontroll du ikke trodde var mulig uten &aring; bruke toh&aring;nds er innen rekkevidde. Og det beste er at det slett ikke er tungt &aring; kaste med. En litt roligere aksjon sammenlignet med &aring;tteren gj&oslash;r stanga letth&aring;ndterlig for de aller fleste.</p>
