<p style="margin: 0px 0px 2ex;">Sj&oslash;&oslash;rretfiske i sj&oslash;en, eller lettere laksefiske med skyteklumper. Denne serien er stivere i aksjonen og passer derfor til t&oslash;ffere vindforhold, og lager om mulig enda trangere bukter.&nbsp; Stor linehastighet og utrolig presisjon; ingen forsinkelse mellom bevegelse i kastearm og stang! Jeg bruker mest StreamDance WF7 Intermediate sn&oslash;re, eller NativeRun ST7 Intermediate klump p&aring; denne.<br><br><strong>NRX 9&acute;# 8<br></strong>Denne t&oslash;ffingen skyr hverken kuling eller storm. Hurtig, kontant aksjon som gir vanvittig linehastighet. Passer perfekt til kystfiske, eller til gjeddefiske for den del n&aring;r du ikke blir skremt av d&aring;rlig v&aelig;r. Kraften i stanga gj&oslash;r den godt egnet til lange kast med store fluer. Jeg liker den best med EastFork WF8I eller NativeRun ST8I klump.<br><br><a style="color: #000000;" href="http://www.elbe.no/fisk/produkter/g.loomis_sortiment/fluesnorer/shooting_taper/13817/no"><span style="color: #000000;">Anbefalte klumpvekter til G.Loomis fluestenger finner du her</span></a>&nbsp;</p>
