<div style="margin-top: 10px; float: left; width: 305px; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;" class="description">
<p style="margin: 0px 0px 2ex;"><br>V&aring;r egen G.Loomis European Pro Staff mann, Stener Skogmo, karakteriserer stengene slik:<br><br>Toh&aring;ndsstengene i NRX-serien drar virkelig fordel av de nye materialenes egenskaper. I en toh&aring;ndsstang er det forholdsvis mye mer masse enn i en kortere enh&aring;nds; derfor merkes det aller mest i denne serien at stengene har blitt lettere og MYE raskere.&nbsp;De er ogs&aring; blitt mer f&oslash;lsomme. Du kjenner hver minste kontakt med fisk.<br><br><strong>NRX 13&acute; # 8/9<br></strong>Dette er en klasse og lengde som G. Loomis tradisjonelt selger mye av. B&aring;de IMX og GLX versjonene har v&aelig;rt meget vellykkede. Denne gj&oslash;r ikke skam p&aring; tradisjonen! Jeg var skeptisk f&oslash;r jeg fikk sn&oslash;re p&aring; den, for jeg mente den kjentes litt for snill ut. Jeg tok grusomt feil. I Namsen under en h&oslash;stflom med synkeline og stor oransje busteflue taklet den alle utfordringer galant, ogs&aring; etter at en stor hannlaks beit seg fast i flua. Den noe dypere aksjonen enn vi er vant til fra G. Loomis funker glimrende med det nye materialet. Takler alle sn&oslash;retyper, og alle typer kast for den del. Jeg anbefaler en Stinger klump i klasse 9 p&aring; ca. 12.5 meter med polyleader i enden.<br><br><strong>NRX 14&acute; # 9/10<br></strong>Mange var bekymret da 14&acute; GLX forsvant. De trenger ikke bekymre seg lengre. All round toh&aring;ndsfiske etter laks har f&aring;tt en ny sjef.&nbsp; Jeg kastet best med en Stinger intermediate klump i klasse 10 p&aring; 13 meter, men disse stengene er s&aring; fleksible i forhold til sn&oslash;rer at jeg mener de takler det meste bare vekten er noenlunde riktig.<br><br><strong>NRX 15&acute; # 10/11<br></strong>Mange laksefiskere i v&aring;rt langstrakte land mener at det bare er 15 fotere som er laksestenger. Og kanskje har de noe rett ogs&aring;? Det er ihvertfall lettere &aring; f&aring; lange kast jo lengre stanga er! Fordelene til NRX er som sagt vekt, styrke, hurtighet og f&oslash;lsomhet. Denne 15 foteren f&oslash;les dermed som en 13 foter uten at den mister kraften og kasteegenskapene. Du orker flere kast med NRX, og det er antall kast som teller n&aring;r du skal etter tidliglaksen.&nbsp;</p>
<p style="margin: 0px 0px 2ex;"><a style="color: #000000;" href="http://www.elbe.no/fisk/produkter/g.loomis_sortiment/fluesnorer/shooting_taper/13817/no"><span style="color: #000000;">Anbefalte klumpvekter til G.Loomis fluestenger finner du her</span></a>&nbsp;</p>
<p style="margin: 0px 0px 2ex;">&nbsp;</p>
<p style="margin: 0px 0px 2ex;">&nbsp;</p>
