INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:40', '2015-07-16 22:42:10', '2015-07-16 22:42:10', ' NRX Trout', 'gloomis-nrx-trout', 639920, '0', null, 0, 1000, '<p><strong style="color: red; font-size: 10pt; font-family: tahoma, arial, verdana, helvetica, sans-serif; line-height: 14px;"><span style="font-size: 10pt;">9 av 10&nbsp;poeng</span></strong><span style="color: red; font-size: 10pt; font-family: tahoma, arial, verdana, helvetica, sans-serif; line-height: 14px;">&nbsp;i Alt om Fiskes test av 9 fot klasse&nbsp;5 utgave nr. 5 - 2012!</span></p>
<p style="margin: 0px 0px 2ex; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;"><span style="color: red; font-size: 10pt;"><strong><span style="font-size: 10pt;"><br>5,5 poeng&nbsp;</span></strong><span style="font-size: 10pt;">i&nbsp;Alt om Fiskes&nbsp;test&nbsp;av&nbsp;9 fot klasse 6&nbsp;utgave nr.&nbsp;5 -&nbsp;2011!</span></span><br><br>V&aring;r egen G.Loomis European Pro Staff mann, Stener Skogmo, karakteriserer stengene slik:<br><br><strong>NRX 9&acute;# 3&nbsp;<br></strong>Dette er en snill stang. &Oslash;rretfiske der delikate og elegante presentasjoner er n&oslash;dvendig for suksess. S&aring; lett at du innimellom m&aring; se etter om du fremdeles holder i stanga. Noe dypere i aksjonen enn &oslash;vrige stenger i serien. Passende sn&oslash;rer vil v&aelig;re StreamDance WF3F, eller EastFork WF4F til korte kast i trange posisjoner.<br><br><strong>NRX 9&acute;# 4<br></strong>Morsom og lett stang til det vanligste &oslash;rretfisket i Norge. H&aring;ndterer alle typer kast og har en eventyrlig kapasitet for &aring; v&aelig;re en firerstang. Tipper denne kommer til &aring; bli manges favoritt. Stanga funker med alt fra DT til klumper, men passer best med en StreamDance WF4.<br><br><strong>NRX 9&acute;# 5<br></strong>Til all-roundbruk etter de vanligste innlandsartene. T&aring;ler stor fisk! Veldig lik fireren rent kastemessig, men denne g&aring;r p&aring; h&oslash;yoktan.&nbsp; Krever lite av kasteren, og gir mye tilbake. Trives like godt med StreamDance WF5 som WF6.<br><br><strong>NRX 9&acute;# 6<br></strong>Sjefen i Trout-serien. Denne er myntet p&aring; t&oslash;ft &oslash;rretfiske i krevende vindforhold, men kan ogs&aring; brukes til lettere laks og sj&oslash;&oslash;rretfiske.&nbsp; Det er utrolig at en stang som f&oslash;les som en firerstang kan p&aelig;lme s&aring; mye sn&oslash;re s&aring; lett! Stanga trives best med Max Taper WF6F eller NativeRun ST6 klump, men kaster nesten like greit med b&aring;de 5&eacute;r og 7&eacute;r sn&oslash;rer.</p>
<p style="margin: 0px 0px 2ex; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;">&nbsp;</p>
<p style="margin: 0px 0px 2ex; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;"><a href="http://www.elbe.no/fisk/produkter/g.loomis_sortiment/fluesnorer/shooting_taper/13817/no">Anbefalte klumpvekter til G.Loomis fluestenger finner du her</a></p>
<p style="margin: 0px 0px 2ex; font-family: tahoma, arial, verdana, helvetica, sans-serif; font-size: 11px; line-height: 14px;">&nbsp;</p>
<p><iframe src="http://www.youtube.com/embed/zXfHNJA2pLM" width="560" height="315" frameborder="0"></iframe></p>
