<span style="color: rgb(124, 124, 124); font-family: Verdana, Geneva, sans-serif; line-height: 15px;">Denne modulen har ekstern antenne, med SMA-tilkobling.</span></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:58', '2015-07-16 22:41:26', '2015-07-16 22:41:26', ' 4 Cast', 'guideline-4-cast', 51920, '0', null, 0, 250, '<p>4Cast har f&aring;tt sine egenskaper fra to av v&aring;re beste sn&oslash;rer, Power Taper og Highwater. Med en gang du kaster med sn&oslash;ret, kommer du til &aring; kjenne hvordan den konsentrerte og samtidig velbalanserte vektfordelingen i klumpen spenner opp stanga og gir deg super sn&oslash;rekontroll. Sn&oslash;ret har ogs&aring; en forsterket slitedel for &aring; t&aring;le dobbelttrekk, som igjen taperer seg ned til den tynne skytelinen som gir deg lange kast og presise presentasjoner. 4CAST er et f&oslash;rstevalg n&aring;r du &oslash;nsker deg et lettkastet allround flytesn&oslash;re.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:58', '2015-07-16 22:41:26', '2015-07-16 22:41:26', ' 4 Cast Sink Tip', 'guideline-4-cast-sink-tip', 51920, '0', null, 0, 250, '<p>Den lettkastede profilen til 4CAST i kombinasjon med egenskapene til POWER TAPER i F/S tilf&oslash;rer fisket en ny dimensjon. Velg mellom Synk1, Synk3 og Synk5. Den 4,5m lange synkende tuppen er velbalansert, uten en &rdquo;hengslete&rdquo; f&oslash;lelse n&aring;r du kaster, resten av sn&oslash;ret er flytende. Sn&oslash;ret er meget velegnet til kystfiske, &oslash;rretfiske i elver og vann og laks- og sj&oslash;&oslash;rretfiske i elv.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:58', '2015-07-16 22:51:11', '2015-07-16 22:51:11', 'Guideline ACT-Combo #7', 'guideline-actcombo-7', 323760, '0', null, 0, 2, '<b>Stang:ACT4 9´ #7 4-delt</b><br>Inspirert av våre fremgangsrike LPXE og LeCie serier kommer nå endelig, etter 2 års testing, nyheten ACT4. Etter hundretalls prøver, endringer, tidkrevende justeringer og forbedringer har vi endelig fått fram denne enestående serien. ACT4 har en kombinasjon av ytelse og pris vi ikke trodde var mulig å utvikle. Med kommentarer som: denne er for god til den prisen.., kan vi konstatere at ACT4 gjør seg vel fortjent vår logo. Vi er overbevist om at du får maksimalt igjen for pengene, og at du får en stang du kan glede deg over i mange år. Den 4-delte stangserien er bygget med japansk ultramoderne karbonfiberteknologi. Vi har ikke spart på kvaliteten på stangkomponentene. For å være sikre på å levere ypperste klasse, har stengene spesialdesignet snellefeste i både høykvalitets
aluminium og trevirke, som på LPXE-serien.<br><br>
<b>Snelle:Reelmaster 7/8 Seatrout</b>
Denne snellen var på sin tid for drøye fem år siden banebrytende for moderne snelleteknologi
i klassen økonomisneller av storspolemodeller. Reelmaster har vært en av våre mest solgte produkter i flere år og har skaffet seg et godt rykte for sin kvalitet.
Disse snellene regnes helt klart som de beste i sin prisklasse. Reelmaster inngår også i våre Explorer Sett. Reelmaster har en jevn og pålitelig brems som fungerer utmerket for alle fiskearter fra ørret og bonefish til laks og tarpon. Den er meget stabil, lett med en klokkeren balanse når fisken ruser.

REELMASTER er laget i 906/2 aluminium. Et materiale som både er sterkt og lett. Gjennom
en unik prosess som består av både fresing og støping, får man fram ei snelle med en finish som er enestående i denne prisklassen. Et stort stjerneformet bremseratt på gavelen gjør det lett å justere den pålitelige bremsen snella har. Akslingen er spesialherdet for å tåle varmen som utvikles ved lange fiskeutras under hardt press. Det store nålelageret i sentrum er laget i rustfritt materiale for å takle saltvann på best mulig måte. Det er dette lageret som enkelt snues når man skal skifte fra høyre til venstrehåndssveiv. Reelmaster leveres i fire modeller, har en matt grå finish og leveres i neoprenefutteral.
<br><br>
<b>Fluesnøre:Force WF7</b><br>
Force er et meget bra, prisgunstig snøre. Snøret har en smal profil og en litt lengre klump, som gir fin presentasjon på ulike kastelengder. Stabilt i luften med jevne bukter. FORCE er lettkastet med ulik lengde på klumpen tilpasset de respektive snøreklassene. Snøret passer godt til alle fluetyper og fiskesituasjoner.', '', 55, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:59', '2015-07-16 22:51:11', '2015-07-16 22:51:11', 'Guideline All Purpose Scissors', 'guideline-all-purpose-scissors', 7920, '0', null, 0, 0, '<div class="description"><span><span>F<span id="dtx-highlighting-item">i</span>n allroundsaks med serraterte blad. Egner seg ogs</span><span id="dtx-highlighting-item">&aring; </span><span>godt t<span id="dtx-highlighting-item">i</span>l kl<span id="dtx-highlighting-item">i</span>pp<span id="dtx-highlighting-item">i</span>ng av h</span><span id="dtx-highlighting-item">&aring;</span><span>r og gr&oslash;vre mater<span id="dtx-highlighting-item">i</span>aler.</span></span></div>', '', -4, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:59', '2015-07-16 22:41:26', '2015-07-16 22:41:26', ' Alta', 'guideline-alta', 263920, '0', null, 0, 2000, '<p>ALTA er v&aring;r mest avanserte jakke noensinne! Jakken er 3-lags og er laget i Toray Dermizax EV som er en av de aller mest popul&aelig;re membranene p&aring; markedet. Dermizax holder deg varm og t&oslash;rr under alle forhold. . <br><br> ALTA har rikelig med lagringsplass og et gjennomtenkt design med alle detaljer du kan &oslash;nske deg i en vadejakke. <br><br> Snittet er romslig samtidig at jakken ikke skal f&oslash;les stor eller klumpete. Jakken er medium lang og passer ogs&aring; godt sammen med et par hoftevadere eller regnbukser n&aring;r du fisker fra land eller b&aring;t. <br><br> Membran:<br> DERMIZAX EV har pusteegenskaperer p&aring; 20000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 20000 mm/per tomme. <br><br> <strong>ALTA JAKKE - DETALJER</strong> <br> &bull;To store brystlommer som ekspanderer n&aring;r du fyller de opp. Med plass for de st&oslash;rste flueboksene. <br> &bull;Venstre brystlomme har utenp&aring; liggende meshlomme for fortomsmateriale etc. <br> &bull;Begge brystlommene har lommer med borrel&aring;s i front for prep. og tilbeh&oslash;r. <br> &bull;Innerlomme av mesh med stretchmateriale. <br> &bull;Napoleonslommer bak brystlommene for varming av hendene. <br> &bull;To velplasserte retractorer som holder verkt&oslash;yene lett tilgjengelig samtidig som de ikke er i veien for kastingen eller at fluesn&oslash;ret skal henge seg opp i de. <br> &bull;Stor rygglomme for h&aring;ven eller annet utstyr med vanntett glidel&aring;s. <br> &bull;Kraftig D-ring i nakken for feste av h&aring;v. <br> &bull;Mansjettene er konstruert slik at de ikke er i veien for fluesn&oslash;ret samtidig som de s&oslash;rger for &aring; lukke helt tett. <br> &bull;Hetten kan justeres i bakhodet eller p&aring; innsiden. Romslig hette som sitter godt etter. <br> &bull;Vislon YKK glidel&aring;sen i front er kraftig og fungerer godt ogs&aring; ved saltvannsfiske. <br> &bull;Gllidel&aring;sen er dekket av dobble stormklaffer for &aring; sikre deg mot de kraftigste regnskyllene du vil oppleve.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
