INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:59', '2015-07-16 22:41:26', '2015-07-16 22:41:26', ' Alta Hoody', 'guideline-alta-hoody', 79920, '0', null, 0, 1000, '<p>Pullover av f&oslash;rsteklasses tynn fleece som puster godt og er meget behagelig &aring; ha p&aring; seg. <br>br&gt; ALTA HOODY er laget av et teknisk, avansert stoff som best&aring;r av 95% Polyester og 5% elastan 400 gr/yds. Innsiden er spesialbehandlet for &aring; unng&aring; at fuktighet binder seg i stoffet og for mest mulig effektiv transport av overfl&oslash;dig varme fra kroppen. <br><br> Det m&oslash;rkegr&aring; ytterstoffet har sm&aring; ruter for minimal friksjon. Og er laget i et glatt, sterkt materiale som ikke nupper eller slites mot vadejakken.<br><br> Genseren har glidel&aring;slukking i halsen og brystlomme p&aring; venstre siden. Guidelinelogo p&aring; b&aring;de hette og h&oslash;yre skulder.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:36:59', '2015-07-16 22:41:26', '2015-07-16 22:41:26', ' Alta Sonic Seam Bootfoot vadebukser', 'guideline-alta-sonic-seam-bootfoot-vadebukser', 279920, '0', null, 0, 5000, '<p><strong><span style="font-size: 14px;">TILBUDET GJELDER KUN 1STK BUKSE I STR XL (Skostr 12)</span></strong></p>
<p><span style="font-size: 14px;">ALTA Sonic Bootfoot kommer med fastmonterte st&oslash;vler. Vaderen har samme egenskaper som den vanlige vadebukser. St&oslash;vlene er produsert i en spesielt lett h&oslash;ydensitets neoprene som gj&oslash;r dem varme og komfortable. Dette bidrar ogs&aring; til at ALTA er en av de letteste st&oslash;velvaderne p&aring; markedet i dag.</span></p>
<p><span style="font-size: 14px;">Det nye snittet er helt uten sveisede s&oslash;mmer p&aring; innsiden av beina og har fremdeles den gode passformen og bevegelsesfriheten som disse buksene er kjent for.</span></p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 14px;">Med ny produksjonsteknologi og design tar vi v&aring;re nye ALTA vadebukser til et h&oslash;yere niv&aring; for kvalitet og prestasjon. ALTA Sonic er helt uten tradisjonelle s&oslash;mmer.</span><br style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><br style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 14px;">Ultrasonisk sveiseteknologi betyr at stoffet sveises sammen med ultralyd fremfor bruk av n&aring;l og tr&aring;d. Ved &aring; eliminere punkteringer med n&aring;l og tr&aring;d vil vadebuksene f&aring; en betydelig h&oslash;yere kvalitet.&nbsp;</span><br style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><br style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"></p>
<p>&nbsp;</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:00', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Alta V2', 'guideline-alta-v2', 295920, '0', null, 0, 3000, '<p>I ALTA V2 har vi beholdt den avanserte fasongen p&aring; buksene som kun matches av teknisk bekledning for bla. klatring og alpint. Med formsydde kn&aelig;r og tekniske detaljer er dette en behagelig bukse for aktive fiskere. Vi har oppgradert med beste Bi-Komponent stoff som Japanske ASF Corporation har &aring; tilby. Dette l&oslash;fter buksene opp til det h&oslash;yeste niv&aring;et for kvalitet. <br><br> Buksene har et super solid, 4-lags b&oslash;rstet Taffetta materiale som er mykt og st&oslash;ysvakt. Den sorte, &oslash;vre delen av buksen har et 4-veis stretchmateriale for &aring; sikre optimal komfort og for &aring; myke opp slik at det er mer behagelig &aring; g&aring; med nedbrettede vadere. <br><br></p>
<p>I ALTA V2 har vi utbedret grusbeskytterne slik at de enkelt kan rulles over st&oslash;velen, laget av solid neoprene. Ogs&aring; vadebeltet har f&aring;tt en ansiktsl&oslash;ftning, i V2 g&aring;r vadebeltet utenp&aring;, dvs. vi har lagt til en kanal som g&aring;r utenp&aring; selve buksa. Beltet er bredt og fleksibelt.<br><br><br></p>
