</tbody>
</table>
</td>
<td><br><br>BI-komponent membraner er vanntette og pustende tekstiler. Membranen transporterer b&aring;de kondens, damp og flytende svette.<br><br>Eclipse&trade; Twin Sensor II er testet til &aring; transportere <span style="font-size: 11pt; font-family: ''Calibri'',''sans-serif'';">8000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 20000 mm/per tomme. Dette er en f&oslash;rsteklasses Japansk membran med meget gode egenskaper.<br></span></td>
