<li>Fin laminert nettlomme p&aring; h&oslash;yre l&aring;r for oppbevaring av fortomsmaterialer mm. som t&aring;ler vann.</li>
<li>RIRI STORM TM vanntett glidel&aring;s fra Sveits gj&oslash;r det lett &aring; komme inn og ut av buksene, og ikke minst gir ventilasjon n&aring;r det blir varmt.</li>
<li>To h&oslash;yt plasserte lommer holder div. sm&aring;saker sikkert over vann.</li>
