INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:00', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Blueray Shirt', 'guideline-blueray-shirt', 55920, '0', null, 0, 1000, '<p>En myk og luftig skjorte i 100% nylon som har mange tekniske egenskaper: Stoffet er spesialbehandlet for &aring; v&aelig;re rasktt&oslash;rkende, antistatisk og motvirker dessuten at vond lukt setter seg. <br><br> Skjorten har solbeskyttende egenskaper, UPF 30+. <br><br> BLUERAY har et slankt snitt. P&aring; brystet er det to skjulte lommer med glidel&aring;s. Armene har festeanordning om du &oslash;nsker &aring; brette opp ermet.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
