Coastal i Flyt har Transparent klump med farget skyteline og er et teknologisk gjennombrudd hos vår snøreprodusent. Coastal i flyt har samme tapering og kjerne  (DC) som de to populære synkende utgavene.
Fargen på klumpen gir god kamuflasje i vannet, skytelinen er lett synlig og gir deg god kontroll når du kaster.
<br>
Coastal Slow intermediate snøret ligger rett under overflaten og lager ikke noen forstyrrelser under fisket. Den er produsert med den utrolig effektive DC kjernen med bare 5% strekk, hvilket gjør det mulig å både se og kjenne de minste bevegelser under inntrekket. Synkehastigheten er 1,25cm / sekund, ideelt til fiske rett under overflaten.
<br>
Coastal fast intermediate er perfekt til avfisking av marbakker og kanter i sjøen. Stillevanns fiskeren vil også ha mye glede av dette snøret til sitt nymfe og streamerfiske. Fast intermediate har en synkehastighet på 3,8cm/sek.', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:01', '2015-07-16 22:51:11', '2015-07-16 22:51:11', 'Guideline Coastal Slow Intermediate', 'guideline-coastal-slow-intermediate2', 63920, '0', null, 0, 250, '<p>Vi har laget COASTAL for fiske etter sj&oslash;&oslash;rret, havabbor, multe og andre kystn&aelig;re arter som lever p&aring; grunt vann og krever lange, forsiktige og presise kast. Taperingen og presentasjonen p&aring; dette sn&oslash;ret gj&oslash;r det ogs&aring; utmerket til et ferskvannsn&oslash;re n&aring;r du &oslash;nsker h&oslash;y line hastighet og lange kast. <br> <br> Coastal i Flyt har Transparent klump med farget skyteline og er et teknologisk gjennombrudd hos v&aring;r sn&oslash;reprodusent. Coastal i flyt har samme tapering og kjerne (DC) som de to popul&aelig;re synkende utgavene. Fargen p&aring; klumpen gir god kamuflasje i vannet, skytelinen er lett synlig og gir deg god kontroll n&aring;r du kaster. <br> Coastal Slow intermediate sn&oslash;ret ligger rett under overflaten og lager ikke noen forstyrrelser under fisket. Den er produsert med den utrolig effektive DC kjernen med bare 5% strekk, hvilket gj&oslash;r det mulig &aring; b&aring;de se og kjenne de minste bevegelser under inntrekket. Synkehastigheten er 1,25cm / sekund, ideelt til fiske rett under overflaten. <br> Coastal fast intermediate er perfekt til avfisking av marbakker og kanter i sj&oslash;en. Stillevanns fiskeren vil ogs&aring; ha mye glede av dette sn&oslash;ret til sitt nymfe og streamerfiske. Fast intermediate har en synkehastighet p&aring; 3,8cm/sek.</p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:02', '2015-07-16 22:51:11', '2015-07-16 22:51:11', 'Guideline Compline', 'guideline-compline', 23920, '0', null, 0, 250, 'Dette er vårt beste skytesnøre! Compline er et klassisk skytesnøre av solid og langsomt synkende Flat Beam type. Denne typen har alltid vært den som kaster best, har minst krøll og best holdbarhet. COMPLINE er sterk i forhold til diameteren og er oval for minimal friksjon.
