INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:02', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Compline', 'guideline-compline2', 23920, '0', null, 0, 250, '<p>Dette er v&aring;rt beste skytesn&oslash;re! Compline er et klassisk skytesn&oslash;re av solid og langsomt synkende Flat Beam type. Denne typen har alltid v&aelig;rt den som kaster best, har minst kr&oslash;ll og best holdbarhet. COMPLINE er sterk i forhold til diameteren og er oval for minimal friksjon. <br><br> Leveres i fire dimensjoner <br>&ndash; Trout 25lbs <br>&ndash; Seatrout 35lbs <br>- Salmon 42lbs <br>- Salmon 50lbs.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:02', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Crosswater', 'guideline-crosswater', 159920, '0', null, 0, 3000, '<p>CROSSWATER er buksa for deg som er ute etter et prisgunstig alternativ med h&oslash;y funksjon og detaljer som finnes p&aring; betydelig dyrere vadere.<br><br> Buksa har rift- og stikkmotstandig sterkt 4-lags stoff som puster bra. CROSSWATER er sydd etter den suverene passformen til Techstretch buksa, med formsydde ben. Buksa er forsterket p&aring; fremsiden av ben og l&aring;r med et ekstra lag som gir ekstra beskyttelse mot rift.<br><br> En innvendig lomme som du enkelt kommer til fra utsiden med en vannavvisende glidel&aring;s, finnes ogs&aring; p&aring; buksen. <br><br> CROSSWATER har innebygde grusbeskyttere. Neoprene sokkene er produsert i h&oslash;ykvalitets neoprene og isolerer meget godt. Sokken har en bekvem passform og god bredde rundt t&aelig;rne. Buksa er utstyrt med elastiske, avtakbare seler.<br><br> Farge: M&oslash;rk khaki/brungr&aring; forsterkninger.</p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:02', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Crosswater V2', 'guideline-crosswater-v2', 103920, '0', null, 0, 3000, '<p>De nye Crosswater V2 skoene er inspirert og basert p&aring; de moderne lettvektsskoene som i dag finnes p&aring; hiking-markedet. Den lave vekten og den str&oslash;mlinjeformede designen kommer av at vi bruker en s&aring;le fra EVA i stedet for tradisjonell gummis&aring;le som bare f&oslash;les klumpete og tung. Crosswater V2 kommer med b&aring;de filt og TRACTION gummis&aring;le.</p>
<p>Skaftet og &oslash;vre del av skoen er i en sterk K-80 nylonmesh med l&aelig;rforsterkninger som &oslash;ker slitestyrken. Nedre del av skoen er forsterket med et bredt fleksibelt gummimateriale som beskytter skoen mot skarpe stener og lignende. H&oslash;y komfort, utrolig lett, hurtigt&oslash;rkende, samt ingen detaljer som ruster, er n&oslash;kkelordene for nye Crosswater II.<br><br></p>
