INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:31', '2015-07-16 22:41:31', ' Drifter Bellyboat', 'guideline-drifter-bellyboat', 223919, '0', null, 0, 8000, '<p>Norges mest popul&aelig;re flytering er meget lettman&oslash;vrert, stabil, h&oslash;ytflytende og lettpadlet. DRIFTER er lett &aring; b&aelig;re og lett &aring; transportere. Den kan fint pakkes ned i en stor ryggsekk. Leveres i fargekombinasjonen beige/sort med oransje sikkerhetsfelt i front og ferdig monterte innertuber. Utstyr for reparasjon av hull medf&oslash;lger. <br> <br>- To separate flyteelementer med doble kammer p&aring; hver side. <br>- Oppbl&aring;sbart sete og ryggst&oslash;tte gj&oslash;r den meget komfortabel &aring; sitte i. <br>- Justerbar seterygg. <br>- Meshrom i front der du oppbevarer utstyr i vanntette pakksekker. <br>- Doble sidelommer p&aring; hver side. Med totalt 4 rom pr. side. <br>- Plenty med D-ringer. <br>- Sidestropper for &aring; stramme flyteringen <br>- To spesialventiler p&aring; hver side som fyller eller t&oslash;mmer flyteelementene p&aring; et par minutter. <br>- B&aelig;rereimer p&aring; undersiden. <br>- M&aring;lestreker p&aring; underlag for sn&oslash;re, oppgitt i inch (x med 2,54 for &aring; f&aring; cm). 20 inch er 50,8 cm. <br>- Borrel&aring;ser p&aring; siden av underlaget for feste av stanga. <br><br> <strong>TIPS</strong><br> <br> 1) N&aring;r du bl&aring;ser opp DRIFTER for f&oslash;rste gang har pontongene en tendens til &aring; vri seg. Ta det litt pent og sjekk at ventilene er skikkelig sentrert i hullet. <br><br> 2) Ikke bl&aring;s ventil 1 helt knallhard og s&aring; ventil 2 knallhard. I ventil 1 som er det midtre kammeret fyller du p&aring; slik at den er ganske fast. Hovedmengden pumper du inn i ventil 2 som er det store kammeret. Ikke bl&aring;s opp mer enn at du fint kan trykke fingeren en cm ned i pontongen. <br><br> Husk! N&aring;r det er varmt ute ekspanderer luften og gj&oslash;r pontongene hardere. Glemmer du flyteringen p&aring; land i sola kan pontongene eksplodere. Ta ut minst halvparten av luften ved lagring ute.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Exceed Enhånds', 'guideline-exceed-enhands', 159920, '0', null, 0, 3000, '<p>EXCEED baserer seg p&aring; v&aring;re beste og mest popul&aelig;re stenger fra det siste ti&aring;ret. Vi har jobbet med disse som utgangspunkt, og gjort EXCEED til de beste mellomklassestengene vi noensinne har produsert. Tolv enh&aring;nds-, tre Switch og fire toh&aring;ndsstenger gir deg en rekke modeller &aring; velge mellom. Vi bruker ogs&aring; i denne stangserien v&aring;r velpr&oslash;vde multi-modulus m&aring;te &aring; bygge stenger p&aring;. Hver eneste stang har sin unike blanding av japanske karbonduker som gj&oslash;r det mulig &aring; trekke det beste ut av de ulike materialene og taperingene. Ekspertisen hos Guideline&rsquo;s sjefsdesigner Leif St&auml;vmo og ingeni&oslash;rene p&aring; fabrikken har resultert i en stangserie som garantert kommer til &aring; gi smilefjes hos de fleste. Etter hvert som stang etter stang ble utviklet, ble ogs&aring; Guideline teamet meget imponert over prestasjonene til disse stengene. Ja, over all forventning. Derfor navnet EXCEED.<br><br> De lettere enh&aring;ndsmodellene har hentet inspirasjon og aksjonskurver fra de popul&aelig;re Fariostengene. En jevn, men fremdeles kraftig aksjon som takler en mengde ulike kasteteknikker og bruksomr&aring;der. 9&rsquo;6 og 10&rsquo; modellene har utviklet seg gjennom haugevis med prototyper og tester. Resultatet er en stangserie som kjennetegnes av at de er raske, men samtidig gir en god katapultf&oslash;lelse n&aring;r du kaster. Dette kjenner du virkelig n&aring;r du speycaster.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
