INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Exceed Enhånds', 'guideline-exceed-enhands2', 159920, '0', null, 0, 3000, '<p>EXCEED baserer seg p&aring; v&aring;re beste og mest popul&aelig;re stenger fra det siste ti&aring;ret. Vi har jobbet med disse som utgangspunkt, og gjort EXCEED til de beste mellomklassestengene vi noensinne har produsert. Tolv enh&aring;nds-, tre Switch og fire toh&aring;ndsstenger gir deg en rekke modeller &aring; velge mellom. Vi bruker ogs&aring; i denne stangserien v&aring;r velpr&oslash;vde multi-modulus m&aring;te &aring; bygge stenger p&aring;. Hver eneste stang har sin unike blanding av japanske karbonduker som gj&oslash;r det mulig &aring; trekke det beste ut av de ulike materialene og taperingene. Ekspertisen hos Guideline&rsquo;s sjefsdesigner Leif St&auml;vmo og ingeni&oslash;rene p&aring; fabrikken har resultert i en stangserie som garantert kommer til &aring; gi smilefjes hos de fleste. Etter hvert som stang etter stang ble utviklet, ble ogs&aring; Guideline teamet meget imponert over prestasjonene til disse stengene. Ja, over all forventning. Derfor navnet EXCEED.<br><br> De lettere enh&aring;ndsmodellene har hentet inspirasjon og aksjonskurver fra de popul&aelig;re Fariostengene. En jevn, men fremdeles kraftig aksjon som takler en mengde ulike kasteteknikker og bruksomr&aring;der. 9&rsquo;6 og 10&rsquo; modellene har utviklet seg gjennom haugevis med prototyper og tester. Resultatet er en stangserie som kjennetegnes av at de er raske, men samtidig gir en god katapultf&oslash;lelse n&aring;r du kaster. Dette kjenner du virkelig n&aring;r du speycaster.</p>', '', 3, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' EXP4 Enhånds', 'guideline-exp4-enhands', 79920, '0', null, 0, 3000, '<p>V&aring;r helt nye EXP4 tilbyr meget gode egenskaper og ytelse for nybegyn- nere eller viderekommende fluefiskere som ser etter en rask, lett stang til en hyggelig pris.Velg mellom 10 ulike modeller fra sn&oslash;reklasse 3 til 8, som dekker de vanligste fiskesituasjonene.<br><br> Stengene spennes lett opp og har en tilgivelig aksjon. EXP4 er laget av ulike typer karbonblandinger. De har et helt nytt design, bedre materialer og aksjoner, og opp- leves som en generasjon mer moderne stenger enn forgjengeren EXP3. Og det til en bedre pris!<br><br> EXP4 har en rustfarget metallic klinge med matchende surringer. Hver stangdel er merket med stanglengde og klasse. Korken er av god kvalitet, h&aring;ndtakene er grepsvennlige og passer alle h&aring;ndtyper. Stenger opp til sn&oslash;reklasse 5 har snellefester med kastanjefarget treinnlegg og aluminiumsdeler.<br> &Oslash;vrige modeller har v&aring;rt eget t&oslash;ffe, supersolide snellefeste med deler som er hardt eloksert for &aring; t&aring;le saltvann og r&oslash;ff bruk. Alle EXP4 stenger har enbente ringer av hardkrom, linef&oslash;rerne er r&oslash;ykfargede og har innlegg av Hardloy. Stengene kommer med stangtrekk og transporttube.<br><br> </p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' EXP4 Enhånds', 'guideline-exp4-enhands2', 79920, '0', null, 0, 3000, '<p>V&aring;r helt nye EXP4 tilbyr meget gode egenskaper og ytelse for nybegyn- nere eller viderekommende fluefiskere som ser etter en rask, lett stang til en hyggelig pris.Velg mellom 10 ulike modeller fra sn&oslash;reklasse 3 til 8, som dekker de vanligste fiskesituasjonene.<br><br> Stengene spennes lett opp og har en tilgivelig aksjon. EXP4 er laget av ulike typer karbonblandinger. De har et helt nytt design, bedre materialer og aksjoner, og opp- leves som en generasjon mer moderne stenger enn forgjengeren EXP3. Og det til en bedre pris!<br><br> EXP4 har en rustfarget metallic klinge med matchende surringer. Hver stangdel er merket med stanglengde og klasse. Korken er av god kvalitet, h&aring;ndtakene er grepsvennlige og passer alle h&aring;ndtyper. Stenger opp til sn&oslash;reklasse 5 har snellefester med kastanjefarget treinnlegg og aluminiumsdeler.<br> &Oslash;vrige modeller har v&aring;rt eget t&oslash;ffe, supersolide snellefeste med deler som er hardt eloksert for &aring; t&aring;le saltvann og r&oslash;ff bruk. Alle EXP4 stenger har enbente ringer av hardkrom, linef&oslash;rerne er r&oslash;ykfargede og har innlegg av Hardloy. Stengene kommer med stangtrekk og transporttube.<br><br></p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:03', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Experience', 'guideline-experience', 51920, '0', null, 0, 250, '<p>Experience er laget for &aring; dekke en rekke ulike fiskesituasjoner. Sn&oslash;ret fungerer godt p&aring; n&aelig;rfiske, du f&aring;r raskt opp hastighet og oppspenning. Og den kommer enda mer til sin rett p&aring; medium til lengre kast. <br> <br> Sn&oslash;ret har en superglatt coating, en tynn diameter p&aring; klumpen, og en kjerne med n&oslash;ye utvalgt stivhet som alt i alt resulterer i et sn&oslash;re med h&oslash;y hastighet som leverer lange kontrollerte kast. <br> <br> Hemmeligheten ligger i balansen mellom den lange fronttaperingen, en middels lang belly og baktaperingen etterfulgt av en tykk &rdquo;handling line&rdquo; som lar deg holde mer sn&oslash;re i luften n&aring;r du &oslash;nsker &aring; kaste langt. <br> <br> Skytelina er relativt tynn, forsinker overrullingen og s&oslash;rger for at linebukten holder seg lengre. Den s&oslash;rger ogs&aring; for gode skyteegenskaper og gir lange kast n&aring;r det er p&aring;krevd. <br> Sn&oslash;ret har en diskret gr&oslash;nn farge p&aring; klumpen som virker kamuflerende n&aring;r du fisker p&aring; lettskremt fisk. Skytelinen er benfarget (hvit), lett synlig og gir god kontrast mellom klump og skyteline for god kontroll n&aring;r du kaster og fisker. <br> <br> <br> Experience er et stabilt og raskt long belly sn&oslash;re som takler alle typer kast utmerket. Pga. forholdsvis kort baktapering s&aring; egner dette sn&oslash;ret seg ogs&aring; veldig godt til vannkast. Gode vannkastegenskaper var et viktig punkt n&aring;r vi utviklet dette sn&oslash;ret. Den forholdsvis lange fronttaperingen (4,5m i klasse 5) gj&oslash;r at sn&oslash;ret er lett &aring; l&oslash;fte fra vannet og den &oslash;kende vekten bakover s&oslash;rger for riktig balanse n&aring;r du skal rulle-, spey-, eller switch kaste. <br> <br> Experience er utviklet for &aring; dekke flest mulige fiskesituasjoner og ulike typer kast. Til tross for ganske lang klump, er dette sn&oslash;ret meget lettkastet. Er du i utgangspunktet litt ukomfortabel med lengre klumper s&aring; ikke bry deg om hva du tidligere har erfart. Gi dette sn&oslash;ret et fors&oslash;k og f&aring; din egen "Experience". <br> <br> EXPERIENCE SPESIFIKASJONER <br> <br> <br> Klasse Klumpvekt Klumplengde Lengde WF 3 11 grams/169 grains 12,6 m/41,5 feet 25 m/82,5 feet WF 4 13 grams/200 grains. 13,1 m/43,1 feet 27,5 m/90 feet WF 5 15 grams/231 grains 13,6 m/44,5 feet 30 m/98 feet WF 6 17 grams/262 grains 13,8 m/45,4 feet 32 m/105 feet WF 7 19 grams/293 grains 14,1 m/46,4 feet 32 m/105 feet</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:04', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Experience', 'guideline-experience2', 199920, '0', null, 0, 3000, '<p>Lett, solid og komfortabel 3-lags jakke som gir deg veldig god ytelse og egenskaper til en meget god pris. <br><br> Vel overveide detaljer og et flott snitt gj&oslash;r denne jakka sv&aelig;rt komfortabel. <br><br> Jakka har ytterstoff av 50 Denier lettvekt polyester som er laminert til en membran som t&aring;ler en vanns&oslash;yle p&aring; 10 000mm. Pusteegenskaper p&aring; 5000 gr/m2. <br><br> Farge: Steel Blue</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:04', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Fario 9 4', 'guideline-fario-9-4', 144000, '0', null, 0, 1000, '', '', -1, 1, 0, 1, null, '25', null, '', '', null, null, 0);
