<p>SALMO TRUTTA. Det f&oslash;rste vakre latinske ordet en &oslash;rretfisker l&aelig;rer seg. Visste du forresten at Salmo Trutta Fario betyr &oslash;rret som lever i elv? Hva er vel da mer naturlig enn &aring; kalle v&aring;r rendyrkede stangserie for innlandsfiske for FARIO? Disse stengene er designet med omhu i samarbeide med en rekke &oslash;rretfiskere. I denne stangserien finner du stenger som passer til alle situasjoner du opps&oslash;ker som &oslash;rretfisker. FARIO har en dypere aksjon som gj&oslash;r den perfekt i stand til &aring; takle det vanskelige n&aelig;rdistansefisket. I tillegg er den utstyrt med en mer distinkt topp som virkelig setter fart p&aring; de hurtige fibrene n&aring;r man skal presentere flua perfekt p&aring; distanse. Aksjonsformen gj&oslash;r stengene meget allsidige og utseendet formelig skriker &oslash;rretfiske!<br><br></p>
<h3><span style="font-weight: bold;">FARIO F&Oslash;LELSEN</span></h3>
<table class="user-table" style="width: 640px;">
<tbody>
<tr>
<td>
<ul>
<li>Stengene har en jevn, dyp aksjon som samtidig sl&aring;r raskt.<br><br></li>
<li>Stengene har rikelig med krefter for lengre kast samtidig som de er delikate og presise p&aring; n&aelig;rdistanse.<br><br></li>
<li>N&aring;r du fisker p&aring; kort og mellomdistanse absorberer disse stengene de f&oslash;rste kraftige reaksjonene fra fisken og sikrer at du beholder den p&aring;. Du vil ogs&aring; fiske mer effektivt, enklere p&aring; disse lengdene siden du umiddelbart f&aring;r respons i de nedre delene av stanga.<br><br></li>
<li>Til tross for den dypere slaglengden i klingen setter den stor fart/akselerasjon.<br> Stanga takler derfor ogs&aring; lengre kast uten "griserumper" pga. en distinkt topp og levende bunndel.<br><br></li>
<li>Stengene er meget godt egnet til underh&aring;ndskast, dybden i stanga hjelper deg spesielt mye i de lettere sn&oslash;reklassene. De takler temposkiftet og du f&aring;r maksimal kontroll og f&oslash;lsomhet.</li>
</ul>
</td>
