<td><strong>FARIO 763 | 7&rsquo;6&rdquo; | #3 | 4-piece<br></strong> En f&oslash;lsom smygfiskestang for de mest lettskremte aurene. Kommer virkelig til sin rett der krattene er tette og luftkasting er utopi. Kamuflasjejakke og polaroidbriller er obligatorisk sammen med denne!</td>
