<td><strong>FARIO 863 | 8&rsquo;6&rdquo; | #3 | 4-piece<br></strong> Dette har blitt en fantastisk 3`er stang. N&aelig;rmere allround treer kommer du ikke. Stanga er dyp og f&oslash;lsom, egner seg sv&aelig;rt bra til n&aelig;rdistanse og tynnfortomsfiske. I tillegg har den s&aring; stabil topp at du kan dra p&aring; fart og fiske ogs&aring; p&aring; lengre hold. Dette er ogs&aring; en treer du kan underh&aring;ndskaste med i kombinasjon med et hurtig sn&oslash;re. Eks. Presentation.</td>
<td><strong>FARIO 1003 | 10&rsquo;0&rdquo; | #3 | 4-piece</strong><br> Nyhet for 2011! Denne stanga er i likhet med 10'' #4 i f&oslash;rste rekke laget for nymfe- og t&oslash;rrfluefiske i elv. Den er f&oslash;lsom i tuppen for &aring; beskytte tynne fortommer, og har samtidig en aksjon som gj&oslash;r den god &aring; kaste med. Denne modellen er enda mer spisset mot nymfefiske og har en dypere slanglengde enn 10fot 4''ern.</td>
