<tr>
<td><strong>FARIO 804 | 8&rsquo;0&rdquo; | #4 | 4-piece<br></strong> En 4''er for fiske i sm&aring;elver. Hvis det er trangt om plassen og mye underh&aring;ndskasting er denne et supert valg. Selv om stanga er kort, oppleves den dyp og snill. Dette gir deg f&oslash;lelsen av &aring; fiske med en mye lengre stang, til tross for at du begrenser aksjonsradiusen din. Stanga er en utrolig morsom smygfiskestang som ogs&aring; gjerne bringer fluen din en del meter lengre ut hvis det trengs.</td>
<td><strong>FARIO 904 | 9&rsquo;0&rdquo; | #4 | 4-piece<br></strong> Mange har 4''er som allroundstang, denne passer virkelig til beskrivelsen! Stanga takler alle typer kast og situasjoner hvor du &oslash;nsker deg en 9''fots stang til t&oslash;rrflue og nymfefiske. Dyp, kraftfull, f&oslash;lsom og meget samarbeidsvillig. Folkefirern!</td>
</tr>
<tr>
<td><strong>FARIO 1004 | 10&rsquo;0&rdquo; | #4 | 4-piece<br></strong> Spesialstang for nymfefiske. Fisker du polsk- eller tsjekkisk nymfeteknikk med de tynneste fortommene p&aring; kort og mellomdistanse, m&aring; stanga kunne takle b&aring;de harde hugg og raske utras. Stanga er b&aring;de dyp og f&oslash;lsom, du kjenner hugget og fisken slipper ikke unna.</td>
<td width="50%"><strong>FARIO 865 | 8&rsquo;6&rdquo; | #5 | 4-piece<br></strong> Med denne stangen oppst&aring;r et nytt begrep -<br> <em>Smygfiskefemmern!</em> Denne f&aring;r de fleste 5''er stenger til &aring; virke som en 7''er! Utrolig f&oslash;lsom, dyp og lettkastet. Et f&oslash;rstevalg n&aring;r du &oslash;nsker en lett, delikat 5''er til finfiske i vann og elver. Vi anbefaler Presentation sn&oslash;ret p&aring; denne.</td>
</tr>
<tr>
<td><strong>FARIO 905 | 9&rsquo;0&rdquo; | #5 | 4-piece<br></strong> Nifotfemmeren er et begrep for innlandsfiskerne. Her har vi en allround femmer som virkelig kan brukes til det meste. Den har en relativt dyp aksjon med en kraftigere toppdel . Noe som gj&oslash;r denne femmeren meget f&oslash;lsom og egnet til smygfiske. I kombinasjon med toppdelen b&aelig;rer ogs&aring; denne stanga mye sn&oslash;re og st&oslash;rre fluer. Her kan du kaste kort, langt, med store fluer, sm&aring; fluer, speycast og med alle typer sn&oslash;rer p&aring; en bra m&aring;te!<br><br>Testvinner i flere blader b&aring;de i 2010 og 2011!!</td>
<td width="50%">
