</td>
</tr>
<tr>
<td><strong>FARIO 866 | 8&rsquo;6&rdquo; | #6 | 4-piece</strong><br> Denne er spesialutviklet for nymfe- og streamerfiske i elv. V&aring;re finske venner har etterspurt denne til sitt fiske etter stor&oslash;rret i finske skogselver.</td>
<td width="50%"><strong>FARIO 906 | 9&rsquo;0&rdquo; | #6 | 4-piece<br></strong> Fjellstanga som takler vind, men samtidig er morsom nok &aring; fiske t&oslash;rrfluer med. Ogs&aring; en super streamerfiske stang. Dette er en 6''er stang som er bygget for &oslash;rretfiskeren!</td>
