INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:05', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Fario Enhånds', 'guideline-fario-enhands2', 295920, '0', null, 0, 3000, '<h2>KLASSISK ELEGANSE FOR ØRRETFISKEREN!</h2>
<p>SALMO TRUTTA. Det første vakre latinske ordet en ørretfisker lærer seg. Visste du forresten at Salmo Trutta Fario betyr ørret som lever i elv? Hva er vel da mer naturlig enn å kalle vår rendyrkede stangserie for innlandsfiske for FARIO? Disse stengene er designet med omhu i samarbeide med en rekke ørretfiskere. I denne stangserien finner du stenger som passer til alle situasjoner du oppsøker som ørretfisker. FARIO har en dypere aksjon som gjør den perfekt i stand til å takle det vanskelige nærdistansefisket. I tillegg er den utstyrt med en mer distinkt topp som virkelig setter fart på de hurtige fibrene når man skal presentere flua perfekt på distanse. Aksjonsformen gjør stengene meget allsidige og utseendet formelig skriker ørretfiske!<br><br></p>
<h3><span style="font-weight: bold;">FARIO FØLELSEN</span></h3>
<table class="user-table" style="width: 640px;">
<tbody>
<tr>
<td>
<ul>
<li>Stengene har en jevn, dyp aksjon som samtidig slår raskt.<br><br></li>
<li>Stengene har rikelig med krefter for lengre kast samtidig som de er delikate og presise på nærdistanse.<br><br></li>
<li>Når du fisker på kort og mellomdistanse absorberer disse stengene de første kraftige reaksjonene fra fisken og sikrer at du beholder den på. Du vil også fiske mer effektivt, enklere på disse lengdene siden du umiddelbart får respons i de nedre delene av stanga.<br><br></li>
<li>Til tross for den dypere slaglengden i klingen setter den stor fart/akselerasjon.<br> Stanga takler derfor også lengre kast uten "griserumper" pga. en distinkt topp og levende bunndel.<br><br></li>
<li>Stengene er meget godt egnet til underhåndskast, dybden i stanga hjelper deg spesielt mye i de lettere snøreklassene. De takler temposkiftet og du får maksimal kontroll og følsomhet.</li>
</ul>
</td>
<td>
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/rods/FARIO/bthtroutkiss.jpg?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
</tr>
</tbody>
</table>
<p> </p>
<table class="user-table" style="width: 638px; height: 48px;">
<tbody>
<tr>
<td colspan="2">
<h3><strong> FARIO DETALJER</strong></h3>
</td>
</tr>
<tr>
<td>
<ul>
<li>High gloss olivenfarget klinge.<br><br></li>
<li>Burgunderrøde surringer med innlegg av kobbertråd.<br><br></li>
<li>Snellefeste i edeltre, med lasergravert døgnflue på buttcapen.<br><br></li>
<li>Vakre reversed half wells håndtak med innlegg av mørkere korkringer.<br> Laget av førsteklasses kork fra Portugal i flor grade kvalitet.<br><br></li>
<li>Klassiske snakeringer i hardcrome.<br><br></li>
<li>Stangtube i aluminium med Fario logo og døgnfluemotiv.<br><br></li>
<li>Hver stangdel har siktepunt for montering og klasse/lengde påskrevet.</li>
</ul>
</td>
<td width="50%"><br> <br>
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/rods/FARIO/fariovulgata.jpg?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
</tr>
</tbody>
</table>
<p> </p>
<table class="user-table" style="height: 120px; width: 640px;">
<tbody>
<tr>
<td colspan="2">
<h3><strong>MODELLGUIDE - FARIO</strong></h3>
</td>
</tr>
<tr>
<td width="50%"><strong>FARIO 802 | 80 | #2 | 4-piece</strong><br> En herlig liten stang for det letteste fisket i små vann og elver.</td>
<td><strong>FARIO 763 | 76 | #3 | 4-piece<br></strong> En følsom smygfiskestang for de mest lettskremte aurene. Kommer virkelig til sin rett der krattene er tette og luftkasting er utopi. Kamuflasjejakke og polaroidbriller er obligatorisk sammen med denne!</td>
</tr>
<tr>
<td><strong>FARIO 863 | 86 | #3 | 4-piece<br></strong> Dette har blitt en fantastisk 3`er stang. Nærmere allround treer kommer du ikke. Stanga er dyp og følsom, egner seg svært bra til nærdistanse og tynnfortomsfiske. I tillegg har den så stabil topp at du kan dra på fart og fiske også på lengre hold. Dette er også en treer du kan underhåndskaste med i kombinasjon med et hurtig snøre. Eks. Presentation.</td>
<td><strong>FARIO 1003 | 100 | #3 | 4-piece</strong><br> Nyhet for 2011! Denne stanga er i likhet med 10'' #4 i første rekke laget for nymfe- og tørrfluefiske i elv. Den er følsom i tuppen for å beskytte tynne fortommer, og har samtidig en aksjon som gjør den god å kaste med. Denne modellen er enda mer spisset mot nymfefiske og har en dypere slanglengde enn 10fot 4''ern.</td>
</tr>
<tr>
<td><strong>FARIO 804 | 80 | #4 | 4-piece<br></strong> En 4''er for fiske i småelver. Hvis det er trangt om plassen og mye underhåndskasting er denne et supert valg. Selv om stanga er kort, oppleves den dyp og snill. Dette gir deg følelsen av å fiske med en mye lengre stang, til tross for at du begrenser aksjonsradiusen din. Stanga er en utrolig morsom smygfiskestang som også gjerne bringer fluen din en del meter lengre ut hvis det trengs.</td>
<td><strong>FARIO 904 | 90 | #4 | 4-piece<br></strong> Mange har 4''er som allroundstang, denne passer virkelig til beskrivelsen! Stanga takler alle typer kast og situasjoner hvor du ønsker deg en 9''fots stang til tørrflue og nymfefiske. Dyp, kraftfull, følsom og meget samarbeidsvillig. Folkefirern!</td>
</tr>
<tr>
<td><strong>FARIO 1004 | 100 | #4 | 4-piece<br></strong> Spesialstang for nymfefiske. Fisker du polsk- eller tsjekkisk nymfeteknikk med de tynneste fortommene på kort og mellomdistanse, må stanga kunne takle både harde hugg og raske utras. Stanga er både dyp og følsom, du kjenner hugget og fisken slipper ikke unna.</td>
<td width="50%"><strong>FARIO 865 | 86 | #5 | 4-piece<br></strong> Med denne stangen oppstår et nytt begrep -<br> <em>Smygfiskefemmern!</em> Denne får de fleste 5''er stenger til å virke som en 7''er! Utrolig følsom, dyp og lettkastet. Et førstevalg når du ønsker en lett, delikat 5''er til finfiske i vann og elver. Vi anbefaler Presentation snøret på denne.</td>
</tr>
<tr>
<td><strong>FARIO 905 | 90 | #5 | 4-piece<br></strong> Nifotfemmeren er et begrep for innlandsfiskerne. Her har vi en allround femmer som virkelig kan brukes til det meste. Den har en relativt dyp aksjon med en kraftigere toppdel . Noe som gjør denne femmeren meget følsom og egnet til smygfiske. I kombinasjon med toppdelen bærer også denne stanga mye snøre og større fluer. Her kan du kaste kort, langt, med store fluer, små fluer, speycast og med alle typer snører på en bra måte!<br><br>Testvinner i flere blader både i 2010 og 2011!!</td>
<td width="50%">
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/rods/FARIO/fariotrout.jpg?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
</tr>
<tr>
<td><strong>FARIO 866 | 86 | #6 | 4-piece</strong><br> Denne er spesialutviklet for nymfe- og streamerfiske i elv. Våre finske venner har etterspurt denne til sitt fiske etter storørret i finske skogselver.</td>
<td width="50%"><strong>FARIO 906 | 90 | #6 | 4-piece<br></strong> Fjellstanga som takler vind, men samtidig er morsom nok å fiske tørrfluer med. Også en super streamerfiske stang. Dette er en 6''er stang som er bygget for ørretfiskeren!</td>
</tr>
</tbody>
</table>
<p><br><br></p>
