INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:05', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Fly vest', 'guideline-fly-vest', 47920, '0', null, 0, 1000, '<p>GL FLY VEST har alle lommer og funksjoner som du trenger og et gjennomtenkt design til en fornuftig pris. <br> Vesten er laget i et syntetisk, hurtigt&oslash;rkende stoff av 320D 100% nylon, innsiden har for av mesh. <br> Midjen p&aring; vesten kan reguleres/strammes p&aring; innsiden med elastiske b&aring;nd. Vesten har glidel&aring;slukking i front. <br> Nakke og skuldre er ekstra polstret for god komfort n&aring;r du b&aelig;rer tungt.<br><br> <strong>Detaljer:</strong> <br>- En retractor p&aring; hver side for feste av verkt&oslash;y <br>- Stor, romslig rygglomme for matpakka, termos eller ekstra t&oslash;y. <br>- D-ringer p&aring; siden av brystlommer for feste av prep./verkt&oslash;y. <br>- D-ring i nakken for feste av h&aring;v. <br>- Venstre brystlomme har utenp&aring;liggende lomme for fortommer etc. og lapp for &aring; t&oslash;rke fluer. <br>- Lommene ved midjen har begge to utenp&aring;liggende lommer for flueimpregnering mm. <br>- M&aring;l p&aring; midjelommer = 210mm brede x 125mm h&oslash;ye x 40mm dype. <br>- M&aring;l p&aring; brystlommer = 160mm h&oslash;ye x 115mm brede x 25mm dype. <br>- Vesten har en innerlomme p&aring; hver side.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
