Passer alle typer vadesko. Føttene flyter, en stor fordel hvis de skulle falle av. Størrelsen gjør at de er lette
å svømme med.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:05', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Force', 'guideline-force', 43920, '0', null, 0, 250, '<p>Force er et meget bra, prisgunstig sn&oslash;re. Sn&oslash;ret har en smal profil og en litt lengre klump, som gir fin presentasjon p&aring; ulike kastelengder. Stabilt i luften med jevne bukter. FORCE er lettkastet med ulik lengde p&aring; klumpen tilpasset de respektive sn&oslash;reklassene. Sn&oslash;ret passer godt til alle fluetyper og fiskesituasjoner.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:05', '2015-07-16 22:41:35', '2015-07-16 22:41:35', ' Frames Tee', 'guideline-frames-tee', 23920, '0', null, 0, 500, '<p>Stilren og delikat t-skjorte med guideline logo og fiskemotiver.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:05', '2015-07-16 22:51:17', '2015-07-16 22:51:17', 'Guideline GL Shooter', 'guideline-gl-shooter', 23920, '0', null, 0, 250, 'GL SHOOTER er vårt mest solgte skytesnøre. Det er sterkt og tynnt. Den ovale fasongen og glatte overflaten gir minimal friksjon i ringene. Shooter har innvendige luftceller som sørger for at snøret er høytflytende. Det er ikke behov for snørekurv under saltvannsfiske hvis du bruker denne. Finnes i tre dimensjoner og bruddstyrker.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:06', '2015-07-16 22:51:17', '2015-07-16 22:51:17', 'Guideline GSP', 'guideline-gsp', 4720, '0', null, 0, 0, '<p>Supersterk dyneema tr&aring;d som er ypperlig til &aring; binde saltvannsfluer med. Brukes ogs&aring; til binding av hjorteh&aring;rsfluer og andre                         materialer som krever sterk tr&aring;d. <br />
<br />
Tykkelsen tilsvarer 10/0.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:06', '2015-07-16 22:51:17', '2015-07-16 22:51:17', 'Guideline Haze V2 -m/gratis fluesnøre', 'guideline-haze-v2-mgratis-fluesnore', 151920, '0', null, 0, 700, '<h3>Alle som bestiller fluesnelle får med gratis flueline fra Nordic Angler</h3><br>
<h2>HAZE - SORT ELEGANSE!</h2><br><br>
I HAZE V2 tilbys form og funksjon til en konkurransedyktig pris. Snella er laget av T-6061 aluminium som er industristandarden
                        for kvalitetssneller. Haze V2 har sort, hard anodisering med et blankt utseende som aldri går av moten. Den burgunder fargede
                        bremsesylinderen tilfører snella en fin kontrast. Alt i alt, HAZE V2 oser kvalitet og stil i alle detaljer. Du får et produkt
                        som du virkelig kan stole på.<br/><br/>Det myke bremsesystemet er bygd opp rundt en løsning med bremseskruer i teflon/krok/rustfrie skiver. Den forseglede bremsesylinderen
                        beskytter de øvrige komponentene mot skitt og gir en myk, fin gange over hele spekteret av innstillinger. Snella kan leveres
                        etter ønske som høyre- eller vestre hånds sveiv. Men det er også enkelt å endre sveiveretning selv. HAZE V2 har hel ramme
                        på alle modeller for økt styrke og for å hindre at skytelina kiler seg mellom spole og hus.<br/><br/>
                     </p>
