<p>&nbsp;</p>
<h2>HAZE - SORT ELEGANSE!</h2>
<p><br><br> I HAZE V2 tilbys form og funksjon til en konkurransedyktig pris. Snella er laget av T-6061 aluminium som er industristandarden for kvalitetssneller. Haze V2 har sort, hard anodisering med et blankt utseende som aldri g&aring;r av moten. Den burgunder fargede bremsesylinderen tilf&oslash;rer snella en fin kontrast. Alt i alt, HAZE V2 oser kvalitet og stil i alle detaljer. Du f&aring;r et produkt som du virkelig kan stole p&aring;.<br><br>Det myke bremsesystemet er bygd opp rundt en l&oslash;sning med bremseskruer i teflon/krok/rustfrie skiver. Den forseglede bremsesylinderen beskytter de &oslash;vrige komponentene mot skitt og gir en myk, fin gange over hele spekteret av innstillinger. Snella kan leveres etter &oslash;nske som h&oslash;yre- eller vestre h&aring;nds sveiv. Men det er ogs&aring; enkelt &aring; endre sveiveretning selv. HAZE V2 har hel ramme p&aring; alle modeller for &oslash;kt styrke og for &aring; hindre at skytelina kiler seg mellom spole og hus.<br><br></p>
