INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:06', '2015-07-16 22:41:39', '2015-07-16 22:41:39', ' High Water', 'guideline-high-water', 63920, '0', null, 0, 250, '<p>HIGH WATER er v&aring;rt beste allround WF-sn&oslash;re i flyt. Sn&oslash;ret fungerer sv&aelig;rt godt p&aring; lange presentasjonskast n&aring;r det er viktig &aring; ha full kontroll p&aring; kast og presisjon. High Water sn&oslash;ret har en 14 meters klump som er veldig lettkastet fra mellomdistanse og helt ut til fiskene som nesten alltid vaker utenfor kastehold. <br> <br> HIGH WATER har coating av AST kvalitet som er markedets beste. Er du p&aring; utkikk etter et allroundsn&oslash;re til &oslash;rretfiske finner du neppe noe bedre enn dette. HIGH WATER har en lang fronttapering som s&oslash;rger for perfekt overslag og delikat presentasjon. Et skikkelig &oslash;rretboms sn&oslash;re!</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:06', '2015-07-16 22:41:39', '2015-07-16 22:41:39', ' Kispiox', 'guideline-kispiox', 159920, '0', null, 0, 3000, '<p>En meget funksjonell og framfor alt prisgunstig jakke. Denne jakken har inspirasjon fra v&aring;r tideligere storselger Microstretch og Explorer. <br><br> KISPIOX jakken er produsert i en 2-lags polyestervev med en Teflon4 impregnering for &aring; ytterligere &oslash;ke den vannavvisende effekten. Innvendig er det et mykt, behagelig nettingfor som bidrar til maksimal ventilasjon under fisket. <br><br> <br>- Jakken er utstyrt med to romslige, utenp&aring;liggende brystlommer. <br>- P&aring; baksiden av brystlommene finner du lommer til &aring; varme hendene. Utenp&aring; brystlommene en lomme p&aring; hver side til fortom etc. <br>- To vertikale, store innerlommer utstyrt med gummierte, vannavst&oslash;tende glidel&aring;s. <br>- Armene har regulerbare mansjetter. <br>- To retractorer for klipper og tang. <br>- D-ring for h&aring;voppheng p&aring; ryggen. <br>- Hetta har justering bak. <br>- Jakken har pusteegenskaperer p&aring; 3000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 10000 mm/per tomme.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:07', '2015-07-16 22:41:39', '2015-07-16 22:41:39', ' Kispiox', 'guideline-kispiox2', 199920, '0', null, 0, 1000, '<p>Helt nye vadebukser med mange unike detaljer for dette prispunktet. Laget av 4-lags koreansk nylon stoff med DWR behandling som gj&oslash;r at skitt og vann lettere preller av. Nylonfibre er mer slitesterke enn polyester og &oslash;ker holdbarheten p&aring; vadebuksene.<br><br> <br>- P&aring; innsiden av beina er det laminert et ekstra lag for &aring; gj&oslash;re dette omr&aring;det mer motstandsdyktig overfor punkteringer. <br>- P&aring; utsiden er det ingen s&oslash;mmer, noe som gj&oslash;r buksen mindre utsatt for lekkasjer. Det nye ekstreme Sidewinder&trade; designet eliminerer fullstendig behovet for s&oslash;mmer p&aring; innsiden. <br>- Det avanserte snittet gir gode bevegelsesfrihet med et minimum av s&oslash;mmer. <br>- Neoprenesokkene er h&oslash;yre/venstre sk&aring;rne for god passform. <br>- Grusbeskyttere i et solid stoff med gummiforsterkede, fleksible b&aring;nd nederst, s&oslash;rger for at grus og sand ikke kommer inn i skoen. <br>- Stor utvending nettinglomme med rikelig plass for oppbevaring. <br>- Innerlommen n&aring;es via den vannavvisende glidel&aring;sen i toppen. <br>- Det tykke non-stretch vadebeltet sitter godt og holder verkt&oslash;y og vadestav uten &aring; gnisse. <br>- Bukseselene og toppen av buksa kan justeres for best mulig komfort. Andre nyttige detaljer er t&oslash;rkestropper, d-ringer og beltel&oslash;kker. <br><br> Membranen i buksen er testet til &aring; transportere 5000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 20000 mm/per tomme. Buksen har 4-lag med stoff.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
