INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:07', '2015-07-16 22:41:39', '2015-07-16 22:41:39', ' Kisu Primaloft', 'guideline-kisu-primaloft', 119920, '0', null, 0, 1500, '<p>Kisu betyr steelhead p&aring; indiansk og er et teknisk plagg for fiske n&aring;r det er kj&oslash;lig. Den har gode pusteegenskaper og er sv&aelig;rt lett &aring; komprimere slik at den tar liten plass i sekken eller rygglommen p&aring; fiske jakken. <br> Det syntetiske dunet i jakken er perfekt som et isolerende plagg etter en lang marsj til &rdquo;godplassen&rdquo;. Med pustende og isolerende materiale holder den deg varm og t&oslash;rr i jakten p&aring; storfisken, eller n&aring;r du sitter rundt b&aring;let p&aring; kvelden. Jakken kan ogs&aring; brukes isteden for fleece under vadejakka. Jakken har to sidelommer og elastisk b&aring;nd i h&aring;ndleddet. <br><br> Farge: Kobberbrun. <br> Str: S-XXL.</p>
<h3>TIPS!</h3>
<p><br>Kisu har slim fit for &aring; v&aelig;re komfortabel &aring; ha p&aring; seg under en skalljakke. &Oslash;nsker du en romsligere passform s&aring; velger du en st&oslash;rrelse st&oslash;rre enn du normalt bruker.<br><br></p>
