<td><strong>LPXe 763 | 7&rsquo;6&rdquo; | #2 | 3-piece<br></strong> Superlett og f&oslash;lsom stang som gir deg mye moro selv n&aring;r fisken ikke er av de st&oslash;rste! Eller n&aring;r du &oslash;nsker &aring; benytte det letteste sn&oslash;ret p&aring; sv&aelig;rt sky fisk.<span style="font-weight: bold;"><br></span></td>
