</tr>
<tr>
<td><strong>LPXe 968 | 9&rsquo;6&rdquo; | #8 | 4-piece - Nyhet 2010</strong><br> Med tanke p&aring; hvor popul&aelig;r 7''ern i denne lengden har v&aelig;rt s&aring; burde vi ha lansert denne for lenge siden. Prototypen til denne stanga var s&aring; bra at testpersonalet hadde store problemer &aring; gi den tilbake. En stang for tyngre innsj&oslash;fiske, laks p&aring; sommervannstand eller kystfiske. En moderne, rask, men allikevel dyp aksjon som gj&oslash;r at stangen fungerer like bra med WF sn&oslash;rer som med klumper. Klumpvekt 17-19 gram.</td>
<td><strong>LPXe 1006 | 10&rsquo; | #6 | 4-piece</strong><br> Mange har spurt etter denne, n&aring; er den her! En kjapp-, lang 6&rsquo;er som er utmerket til kyst-, belly- og b&aring;tfiske.</td>
</tr>
<tr>
<td><strong>LPXe 1007 | 10&rsquo; | #7 | 4-piece</strong><br> En klassisk lengde og sn&oslash;reklasse for sj&oslash;&oslash;rret p&aring; kysten, laks og stor&oslash;rret i elv. Jobber dypt og kjapt med b&aring;de overh&aring;ndskast og speykast.</td>
<td><strong>LPXe 1008 | 10&rsquo; | #8 | 4-piece</strong><br> En av v&aring;re mest solgte stenger i 3-delt. Fremdeles like god med kraft i bunnen og en disktinkt aksjon for jakt p&aring; de s&oslash;lvblanke elvefiskene.</td>
</tr>
