INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:07', '2015-07-16 22:41:39', '2015-07-16 22:41:39', ' LPXe RS V2 Enhånds', 'guideline-lpxe-rs-v2-enhands', 319600, '0', null, 0, 3000, '<p>For 2011 sesongen har Guideline justert aksjonen p&aring; flere av modellene og gitt hele serien et nytt, sprekt utseende. Det f&oslash;rste du legger merke til er fargen p&aring; stanga. En dyp, hvit perlemorsfarge som vi f&oslash;ler gir stengene et maritimt preg og en god kamuflasje mot himmelen. LPXE RS V2 er bygd for &aring; r&oslash;ft fiske i tropiske og hjemlige farvann. Prim&aelig;rt er stengene laget for fiske i vind med h&oslash;y linehastighet, store fluer og enda st&oslash;rre fisk. Serien best&aring;r av 9 modeller fra sn&oslash;reklasse 5 til 12, alle er 9 fot lange. I denne serien finner du stenger til enhver utfordring som krever kraftig redskap. Vi er helt sikre p&aring; at den nye RS V2 vil imponere.<br><br></p>
<h2><strong>Egenskaper</strong></h2>
<p><br>Snellefestene og ringene er av h&oslash;y kvalitet for &aring; t&aring;le t&oslash;ft fiske i saltvann. Linef&oslash;rerne har krom finish og innlegg av Hardloy som matcher klingefargen perfekt. Vi har beholdt snellefestet av saltvannsbestandig titaniumanodisert aluminium. Fighting butten er nydesignet og stilig, laget i EVA for &oslash;kt komfort. Korkh&aring;ndtaket har full wells utforming p&aring; alle modeller unntatt klasse 5. Klingen best&aring;r av en kompleks grafittblanding der vi bruker ulike typer modulus for &aring; oppn&aring; de egenskapene vi &oslash;nsker. Stengene har fra 24msi til h&oslash;ye 48msi modulus. Ved &aring; kombinere ulike grafittblandinger f&aring;r vi utnyttet egenskapene til materialene optimalt. En annen nyhet for 2011 er at bunndelene p&aring; stengene i klasse 10-12 har f&aring;tt &oslash;kt styrke. Vi har gitt dem en grafittblanding som gj&oslash;r at de t&aring;ler hardere press. Hvilket gj&oslash;r at de takler virkelig stor fisk enda bedre, spesielt n&aring;r du fisker fra b&aring;t.<br><br><br></p>
<h2 style="font-weight: normal;"><strong></strong><strong>LPXe RS V2 - Modeller<br><br></strong></h2>
<table style="width: 680px; height: 662px;">
