<tr>
<td style="width: 60%;"><span class="brodtekst-I_underline" style="font-weight: bold;">LPXe RS V2 905 | 9 fot | #5</span><br> En 5&rsquo;er stang med sterk personlighet og gode prestasjoner. Passer fint til lettere fiske etter bonefish, sj&oslash;&oslash;rret og &oslash;rretfiske i ferskvann. Rolige v&aelig;rforhold og mindre fluer. Eneste modellen i serien med halfwells h&aring;ndtak.<br><br> <span class="brodtekst-I_underline" style="font-weight: bold;">LPXe RS V2 906 | 9 fot | #6</span><br> Kanskje den ultimate allroundstangen? Sj&oslash;&oslash;rret, bonefish, stor&oslash;rret, havabbor og sm&aring;laks. Dette er stanga for de som fisker mye over et vidt spekter.</td>
