INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:08', '2015-07-16 22:51:17', '2015-07-16 22:51:17', 'Guideline LPXe To-hånds fluepakke', 'guideline-lpxe-tohands-fluepakke', 486080, '0', null, 0, 4, '<b>Fluestang:Guideline LPXe</b><br>
LPXe har den matte, naturgrå klingefargen. Klingene er presise uten tilbakeslag.LPXe er stangserien som har gått seirende ut av vært mange tester.
<br><br>
Samtlige stenger i serien er produsert i en spesialutviklet høy modulus grafitt. Oppbyggingen består av ulike fibertyper, alle med unike egenskaper. Vi har beholdt den matte, naturgrå klingefargen. Klingene er presise uten tilbakeslag. De laveste klassene har fått nyutviklede superlette tresnellefester og snakeringer. Hvilket gir en herlig retro-look. Fra klasse 6 og oppover er det nye, frekke titaniumsanodiserte aluminium snellefester og enbente ringer. Tohåndsstengene har snellefester i titanbelagt aluminium med doble låseringer. LPXe kjennetegnes som alltid av korkhåndtak i høyeste kvalitet, keramiske lineførerringer, og superlette enbente- eller snake hardcrome ringer. Leveres i ABS tube trukket med cordura, med tykt deilig tøyfutteral av høyeste kvalitet.
<br><br>
LPXe - DETALJER
<br>-
<br>-Matt grå klinge klinge som ikke reflekterer sollys.
<br>-Høykvalitetskork.
<br>-Keramiske lineførerringer.
<br>-Superlette enbente- eller snake hardcrome ringer.
<br>-Lettvekst snellefester i tre/aluminium eller helt titaniumsanodisert.
<br>-Hver stangdel har siktepunkt samt modellinfo.
<br>-Leveres i corduatube med stangtrekk.<br><br>

<b>Fluesnelle:Guideline Reelmaster LA</b><br>
Reelmaster LA tar steget enda et hakk opp for støpte, eller såkalte Die Cast sneller. Det første du legger merke til er snellens finish, den lave vekten, og ikke minst det frekke, litt sexy Large Arbor designet. Vi har hentet mye av designet fra Quadra snellens myke linjer og runde former. Den har også den samme Double Carbon Disk bremsen, som for øvrig er helt vanntett. Bremsen er utrolig jevn under alle forhold, noe mange allerede har fått erfare.<br><br>

Bremsesystemet er helt vanntett og utrolig jevnt, noe som gjør at snellen takler ordentlig stor fisk. Spolene har en stor ytterdiameter og en medium bred spole. Dette innebærer at bremseeffekten forblir den samme, selv ved lange utras. Snellene er svart anodiserte med polyurethane overflate.
<br><br>
<b>Flueboks: </b><br>
Dobbeltsidig flueboks fra Nordic Angler med klart lokk på begge sider gjør det enkelt å holde god oversikt. <br>
- Vanntett og lett i vekt. <br>
- Riktig takhøyde for fluene gjør at du unngår å klemme ned vingene. <br>
- Transparent lokk gjør at du ser innholdet. <br>
- "Slits" i foam forenkler plassering av flua. <br><br>

Du får også med en lineklipper.', '', 9, 1, 0, 1, null, '', null, '', '', null, null, 0);
