løkke i fronten og er flytende.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:09', '2015-07-16 22:51:17', '2015-07-16 22:51:17', 'Guideline LRL+', 'guideline-lrl', 31920, '0', null, 0, 250, 'Det klassiske skytesnøret som mange foretrekker siden det er så lett håndterlig under fiske. LRL+ har en hard og smidig coating, bygget opp rundt en sterk dacronkjerne. Snøret er flytende, har minimalt med minne og er lett å bruke under alle forhold. LRL+ kan løkkekobles til alle typer skyteklumper. LRL+ kommer i fire tykkelser: 027,.032, .034 og .040', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:09', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Lxi', 'guideline-lecie-enhands', 343920, '0', null, 0, 3000, '<h2><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;">&Aring; lage en etterf&oslash;lger til v&aring;r favoritt stangserie gjennom tidene, LeCie, var ingen enkel oppgave. Spesielt n&aring;r m&aring;let var minst like gode egenskaper og til en bedre pris. Resultatet er klart, og vi er stolte over &aring; kunne introdusere v&aring;r nye serie som vi har kalt LXi. Stengene er basert p&aring; de samme aksjonene som LeCie og har samme h&oslash;ye grafittkvalitet. Ingen kompromisser her. Vi har gjort forbedringer i aksjonen, endret lengder og gitt stengene et helt nytt utseende. I f&oslash;rste omgang har vi har valgt &aring; tilby stengene i Switch og toh&aring;nds modeller. Serien best&aring;r av totalt 14 stenger.</span></h2>
<p style="margin-bottom: 12px; color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;">&nbsp;</p>
<table style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px; width: 700px;" cellspacing="0">
<tbody>
<tr>
<td>
<h3 style="font-weight: normal; margin-bottom: 12px;"><strong>Switch Stengene<br></strong></h3>
</td>
</tr>
<tr>
<td>Switch stengene har et design som heller mot en mindre og sv&aelig;rt lett toh&aring;nds, men de kan selvf&oslash;lgelig brukes som enh&aring;nds ogs&aring;. Disse 11&rsquo;6 fot stengene er tilgjengelige i klassene 6/7, 7/8 og 8/9. De fungerer like bra med Scandi, Switch eller lette Skagit klumper.</td>
</tr>
<tr>
<td>&nbsp;</td>
</tr>
<tr>
<td>
<h3 style="font-weight: normal; margin-bottom: 12px;"><strong>Toh&aring;nds Stengene<br></strong></h3>
</td>
</tr>
<tr>
<td>Toh&aring;ndsstengene kommer i fire ulike lengder med flere sn&oslash;reklasser i hver. Lengdene 12&rsquo;9, 13&rsquo;9, 14&rsquo;9 og 15&rsquo;9 er sm&aring; justeringer i forhold til de tidligere LeCie stengene. Lxi har ogs&aring; en litt dypere aksjon, men er fremdeles rask. Dette gj&oslash;r at stengene er enklere &aring; spenne opp, samt at du f&aring;r et mer distinkt slag fra den nedre delen av stanga. Dette er fiskestenger for alle sn&oslash;retyper og med muligheten for &aring; kaste virkelig langt og presist n&aring;r det er p&aring;krevd.<br><br><br></td>
</tr>
<tr>
<td>
<h3 style="font-weight: normal; margin-bottom: 12px;"><strong>Egenskaper</strong></h3>
</td>
</tr>
<tr>
<td>Grafittdukene i LXi har samme h&oslash;ye modulus, lave vekt og gode prestasjoner som har v&aelig;rt kjennetegnet p&aring; LeCie i en &aring;rrekke. H&aring;ndtakene er nydesignet med innlegg av ulike typer kork som gir dem et pent utseende og godt grep. Snellefestet er i svart, eloksert aluminium med en skinnende finish. Sidene p&aring; snellefestet er flate og holder l&aring;seringene i riktig stilling for montering av snella.<br><br>Stengene har snakeringer av hardcrome som er lette i vekt og i tynn wire for &aring; gi minst mulig vekt og mer liv til stanga. De kraftige dragringene i nedre del av stangen er loddet med s&oslash;lv, slik at de er ekstra motstandsdyktige mot korrosjon. Stengene har klinge i skinnende gr&oslash;nn/gr&aring; metallic farge. Surringene er gr&aring; med m&oslash;rker&oslash;de innlegg som gir stengene et klassisk og stilig utseende.</td>
</tr>
</tbody>
</table>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
