INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:09', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Midweight stretch pant', 'guideline-midweight-stretch-pant', 39920, '0', null, 0, 1000, '<p>Buksen er laget av 280 grams polyester med en glatt ytterside. Innersiden er b&oslash;rstet og er b&aring;de myk og varm. <br><br> Hele plagget er full stretch og er perfekt som f&oslash;rste lag n&aring;r du kler deg til fiske. Buksen sitter godt etter slik at den ikke f&oslash;les klumpete under vadebuksen. <br><br> Ved temperaturer p&aring; over 13-14 grader klarer du deg med denne under vadebuksa. Er det kaldere, eller hvis du sitter i flyteringen hele dagen er den utmerket som f&oslash;rste lag under fleece bibs.<br> Buksen har to glidel&aring;slommer p&aring; siden.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:10', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Midweight Stretch Top', 'guideline-midweight-stretch-top', 39920, '0', null, 0, 1000, '<p>H&oslash;yhalset tr&oslash;ye med glidel&aring;slukking i halsen. N&aring; med ytterligere forbedret stoff og fukt transporterende egenskaper. <br> <br> Stoffet er 280 grams polyester med en glatt ytterside. Innersiden er b&oslash;rstet og er b&aring;de myk og varm. Hele plagget er full stretch og er perfekt som f&oslash;rste lag n&aring;r du kler deg til fiske. Den er s&aring; behagelig &aring; ha p&aring; seg at den raskt blir en favoritt til fritidsbruk ogs&aring;.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:10', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Pike Series', 'guideline-pike-series', 51920, '0', null, 0, 250, '<p>Fluefiske etter gjedde er en av grenene innen moderne fluefiske som vokser raskest. Nye teknikker og mer avanserte fluer gj&oslash;r at kravene p&aring; sn&oslash;rene som blir brukt, har &oslash;kt markant den siste tiden. GUIDELINE PIKE Series best&aring;r av to ulike sn&oslash;rer som dekker flere av behovene som kan tenkes oppst&aring; under en fisketur. Serien best&aring;r av en flytende line med spesialtapering, samt en synkende MD(multi density) synkeline for fisk som st&aring;r litt dypere. Begge sn&oslash;rene er laget p&aring; v&aring;r nesten stumme og meget popul&aelig;re DC(direct contact) kjerne, en suksess fra v&aring;re synkende Power Taper klumper. Den kommer garantert til &aring; bidra til flere krokede fisker i l&oslash;pet av din fiskedag.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:10', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Pounch Pro', 'guideline-pounch-pro', 59920, '0', null, 0, 250, '<p>Pounch har v&aelig;rt med en god stund og har blitt en klassiker blant mange regnbue- og kystfiskere. Sn&oslash;ret genererer h&oslash;y sn&oslash;rehastighet med lite kraftbruk samtidig som det skaper rolige, trange bukter. Populariteten blant sj&oslash;fiskere skyldes ogs&aring; slitestyrken og evnen til &aring; sl&aring; over fortom og flue i vind.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:10', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Power Taper Flyt', 'guideline-power-taper-flyt', 54320, '0', null, 0, 250, '<p>V&aring;re originale Power Taper skyteklumper selger bedre enn noen gang, og bredden av sn&oslash;rer er det mest komplette og finjusterte du finner. Vi har for 2010 sesongen forbedret v&aring;re sn&oslash;rer enda mer, ved sm&aring; justeringer i vekt, lengde og taperinger.</p>
<table style="width: 100%;" cellspacing="0" cellpadding="0">
<tbody>
<tr>
<td>POWER TAPER er skyteklumpen for deg som &oslash;nsker optimal tilpassning til egen stang. Du veier selv klumpene og kapper de til riktig lengde i forhold til dine preferanser. Valg av klump avhenger av vannstand, str&oslash;mhastighet, temperatur og plassen du fisker p&aring;. Med POWER TAPER har du mulighet til &aring; tilpasse sn&oslash;ret ditt til alle disse kiteriene.<br><br></td>
</tr>
<tr>
<td>&nbsp;</td>
</tr>
<tr>
<td>
<table class="user-table" style="width: 100%;" cellspacing="0" cellpadding="5">
<tbody>
<tr>
<td rowspan="3" width="60%">
<table class="image-box">
<tbody>
<tr>
<td><img src="http://www.guideline.no/filestore/powertaper/tapers-orginal.png?size=700x800" border="0" alt=""></td>
</tr>
</tbody>
</table>
</td>
<td><br><strong>FLYT</strong>H&oslash;ytflytende sn&oslash;re med en unik kraftoverf&oslash;ring som genererer h&oslash;y sn&oslash;rehastihet. Et flytesn&oslash;re med synkesn&oslash;rets kaste egenskaper.</td>
</tr>
<tr>
<td><br><strong>FLYT/SYNK1</strong>Den mest solgte skyteklumpen gjennom tidene! Med tanke p&aring; hvor mange vi har solgt, s&aring; finnes det minst ett eksemplar hos hver eneste laks- og sj&oslash;&oslash;rretfisker. Dette er tredje generasjon F/S1 hvor sn&oslash;ret er flytende med en spiss i synkegrad 1 p&aring; ca 3,5m.</td>
</tr>
<tr>
<td><br><strong>FLYT/SYNK3</strong> En bestselger, og et must for mange laksefiskere pga. de unike fiskeegenskapene sn&oslash;ret har. Kombinasjonen mellom dybde og fart p&aring; fluen kan ofte v&aelig;re sv&aelig;rt effektivt. Et sn&oslash;re for de fleste forhold. Pr&oslash;v det gjerne sammen med en kort fortom av fluorocarbon og en fortynget tubeflue. Perfekt kombinasjon, ogs&aring; p&aring; stor elv n&aring;r fisken g&aring;r n&aelig;rt land, hvor en ren synkeline g&aring;r fast i bunnen.</td>
</tr>
</tbody>
</table>
</td>
</tr>
<tr>
<td>
<table class="user-table" style="width: 100%;" cellspacing="0" cellpadding="2">
<tbody>
<tr>
<td><strong>FLYT/SYNK5 (Streamdip)</strong><br> Et genialt kaste- og fiskesn&oslash;re! Samme oppbygging og egenskaper som F/S3. Med den flytende bak-delen har du likevel mulighet til &aring; kontrollere fluens hastighet og dybde. Til tross for kombnasjonen mellom flyt og synkegrad 5 er sn&oslash;ret utrolig lettkastet, noe som har overrasket mange.</td>
<td><strong>FLYT/SYNK7 - NYHET!</strong><br> V&aring;rt nyeste medlem i flyt/synk konseptet, og det mest ekstreme av v&aring;re sink-tip sn&oslash;rer. Designet for et mer effektivt og problemfritt fiske gjennom de dypeste h&oslash;lene. Spissen p&aring; 4,5 meter i synk 7 bringer fluen ned i dypet, og flytedelen i resten av sn&oslash;ret hjelper oss &aring; opprettholde kontroll over fart og dyde.</td>
</tr>
</tbody>
</table>
</td>
</tr>
</tbody>
</table>
<p><br><br></p>
<p>&nbsp;</p>
