INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:10', '2015-07-16 22:41:43', '2015-07-16 22:41:43', ' Presentation', 'guideline-presentation', 51920, '0', null, 0, 250, '<p>PRESENTATION er et spesialsn&oslash;re for det lette fisket. Taperingen kombinert med den korte klumplengden gj&oslash;r den suveren til forsiktige presentasjoner og en rekke typer spesialkast. Siden du ikke trenger &aring; ha mer enn 7 meter sn&oslash;re ute for at stanga skal jobbe maksimalt, passer dette sn&oslash;ret spesielt godt til fiske i sm&aring; elver og vann eller n&aring;r det er trangt om plassen. Den lange fronttaperingen s&oslash;rger for kompromissl&oslash;s presentasjon. Den korte baktaperingen gj&oslash;r at sn&oslash;ret er supert til underh&aring;ndskast.</p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
