<p>&nbsp;</p>
<h2>QUADRA - TIDL&Oslash;S ELEGANSE OG MODERNE FUNKSJONALITET!</h2>
<p><span style="font-weight: normal;">Quadra har sakte vokst fram etter lang tids arbeid, tegning og testing av ulike l&oslash;sninger p&aring; viktige detaljer. Sluttresultatet er ei snelle vi tror vil st&aring; seg i lang tid framover. Den forener p&aring; en estetisk m&aring;te et tidl&oslash;st design med en moderne Large Arborid&egrave; i skj&oslash;nn kombinasjon</span>. <span style="font-weight: normal;">Bremsen er laget i Carbontex, sitter helt innkapslet og beskyttet i sentrumsakslingen, totalt up&aring;virket av vann eller temperaturforandringer. Bredden og den relativt store diameteren p&aring; spolen gir en jevn, p&aring;litelig gange og en bremsevirkning som holder seg n&aelig;rmest identisk fra f&oslash;rste til siste runde med bakline. Bremsen har hele 25 innstillinger og kan lett justeres med bremseskruen som er montert p&aring; snellens gavelside.</span><strong><br><br></strong>Snellene, som er framstilt i T &ndash; 6061 titaniumanodisert aluminium, er bearbeidet og har finish av ypperste kvalitet. Noe som viser seg i avrundede myke radier, myk herlig gange og en brems som arbeider jevnt og f&oslash;lsomt.</p>
