INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:11', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Reaction', 'guideline-reaction', 543920, '0', null, 0, 3000, '<p><strong>Etter</strong> to &aring;r og det mest spennende- og utfordrende prosjektet vi har startet noensinne er v&aring;re Reaction fluestenger klare for markedet. Vi har samarbeidet med en av verdens mest anerkjente produsenter i USA. Reaction er en blanding av Amerikansk stangbyggerskikk og Guidelines filosofi for stangaksjoner. Resultatet er en topp moderne serie fluestenger produsert i en meget avansert maskinpark. <br><br> Reaction er en moderne og tidl&oslash;s stangserie med et diskret utseende. Ikke noen skrikende surringer, eller andre glorete stangdeler. Bak denne litt subtile forkledningen finner du komponenter av ypperste kvalitet. Snellefeste og ringer kommer i fra REC, korken er den beste som er &aring; oppdrive. Klingen er utviklet og bygget med de beste grafitt materialer som finnes. <br><br> Klingen blir bygget med en meget avansert forsterknings teknologi, denne sv&aelig;rt tynne karbonmatten &oslash;ker stangemnes styrke med 10x. Videre gir den oss mulighet for &aring; lage en tynnere klinge, &oslash;kt styrke i holkene og vesentlig forbedret styrke under b&oslash;ying/belastning. Denne teknologien gir bedre egenskaper i overgangene (holkene) b&aring;de i styrke og en jevnere veggtykkelse i selve klingen. Dette eliminerer mange av dagens problemer med brekkasje i holkene. Vi bruker en kombinasjon av de beste Japanske og Amerikansk lagde grafittmaterialene fra velkjente og respekterte fabrikker. Det er fire ulike materialer i stengene, med modulus fra 35 og opp til veldig h&oslash;ye 60MSI. <br><br> Stangaksjonene er p&aring;virket av det beste fra v&aring;re popul&aelig;re Le Cie stenger. Vi har tatt de egenskapene vi &oslash;nsket &aring; videref&oslash;re et stort skritt videre. Reaction kjennes mer levende ut og har en markant katapultegenskap i de midtre og nedre delene av stangen. Til tross for den dypere slaglengden er ikke disse stengene trege! De reagerer raskt, n&oslash;yaktig og har en distinkt tupp som gir sv&aelig;rt god kontroll p&aring; sn&oslash;rebuktene. Den relativt kraftige tuppen &oslash;ker oppspenningen i de lavere delene av stanga og h&aring;ndterer tunge synkeliner og store fluer med letthet. Reaction er lett &aring; bli venn med. Stengene er tilgivende for kastefeil og appelerer til kastere i mange ulike niv&aring;er. Hvis potensialet for &aring; kaste langt samtidig som f&oslash;lsomhet og harmoni er tilstede frister deg, b&oslash;r du opps&oslash;ke din n&aelig;rmeste Reaction forhandler &aring; &rdquo;pr&oslash;vekj&oslash;re&rdquo; de! <br><br></p>
<h2><br><strong>REACTION - MODELLER<br></strong></h2>
