<td style="width: 50%;"><strong>REACTION 904 | 9&rsquo; | #4 | 4-Delt</strong><br>Rask og klar til &aring; reagere p&aring; dine minste signaler.<br>Denne stanga har en eksplosiv, men likevel<br>dyp nok aksjon til &aring; takle tynne fortommer etter<br>fiske p&aring; sky fisk i ulike situasjoner.<br>Anbefalt klumpvekt: 9-11 gram.</td>
<td><strong>REACTION 1009 | 10&rsquo; | #9 | 4-Delt</strong><br>En kastekanon bygget for stor fisk, sterke armer<br>og dyktige kastere. Stanga for enh&aring;nds<br>fantaster som nekter &aring; ta i en toh&aring;nds til tross<br>for at vinden uler og elva vokser. Stanga har en<br>kraftig rygg for fiske med alle typer av synkeliner. Egner seg for laks i hvilken som helst situasjon. Anbefalt klumpvekt: 19-21 gram.</td>
