<tr>
<td><strong>REACTION 905 | 9&rsquo; | #5 | 4-Delt</strong><br>En av de raskere 5&rsquo;er stengene vi har bygget.<br>En stang som passer like godt for presentasjoner<br>med kirurgisk n&oslash;yaktighet som til &aring; kaste ut<br>et helt sn&oslash;re p&aring; en &oslash;rret som vaker midt i elva.<br>En liten fighting butt gir god balanse og komfort.<br>Anbefalt klumpvekt: 11-13 gram.</td>
<td><strong>REACTION 13778 | 13&rsquo;7&rdquo; | #7/8 | 4-Delt</strong><br>En myk, medium rask aksjon med overraskende kraft og evner. Et veldig bra valg for sm&aring; og mellomstore elver. Fiske med standard fluest&oslash;rrelser og med flyt til middels tunge synkeliner. En stang som vil overraske deg med sitt arbeidsspekter. Super n&aring;r du skal fiske med letthet og f&oslash;lelse. Anbefalt klump vekt: 23-27 gram</td>
</tr>
<tr>
<td><strong>REACTION 906 | 9&rsquo; | #6 | 4-Delt</strong><br>Ladet med mye fart og kraft som genererer h&oslash;y<br>sn&oslash;rehastighet og lange kast med uanstrengte<br>kastebevegelser. Lett i toppen og meget velbalansert.<br>Stanga har en liten fighting butt som gir<br>den et bredere bruksomr&aring;de enn en vanlig 6&rsquo;er<br>stang. Anbefalt klumpvekt: 13-15 gram.</td>
<td><strong>REACTION 13789 | 13&rsquo;7&rdquo; | #8/9 | 4-Delt</strong><br>En av de mest anvendelige lengdene og sn&oslash;revekt for laks, sj&oslash;&oslash;rret og steelhead. En kraftig medium/rask aksjon gir deg full kontroll med st&oslash;rre fluer og raske synkesn&oslash;rer. Stanga har en vekt og balanse som gj&oslash;r at den er en glede &aring; h&aring;ndtere under lange fiskedager.<br>Anbefalt klumpvekt: 28-32 gram</td>
