<tr>
<td><strong>REACTION 1006 | 10&rsquo; | #6 | 4-Delt</strong><br>Laget for b&aring;t, flytering og det utfordrende fisket<br>etter stor regnbue eller laks og steelhead<br>i middels store elver og innsj&oslash;er. En rask og<br>presis aksjon med en sterk bunndel gir deg<br>distanse og treffsikkerhet!<br>Anbefalt klumpvekt: 13-15 gram.</td>
