<td><strong>REACTION 148910 | 14&rsquo;8&rdquo; | #9/10 | 4-Delt</strong><br>En lengre stang betyr rekkevidde, b&aring;de under fiske og kasting, spesielt n&aring;r du vader. Den balanserte vekten p&aring; stanga og den raske aksjonen gj&oslash;r den til et storartet arbeidsverkt&oslash;y. Meget allsidig. Benytt f.eks DDC Connect 9/10 og du har en rigg som takler de utfordringene<br>du gir den. Anbefalt klumpvekt: 33-37 gram.</td>
