<h3>REELMASTER - RIMELIG OG DRIFTSIKKER!
                     </h3><br>
                     <p>Denne snellen var på sin tid for drøye fem år siden banebrytende for moderne snelleteknologi<br/>i klassen økonomisneller av storspolemodeller. Reelmaster har vært en av våre mest solgte produkter i flere år og har skaffet
                        seg et godt rykte for sin kvalitet.<br/>Disse snellene regnes helt klart som de beste i sin prisklasse. Reelmaster inngår også i våre Explorer Sett. Reelmaster har
                        en jevn og pålitelig brems som fungerer utmerket for alle fiskearter fra ørret og bonefish til laks og tarpon. Den er meget
                        stabil, lett med en klokkeren balanse når fisken ruser.<strong><br/><br/>REELMASTER</strong> er laget i 906/2 aluminium. Et materiale som både er sterkt og lett. Gjennom<br/>en unik prosess som består av både fresing og støping, får man fram ei snelle med en finish som er enestående i denne prisklassen.
                        Et stort stjerneformet bremseratt på gavelen gjør det lett å justere den pålitelige bremsen snella har. Akslingen er spesialherdet
                        for å tåle varmen som utvikles ved lange fiskeutras under hardt press. Det store nålelageret i sentrum er laget i rustfritt
                        materiale for å takle saltvann på best mulig måte. Det er dette lageret som enkelt snues når man skal skifte fra høyre til
                        venstrehåndssveiv. Reelmaster leveres i fire modeller, har en matt grå finish og leveres i neoprenefutteral.
