<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;">Kombinasjonen S1/S2 er ogs&aring; blant v&aring;re mest popul&aelig;re synkegrader. Dette er en perfekt saktesynkende line for fiske i midtsjiktet av vannlagene. Scandi designet med den korte intermediate bakdelen, gj&oslash;r denne linen enkel &aring; h&aring;ndtere. Spissen vil synke med en hastighet p&aring; 13 sekund/meter. Fordelingen av synkegradene f&aring;r sn&oslash;ret til &aring; synke i en fin rett bane.</span></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:13', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Scandi Int/S2/S3', 'guideline-scandi-floating4', 54320, '0', null, 0, 500, '<p>Guideline Scandi Int/S2/S3</p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><img style="border-width: 0pt; border-style: none; display: block;" src="http://www.guideline.no/filestore/powertaper/Scandi/INTS2S3_1.png?size=700x800" border="0" alt=""></span></p>
<p>Color: 1 m. Fluoro Orange/Fudge Brown/Dark Grey.</p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;">Den moderne versjonen av en &ldquo;normal&rdquo; synkeline. Men med fordelene av Double Density og en kort intermediate bakdel vil du f&aring; lettere h&aring;ndtering av linen under b&aring;de fisket og kastet. Synk3 spissen synker med en hastighet p&aring; 10 sekund/meter. I likhet med sn&oslash;ret over er denne linen langtkastende og har en perfekt stabilitet i lufta.</span></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:13', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Scandi Int/S3/S4', 'guideline-scandi-floating5', 54320, '0', null, 0, 500, '<p>Guideline Scandi Int/S3/S4</p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><img style="border-width: 0pt; border-style: none; display: block;" src="http://www.guideline.no/filestore/powertaper/Scandi/INTS3S4.png?size=700x800" border="0" alt=""></span></p>
