<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><img style="border-width: 0pt; border-style: none; display: block;" src="http://www.guideline.no/filestore/powertaper/Scandi/INTS4S5.png?size=700x800" border="0" alt="">Color: 1 m. Fluoro Orange/Bright Grey/Black.</span></p>
