INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:13', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Scandi Int/S5/S6', 'guideline-scandi-floating7', 54320, '0', null, 0, 500, '<p>Guideline Scandi Int/S5/S6</p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;"><img style="border-width: 0pt; border-style: none; display: block;" src="http://www.guideline.no/filestore/powertaper/Scandi/INTS5S6.png?size=700x800" border="0" alt="">Ditt sn&oslash;revalg for &aring; komme ned, dypt og fort. En effektiv line i kaldt vann eller n&aring;r fisken st&aring;r dypt i de store h&oslash;lene og nekter &aring; stige opp for &aring; ta flua. Fungerer veldig fint p&aring; tidligfiske etter sj&oslash;&oslash;rret, men ogs&aring; i de sterke str&oslash;mmene i de norske vestlandselvene. Spissen vil synke med en hastighet p&aring; 5,5 sekund/meter. Likevel, den korte lengden og intermediate bakdelen vil gj&oslash;re det enkelt &aring; f&aring; sn&oslash;ret ut av vannet. Color: 1 m. Fluoro Orange/Dark Grey/Black.<br></span></p>
<p>&nbsp;</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:13', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Scandi Int/S6/S7', 'guideline-scandi-floating8', 54320, '0', null, 0, 500, '<p>Guideline Scandi Int/S6/S7</p>
<p>&nbsp;</p>
<p><img style="border-width: 0pt; border-style: none; display: block; color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;" src="http://www.guideline.no/filestore/powertaper/Scandi/INTS6S7.png?size=700x800" border="0" alt=""></p>
<p><span style="color: #2b2b2b; font-family: Verdana, Arial, Tahoma, Helvetica, sans-serif; font-size: 12px;">This is the fastest sinking line we make. It replaces the popular Short Cut lines that featured a very fast sinking 6/7 line in the range. Thin profile helps it cut fast and efficiently though the water and take your fly down right to the nose of fish that lie deep and won&rsquo;t come up to take a fly. Sinks at 4,5 seconds per meter.</span></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:13', '2015-07-16 22:41:48', '2015-07-16 22:41:48', ' Shield L/S Tee', 'guideline-shield-ls-tee', 39920, '0', null, 0, 500, '<p>En ny og frisk tiln&aelig;rming, sydd i et avansert "diamantm&oslash;nster". Rock''n Roll fiskeboll, eller som behagelig plagg under fisketuren? Du bestemmer! <br><br> Laget i myk, vasket 100% bomull som gir den et litt r&oslash;ft, slitt utseende. P&aring; venstre bryst sitter det et Guideline skjold som ikke sier s&aring; rent lite om dine preferanser i livet. Den st&aring;lbl&aring; fargen passer utmerket til olabuksene eller under dressjakka en fredagskveld. Let''s go!</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:51:24', '2015-07-16 22:51:24', 'Guideline Thermal Shield Bib', 'guideline-thermal-shield-bib', 71920, '0', null, 0, 500, 'Førsteklasses vadere med gode pusteegenskaper fortjener skikkelige bukser under med de riktige egenskapene. 
<br>br>
THERMAL SHIELD er tynnere enn våre klassiske BIBS og er laget av et teknisk, avansert stoff som består av 95% Polyester og 5% elastan 400 gr/yds. 
<br><br>
Innsiden er spesialbehandlet for å unngå at fuktighet binder seg i stoffet og for mest mulig effektiv transport av overflødig varme fra kroppen.
<br><br>
Det mørkegrå ytterstoffet har små ruter for minimal friksjon. Og er laget i et glatt, sterkt materiale som ikke nupper eller slites mot vadebuksene. Buksene har en stram, fin passform som gjør den også egnet til å ha under turbuksene uten at det blir klumpete eller ubehagelig. 
<br><br>
På ene siden er det en glidelåslomme med en lav profil for nøkler og andre verdisaker. Buksen har elastiske lycra bånd under foten som forhindrer at buksene glir opp og skaper et mellomrom mellom sokker og bukse.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:51:24', '2015-07-16 22:51:24', 'Guideline Thermal Shield Bib', 'guideline-thermal-shield-bib2', 71920, '0', null, 0, 500, '<p>F&oslash;rsteklasses vadere med gode pusteegenskaper fortjener skikkelige bukser under med de riktige egenskapene. <br>br&gt; THERMAL SHIELD er tynnere enn v&aring;re klassiske BIBS og er laget av et teknisk, avansert stoff som best&aring;r av 95% Polyester og 5% elastan 400 gr/yds. <br><br> Innsiden er spesialbehandlet for &aring; unng&aring; at fuktighet binder seg i stoffet og for mest mulig effektiv transport av overfl&oslash;dig varme fra kroppen. <br><br> Det m&oslash;rkegr&aring; ytterstoffet har sm&aring; ruter for minimal friksjon. Og er laget i et glatt, sterkt materiale som ikke nupper eller slites mot vadebuksene. Buksene har en stram, fin passform som gj&oslash;r den ogs&aring; egnet til &aring; ha under turbuksene uten at det blir klumpete eller ubehagelig. <br><br> P&aring; ene siden er det en glidel&aring;slomme med en lav profil for n&oslash;kler og andre verdisaker. Buksen har elastiske lycra b&aring;nd under foten som forhindrer at buksene glir opp og skaper et mellomrom mellom sokker og bukse.</p>', '', 3, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:51:24', '2015-07-16 22:51:24', 'Guideline Thermofleece Bib', 'guideline-thermofleece-bib', 55920, '0', null, 0, 500, 'Et må ha produkt for deg som fisker med pustende vadere.
<br><br>
Våre velprøvde fleecebukser er produsert i 500 grams dobbeltsidig s.k nonpiling fleece i toppkvalitet har en suveren varmeisolasjon og beholder formen etter lang tids bruk og mange vasker.
<br><br>
Buksa har justerbare, elastiske seler, to romslige lommer, glidelås og lycrabånd under foten som holder den på plass uten å gli opp.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:41:52', '2015-07-16 22:41:52', ' Thermofleece Bib', 'guideline-thermofleece-bib2', 63920, '0', null, 0, 1500, '<p>Et &rdquo;m&aring; ha&rdquo; produkt for deg som fisker med pustende vadere. <br><br> V&aring;re velpr&oslash;vde fleecebukser er produsert i 500 grams dobbeltsidig s.k nonpiling fleece i toppkvalitet har en suveren varmeisolasjon og beholder formen etter lang tids bruk og mange vasker. <br><br> Buksa har justerbare, elastiske seler, to romslige lommer, glidel&aring;s og lycrab&aring;nd under foten som holder den p&aring; plass uten &aring; gli opp.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:41:52', '2015-07-16 22:41:52', ' Trek', 'guideline-trek', 239919, '0', null, 0, 3000, '<p>En ny tiln&aelig;rming i vadebuksedesign. TREK vadere er designet med et avansert snitt som eliminerer den lange s&oslash;mmen p&aring; innsiden av leggen, men opprettholder likevel god passform og bevegelsesmuligheter gjennom formsydde ben. <br><br> Beina har 5-lag med Nylon Supplex stoff som gir god slitestyrke og dessuten puster meget godt. <br><br> <br>- Buksen har elastiske grusbeskyttere av neoprene som gir en tett forsegling rundt vadeskoene. <br>- Neoprenesokkene er h&oslash;yre/venstre sk&aring;rne for god passform. <br>- Den &oslash;vre delen av buksen er av samme sterke Nylon Supplex stoff som beina, men i denne delen er det 4-lag for &oslash;kt komfort og enda bedre pusteegenskaper. <br>- Bukseselene kan tas av og brystpartiet kan sn&oslash;res sammen, slik at du f&aring;r en optimal passform. <br>- Den store, utvendige nettinglommen har fleece p&aring; innsiden og fungerer ogs&aring; som h&aring;ndvarmer. <br>- P&aring; innsiden er det en stor lomme som kan vippes ut, noe som er praktisk p&aring; varme dager da du &oslash;nsker &aring; g&aring; med nedbrettede bukser. <br>- Andre gode detaljer er non-stretch vadebelte, hemper til &aring; henge buksa til t&oslash;rk i, samt d-ring i front for feste av verkt&oslash;y, vadestav etc. <br><br> Membranen i buksen er testet til &aring; transportere 5000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 20000 mm/per tomme. Buksen har 5-lag med stoff i bena og 4-lag i den &oslash;vre delen.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:41:52', '2015-07-16 22:41:52', ' Trek', 'guideline-trek2', 159920, '0', null, 0, 3000, '<p>TREK er en 2,5 lags skalljakke, er lett i vekt og har et snitt for god bevegelsesfrihet. Jakken er laget av den Japanske membranen EntrantDT fra Toray som s&oslash;rger for at du holder deg t&oslash;rr under alle forhold. <br><br> Det slanke snittet p&aring; jakken gj&oslash;r at den er god &aring; bruke sammen med en chest pack eller vest. Jakken kan lett pakkes sammen slik at den blir liten og enkel &aring; ta med i en dagstur sekk. Med sin formsydde design og moderne membran er det en ideell skalljakke for deg som g&aring;r mye eller er aktiv p&aring; andre m&aring;ter i ditt fiske og friluftsliv. <br><br> Farge: Tarmac.<br> St&oslash;rrelser: XS-XXL <br> Membran:ENTRANT DT har pusteegenskaperer p&aring; 10000g/m2/24timer og t&aring;ler en vanns&oslash;yle p&aring; opptil 10000 mm/per tomme. <br><br> TREK JAKKE - DETALJER <br> &bull;Jakken har to innvendig brystlommer som rommer store fluebokser og lett komprimeres n&aring;r du har noe utenp&aring;. <br>&bull;YKK vanntett glidel&aring;s. <br>&bull;Hetten p&aring; jakken har samme gode design som p&aring; ALTA jakken. Den sitter godt, f&oslash;lger hodets bevegelser n&aring;r du har den p&aring; og er lett &aring; komprimere. <br>&bull;Mansjettene er elastiske og hindrer at vann kommer inn under fiske i regn. De er ogs&aring; designet slik at de ikke er i veien under fluekastingen.</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:14', '2015-07-16 22:51:24', '2015-07-16 22:51:24', 'Guideline TSL - Tapered Shooting Line', 'guideline-tsl-tapered-shooting-line', 35120, '0', null, 0, 250, 'Den nye TSL skytelinen er et perfekt alternativ for den som ønsker en klassisk
coated skyteline. Linen bygger på en solid, low stretch monofilamentkjerne.
Sammen med bruk av den nyeste teknologien for coating har vi laget en line som
er stivere, glattere og som gir bedre linekontroll under kasting. <br>Det unike med TSL
er den taperte fronten. Fordelen med det er at du får en jevnere overgang mellom
klump og skyteline, mer stabilitet og økt slitestyrke. Linene kommer i .028
og .031 på 30 meter og .034 på 35 meter. Alle liner kommer med små, sterke
løkker i front.', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:15', '2015-07-16 22:39:08', '2015-07-16 22:39:08', 'Gullbukker', 'gullbukker', 22320, '0', null, 0, 500, '<p>&nbsp;</p>
<p style="padding-bottom: 4px; margin-bottom: 4px; color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; ">Se denne &nbsp;jaktfilm om gullbukker, som er&nbsp;filmet i Ungarn og Sydengland. Gullbukker finnes det ikke mange av, men det&nbsp; lykkedes at f&aring; 4&nbsp;fine gullbukker med p&aring; denne spennde &nbsp;film. Filmen er krydret med flere gode innslag om virkelig store bukker, samt om oppm&aring;ling m.m.</p>
<div>&nbsp;</div>
<div class="product_comments" style="color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; ">&nbsp;</div>
<p>&nbsp;</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:15', '2015-07-16 22:39:08', '2015-07-16 22:39:08', 'Gåsejakt', 'gasejakt', 22320, '0', null, 0, 500, '<p><span style="color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; ">Jaktilmen&nbsp;er tatt opp&nbsp;i det sydlige Sverige og p&aring; Island. Vi f&oslash;lger jegerne Torben, Frank og Brian,&nbsp;som er bitt av&nbsp;g&aring;sejagt.</span><br style="color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; " />
<span style="color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; ">I filmen kommer de ut for noen helt fantastiske jaktoplevelser. En unik film for haglb&oslash;ssejegeren etter de eftertraktede g&aelig;s. Jagten foreg&aring;r fra skjul og med lokkeg&aelig;s.</span><br style="color: rgb(82, 82, 82); font-family: Geneva, Tahoma, Arial, Helvetica, sans-serif; " />
