INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:22', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Adventdalen', 'helsport-adventdalen', 247600, '0', null, 0, 3000, '<p>Helsports fiber/dun soveposer er oppgradert for sesongen 2010 med ny, forbedret oppbygning. De nye posene har dun i hele innerlaget av posen, noe som gir god varme og &oslash;ker komfortf&oslash;lelsen. Undersiden av posen har fremdeles et tykkere fiberlag enn resten av posen for &aring; isolere godt mot underlaget. Teknisk, sv&aelig;rt lett og pustende 20D innerstoff som t&oslash;rker raskt. Slitesterkt, vannavvisende 50D ytterstoff med ripstop som t&aring;ler hard bruk. <br> <br>Helsport Komfort : -19&ordm;C <br>T-Lim: -11&ordm;C <br>T-Comf: -5&deg;C <br>T-Ext: -31&deg;C <br>T-Max: 9&deg;C <br>Vekt (+-10%): 2,4 kg <br>Fyllmateriale: Fiber/Dun 2 x Thermoguard 6000&reg; (1100g) + 90/10 Duck <br>down (530g) <br>Pose lengde/ bredde: 80x225 cm <br>Personlengde: 195cm <br>Glidel&aring;s lengde: 190cm <br>Volum i trekk komprimert (cm): 21x24 <br>Kan kobles: Ja <br>Varmekrage: Ja <br>Farger: Pitch Black/Mandarine Fire</p>', '', 4, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:23', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Alta', 'helsport-alta', 132000, '0', null, 0, 3000, '<p>Testvinneren Alta er v&aring;r mest solgte sovepose. Alta er en behagelig, robust og allsidig pose med lite pakkvolum som passer godt for norske forhold p&aring; v&aring;ren, i sommerfjellet og tidlig om h&oslash;sten. Slitesterkt lettvekts ytterstoff beskytter posen p&aring; t&oslash;ffe turer og innerstoff i myk micropolyester gj&oslash;r soveopplevelsen behagelig. Alta-serien best&aring;r av 6 ulike modeller, slik at det skal v&aelig;re enkelt &aring; finne en st&oslash;rrelse som passer. Posene er bygd opp med to lag fiber. Kun innerste lag fiber er sydd til innerforet, noe som gir god isolasjon og lavere varmetap. <br> <br> <br>Helsport Komfort : -10&ordm;C <br>T- Lim: -5&ordm;C <br>T-Comf: 0&deg;C <br>T-Ext: -22&deg;C <br>T-Max: 13&deg;C <br>Vekt (+-10%): 1,9 kg <br>Fyllmateriale: 2 x Thermoguard 6000&reg; (1100g) <br>Pose lengde/ bredde: 85x225 cm <br>Personlengde: 195cm <br>Glidel&aring;s lengde: 190cm <br>Volum i trekk komprimert (cm): 18x24 <br>Kan kobles: Ja <br>Varmekrage: Ja <br>Farger: Dark Olive/Charcoal Grey <br>Bright Green/Charcoal Grey</p>', '', 5, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:23', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Alta LT', 'helsport-alta-lt', 103600, '0', null, 0, 3000, '<p>Testvinneren Alta er v&aring;r mest solgte sovepose. Alta er en behagelig, robust og allsidig pose med lite pakkvolum som passer godt for norske forhold p&aring; v&aring;ren, i sommerfjellet og tidlig om h&oslash;sten. Slitesterkt lettvekts ytterstoff beskytter posen p&aring; t&oslash;ffe turer og innerstoff i myk micropolyester gj&oslash;r soveopplevelsen behagelig. Alta-serien best&aring;r av 6 ulike modeller, slik at det skal v&aelig;re enkelt &aring; finne en st&oslash;rrelse som passer. Posene er bygd opp med to lag fiber. Kun innerste lag fiber er sydd til innerforet, noe som gir god isolasjon og lavere varmetap. <br> <br>Helsport Komfort : -4&ordm;C <br>T- Lim: 0&ordm;C <br>T-Comf: 4&deg;C <br>T-Ext: -16&deg;C <br>T-Max: 16&deg;C <br>Vekt (+-10%): 1,6 kg <br>Fyllmateriale: 2 x Thermoguard 6000&reg; (1000g) <br>Pose lengde/ bredde: 80x220 cm <br>Personlengde: 190cm <br>Glidel&aring;s lengde: 190cm <br>Volum i trekk komprimert (cm): 17x20 <br>Kan kobles: Ja <br>Varmekrage: Ja <br>Farger: Dark Olive/Charcoal Grey <br>Bright Green/Charcoal Grey</p>', '', 5, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:23', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Breheimen 45L', 'helsport-breheimen-45l', 31920, '0', null, 0, 1000, '<div>
<p><strong>Helsport Breheimen</strong> <br>Dette er en sekk som kan brukes b&aring;de til korte og litt lengre turer. Fra hytte-til-hytte turer til korte dagsturer i marka. <br>B&aelig;resystemet er godt avstivet med aluminiumsskinner, som gj&oslash;r at den t&aring;ler at en laster tungt. <br>Godt polstrede skulderreimer og belte hjelper til med &aring; fordele belastningen.</p>
<p>Det er mange muligheter for feste av utstyr p&aring; utsiden av sekken. Med flere lommer og &aring;pninger er det enkelt &aring; sortere utstyr og holde orden. <br>Topplokket har to lommer, hvorav den ene p&aring; innsiden av lokket kan brukes til ting som trenger ekstra beskyttelse. <br>P&aring; den ene siden har sekken en vertikal glidel&aring;s som gir deg en ekstra tilgang til hovedrommet, mens det p&aring; den andre siden er en ekspanderende sidelomme.</p>
<p>De kraftige stoffene t&aring;ler mye slitasje og er vanntette. <br>PS. Vann kan komme inn i sekken via s&oslash;mmene, s&aring; i regnv&aelig;r b&oslash;r det medf&oslash;lgende regntrekket benyttes.</p>
<p><strong>Spesifikasjoner:</strong></p>
<p>- Volum: 35L <br>- Vekt: 1,3 kg <br>- Stoffer: polyester 600D, polyamid 75D ripstop</p>
</div>
<p>&nbsp;</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
