<p class="p1" style="margin: 0px 0px 15px; padding: 0px; color: #333333; font-family: fgb, Arial, Verdana, sans-serif; font-size: 18px; line-height: 26px;">K&aring;ret til best i test b&aring;de i 2008 og 2010:</p>
<p class="p3" style="margin: 0px 0px 15px; padding: 0px; color: #333333; font-family: fgb, Arial, Verdana, sans-serif; font-size: 18px; line-height: 26px;"><strong>Beste skolesekk og barnehagesekk!</strong></p>
<p class="p4" style="margin: 0px 0px 15px; padding: 0px; color: #333333; font-family: fgb, Arial, Verdana, sans-serif; font-size: 18px; line-height: 26px;"><em>&rdquo;Godt b&aelig;resystem som gj&oslash;r at sekken er lett &aring; b&aelig;re. Testens beste skulderreime. Smalere sekkepose som gir frihet for armene. Testens letteste. Ikke un&oslash;dvendig ekstrautstyr.&rdquo;</em></p>
<p class="p4" style="margin: 0px 0px 15px; padding: 0px; color: #333333; font-family: fgb, Arial, Verdana, sans-serif; font-size: 18px; line-height: 26px;">Rygglengde:<br>15L: 2-4 &aring;r</p>
<p class="p4" style="margin: 0px 0px 15px; padding: 0px; color: #333333; font-family: fgb, Arial, Verdana, sans-serif; font-size: 18px; line-height: 26px;">20L: 5-9 &aring;r</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
