<div>
<p>Elg er skapt for &aring; brukes av barn i friluftsbarnehager og p&aring;&nbsp; tur generelt. Funksjonene er tilpasset b&aring;de barns og voksnes behov. Sekken er ergonomisk tilpasset barn, med tanke p&aring; at de skal kunne b&aelig;re litt selv, samtidig som den skal fungere godt til &aring; f&aring; med og holde orden p&aring; alt som trengs for en dag barnehagen. Kommer i s&oslash;te, t&oslash;ffe og stilige fargevarianter.</p>
<p>K&aring;ret til best i test b&aring;de i 2008 og 2010:</p>
<p><strong>Beste skolesekk og barnehagesekk!</strong></p>
<p><em>&rdquo;Godt b&aelig;resystem som gj&oslash;r at sekken er lett &aring; b&aelig;re. Testens beste skulderreime. Smalere sekkepose som gir frihet for armene. Testens letteste. Ikke un&oslash;dvendig ekstrautstyr.&rdquo;</em></p>
<p>Rygglengde:<br>15L: 2-4 &aring;r<br>20L: 5-9 &aring;r&nbsp;</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>B&aelig;resystem tilpasset barn <br>- Topplokk med lommer <br>- Godt synlig navnelapp <br>- Reflekser p&aring; alle sider <br>- Enkel h&aring;ndtering av remmer og spenner <br>- Matbokslomme h&oslash;yt oppe i sekken <br>- Grovlomme p&aring; fronten<br>- Frontlomme for &rdquo;sm&aring;kl&aelig;r&rdquo; (stillongs, sokker, votter, m.m.) <br>- Sidelommer/ flaskelommer <br>- Festemuligheter utenp&aring; sekken</p>
</div>
</div>
<p>&nbsp;</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:25', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Femunden 65 Sekkpakke', 'helsport-femunden-65-sekkpakke', 236000, '0', null, 0, 4000, '<p>Femunden er en sekk for fleredagers turer, utviklet som en kombinasjon av klassiske og moderne l&oslash;sninger. Dette er en meget solid og holdbar sekk, som er enkel og oversiktlig i bruk. Du er ogs&aring; sikret fortreffelig b&aelig;rekomfort gjennom v&aring;rt Helsport LINK&reg;(pat.pend.) b&aelig;resystem, som hjelper deg &aring; b&aelig;re riktig gjennom stabilitet, justeringsmuligheter og god ergonomi. Konstruksjonen gir veldig god blodtilf&oslash;rsel til beina og unik bevegelighet i ulendt terreng. Med Femunden har du en anvendelig sekk for b&aring;de korte og lengre turer, &aring;r etter &aring;r.</p>', '', 44, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:25', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Fjellduk Pro', 'helsport-fjellduk-pro', 84000, '0', null, 0, 1000, '<p>Fjellduken er et praktisk mulitprodukt som brukes p&aring; forskjellige m&aring;ter alt etter situasjon og behov. enten du blir overrasket av ekstremt v&aelig;r eller p&aring; lett camping, vil fjellduken ha en funksjon. Hette og ermene er avtagbare og benyttes/ tas av etter behov. Helsport Fjellduk kan blant annet benyttes som poncho, sovepose, vindsekk og overseil. Den kommer i forskjellige farger/m&oslash;nster og tykkelse. <br><br> <strong>Materialer:</strong> <br>-Ytterstoff: Polyester PU <br>-Innerstoff: Polyamide Ripstop <br> <strong>Spesifikasjoner:</strong> <br>-Vekt Duk : 575 g <br>-Vekt Hette+Arm: 200 g <br>-Vekt Totalt: 775 g <br>-Volum komp: 12x25 <br>-M&aring;l Utbrettet: 160x230 cm <br>-M&aring;l som vindsekk: 115x160 cm <br>-M&aring;l som poseovertrekk: 80x230 cm <br>-Tillegg: Kompresjonstrekk og n&oslash;dflagg f&oslash;lger med <br>-Farger: Oliven, Kamuflasje Fjell, Kamuflasje Skog/Army Green,Mountain Camoflauge</p>', '', 2, 1, 0, 1, null, '18', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:25', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Fjellduk Xtrem', 'helsport-fjellduk-xtrem', 124000, '0', null, 0, 2000, '<p>Fjellduken er et praktisk mulitprodukt som brukes p&aring; forskjellige m&aring;ter alt etter situasjon og behov. enten du blir overrasket av ekstremt v&aelig;r eller p&aring; lett camping, vil fjellduken ha en funksjon. Hette og ermene er avtagbare og benyttes/ tas av etter behov. Helsport Fjellduk kan blant annet benyttes som poncho, sovepose, vindsekk og overseil. Den kommer i forskjellige farger/m&oslash;nster og tykkelse. <br><br> <strong>Materialer:</strong> <br>-Ytterstoff: Polyester PU <br>-Fyllmaterial: Themoguard 5000 <br>-Innerstoff: Polyamide Ripstop <br><br> <strong>Spesifikasjoner:</strong> <br>-Vekt Duk : 1500 g <br>-Vekt Hette+Arm: 200 g <br>-Vekt Totalt: 1700 g <br>-Volum komp: 20x25 <br>-M&aring;l Utbrettet: 160x230 cm <br>-M&aring;l som vindsekk: 115x160 cm <br>-M&aring;l som poseovertrekk: 80x230 cm <br>-Tillegg: Kompresjonstrekk og n&oslash;dflagg f&oslash;lger med <br>-Farger: Oliven, Kamuflasje Fjell, Kamuflasje Skog/Army Green, Mountain Camoflauge</p>', '', 0, 1, 0, 1, null, '18', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:25', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Fjellheim 85 Sekkpakke', 'helsport-fjellheim-85-sekkpakke', 300000, '0', null, 0, 4000, '<p>Fjellheimen er en modell for ivrige fjellvandrere som s&oslash;ker en sekk som kombinerer fleksible l&oslash;sninger, holdbarhet og lav vekt. Denne sekken benytter de beste materialene og komponentene. Den har et rikelig og gjennomtenkt utvalg av festemuligheter og lommer, samt tilgang til hovedrommet fra toppen eller fronten. Helsport LINK&reg;(pat.pend.) hjelper deg &aring; b&aelig;re riktig gjennom stabilitet, justeringsmuligheter og god ergonomi. Konstruksjonen gir veldig god blodtilf&oslash;rsel til beina og unik bevegelighet i ulendt terreng. Med utstyret lett tilgjengelig og sekken stabilt p&aring; ryggen er du klar for de mest utfordrende turene fjellheimen kan by p&aring;. <br> Du f&aring;r ogs&aring; med: <br> <br>- Kjelesett <br>- Gassbrenner <br>- Tennst&aring;l <br>- Bestikk <br>- Lykt</p>', '', 45, 1, 0, 1, null, '', null, '', '', null, null, 0);
