<p>Dette er ekstremt lette telt om man ser det i sammenheng med at man her ogs&aring; <br>har et fortelt hvor man kan lagre utstyr og lage mat. Fjellheimen superlight <br>f&oslash;yer seg dermed inn i rekken av telt som er utviklet for dem som vil bevege <br>seg raskt og lett over lengre distanser med lite i sekken. Alle teltets detaljer <br>er designet med tanke p&aring; &aring; kombinere funksjon og lav vekt. Godt inneklima <br>er sikret med en kombinasjon av en lav skj&oslash;rteventil og to h&oslash;ytst&aring;ende <br>minimalistiske ventiler.</p>
<h3><a href="http://www.helsport.no/no/Infosenter/Produkttester/Fjellheimen_Superlight__beste_superlette_telt"><span style="color: #cc0000;">K&aring;ret til beste superlette telt av Fjell&amp;Vidde i 2012!</span></a></h3>
<p><br><br>Fjellheimen Superlight f&oslash;yer seg inn i rekken av telt som er utviklet for dem som vil bevege seg raskt og lett over lengre distanser med lite i sekken. Alle teltets detaljer er designet med tanke p&aring; &aring; kombinere funksjon og lav vekt. godt inneklima er sikret med en kombinasjon av en lav skj&oslash;rteventil og to h&oslash;ytst&aring;ende minimalistiske ventiler.</p>
<p>&nbsp;</p>
<p>- Superlett ytterduk med h&oslash;y vanns&oslash;yle, 3000 mm <br>&nbsp;- Tekstil med god pusteevne i innerteltet <br>&nbsp;- dAC Featherlight Nsl&trade; stenger <br>&nbsp;- Vannavst&oslash;tende YKK-glidel&aring;s i ytterteltet <br>&nbsp;- Ventiler med avstivere <br>&nbsp;- 1 stk skj&oslash;rteventil <br>&nbsp;- Lette plugg- og barduneringspunkter <br>&nbsp;- En kombinasjon av lette plugger holder vekten nede</p>
<p>&nbsp;</p>
<p>Stoff innertelt: Ripstop Superlight&reg; Polyamid<br>Stoff yttertelt: Helsport Superlight&reg; 3000, 3000 mm<br>Stoff bunn: Helsport Superlight&reg; 1000, 4000 mm<br>Stang: DAC Featherlight NSL&trade; (36cm segmentlengde)*</p>
