INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:27', '2015-07-16 22:40:39', '2015-07-16 22:40:39', ' Gimle 4', 'helsport-gimle-4', 399600, '0', null, 0, 6000, '<p>Igjen har Helsport utviklet et nytt teltkonsept. Hovedfokus har v&aelig;rt h&oslash;y komfort og &aring; bringe naturopplevelsen inn i teltet! Gimle har store &aring;pninger i fronten. Et vindu i taket gir deg f&oslash;lelsen av &aring; v&aelig;re godt beskyttet men samtidig midt i naturen. Gimle er et tresesongers telt med alle detaljer et godt og trygt Helsports fjelltelt har.<br><br> <strong>Funksjoner</strong><br> <br>&bull; Gode m&aring;l p&aring; h&oslash;yde, bredde og lengde <br>&bull; Hele 12 lommer i innertelt <br>&bull; Nettingloft med lommer og opphengssnor <br>&bull; Gode muligheter for lufting <br>&bull; Store &aring;pninger gj&oslash;r det lett &aring; g&aring; inn og ut av teltet <br>&bull; Fast bunn i bagasjerommet, som kan brettes til side <br>&bull; Nytt bardunfester. Bardunen kveiles opp og festes i strikken p&aring; en enkel og grei m&aring;te. <br>&bull; Helsport AirFlow&reg;II ventilasjonssystem &rdquo;skirt ventilation system&rdquo; <br>&bull; Fargekoding av stenger/stangkanaler <br>&bull; Unikt stangkanalsystem <br>&bull; Egenutviklet stangkopp <br><br> <strong>Materialer:</strong><br> <br>&bull; Helsport Rainguard&reg; yttertelt <br>&bull; Innertelt i Polyamid, bunn i Polyamid SI <br>&bull; Helsport Superpole&reg; stenger i 44cm ledd <br><br> <strong>Spesifikasjoner:</strong> <br>&bull; Type telt: Kuppel <br>&bull; Personer: 4 <br>&bull; M&aring;l pakket: 22x50cm <br>&bull; Vekt telt (+/-10%): 5,1kg <br>&bull; Vekt plugger: 0,24kg <br>&bull; Antall innganger: 2 <br>&bull; Antall bagasjerom: 2 <br>&bull; Stanglengde: 1x364 +1x396 +1x510cm <br>&bull; Tilbeh&oslash;r: Rep Kit (+0,15kg) <br> <img src="http://www.helsport.no/no/produkter/TELT/Trek/images/Marketing/produkter/telt/Gimle/gimleVARIANT4.jpg" border="0"> <br> <img src="http://www.helsport.no/no/produkter/TELT/images/Marketing/Service/Helsport_quality_guarantee.png" border="0"></p>', '', 1, 1, 0, 1, null, '4', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:27', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Gimle 4+2', 'helsport-gimle-42', 479600, '0', null, 0, 8000, '<p>Gimle Family 4+2 er et av v&aring;re mest praktiske familietelt hvor du kan st&aring; oppreist i bagasjerommet. Det har to vinduer i oppholdsrommet som slipper mye lys inn i teltet. Teltet har soveplass til 4 personer, men her er det mulighet for &aring; sette inn et ekstra innertelt for 2 personer (ekstrautstyr). Nytt i &aring;r er et stort netting-vindu som kan lukkes og gir gode luftemuligheter og godt inn- og utsyn. Det er enkelt &aring; sette opp for en person og en rekke ekstra pluggfester og barduneringspunkter gj&oslash;r at teltet st&aring;r godt ogs&aring; i sterk vind. Et ideelt telt for store grupper og familier b&aring;de i fjellet og p&aring; campingplassen. Baldakinl&oslash;sning i side&aring;pningen. 170 cm stenger for bruk til baldakin kj&oslash;pes i tillegg.<br><br> <strong>Funksjoner</strong><br> <br>&bull; Kan montere inn ekstra inner telt for 2 personer (ekstrautstyr) <br>&bull; Stort bagasjerom med st&aring;h&oslash;yde <br>&bull; Stor sideinngang og nettingvindu <br>&bull; To vinduer av kuldebestandig plast, kan lukkes fra innsiden <br>&bull; Bardunen kveiles opp og festes i strikken p&aring; en enkel og grei m&aring;te <br>&bull; Helsport AirFlow&reg;II ventilasjonssystem <br>&bull; Fargekoding av stenger/stangkanaler <br>&bull; Unikt stangkanalsystem <br>&bull; Egenutviklet stangkopp <br><br> <strong>Materialer:</strong><br> <br>&bull; Helsport Rainguard&reg; yttertelt <br>&bull; Innertelt i Polyamid, bunn i Polyamid SI <br>&bull; Helsport Superpole&reg; stenger i 44cm ledd <br><br> <strong>Spesifikasjoner:</strong> <br>&bull; Type telt: Tunneltelt <br>&bull; Personer: 4 <br>&bull; M&aring;l pakket: 24x53cm <br>&bull; Vekt telt (+/-10%): 7,1kg <br>&bull; Vekt plugger: 0,35kg <br>&bull; Antall innganger: 1 <br>&bull; Antall bagasjerom: 1 <br>&bull; Stanglengde: 1x470+2x540cm <br>&bull; Tilbeh&oslash;r: Rep Kit (+0,15kg) <br> <img src="http://www.helsport.no/no/produkter/TELT/Trek/images/Marketing/produkter/telt/Gimle%20Family/Gimle%20family%20grunnriss.jpg" border="0" width="600"> <br> <img src="http://www.helsport.no/no/produkter/TELT/images/Marketing/Service/Helsport_quality_guarantee.png" border="0"></p>', '', 1, 1, 0, 1, null, '4', null, '', '', null, null, 0);
