<li>Skr&aring; inngang til innertelt: bedre utnyttelse av plass og enklere inngang</li>
<li>Ekstremt lav pakkevolum.</li>
<li>Nytt bardunfeste. Bardunen kveiles opp og festes i strikken p&aring; en enkel og grei m&aring;te.</li>
<li>Helsport AirFlow&reg;II ventilasjonssystem</li>
<li>Unikt stangkanalsystem</li>
<li>Egenutviklet stangkopp</li>
