INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:27', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Glitterheim Airvent Jr', 'helsport-glitterheim-airvent-jr', 84000, '0', null, 0, 3000, '<p>Komfortabel sovepose med to lag Helsport Thermoguard&reg; 6000. Glitterheim Junior har de samme funksjonene som Glitterheim standard, men st&oslash;rrelsen er tilpasset barn. Med varmekrage</p>
<p>Soveposene i Glitterheim-serien er utviklet med tanke p&aring; komfort og har smarte detaljer tilpasset overnatting p&aring; kortere turer i telt eller hytte. Ekstra bred passform og flere luftemuligheter gj&oslash;r posen mer behagelig enn vanlige poser med mumiefasong. Nytt i 2010 er Helsport AirVent&trade; systemet. P&aring; motsatt side av glidel&aring;s&aring;pningen kan posen &aring;pnes i full lengde for lufting uten at posen faller av. Dette gir &oslash;kt komfort og utvider bruksomr&aring;det til posene betraktelig. Det er ogs&aring; mulig &aring; sitte med posen over skuldrene og begge armer ut. </p>
<p>&nbsp;</p>
<p><strong>Funksjoner:</strong><br> - Helsport AirVent&trade; system gir ekstra lufting i hele posens lengde for &oslash;kt komfort<br> - Bred passform for utmerket komfort<br> - Stretch-lomme for kl&aelig;r eller pute innvendig<br> - Enkel betjening av stramming<br> - Full lengde, 2-veis glidel&aring;ser som er kobbelbare<br> - Lett ripstop ytterstoff og komfortabelt innerstoff<br> - No-Slide&reg; i deler av undersiden<br> - Mulig &aring; sitte med begge armer ut<br> - Lomme for sm&aring;ting<br> - Varmekrage <br> <br> <strong>Spesifikasjoner</strong>:<br> <br>- Helsport Komfort : -4&ordm;C <br>- T- Lim: 0&ordm;C <br>- T-Comf: 4&deg;C <br>- T-Ext: -16&deg;C <br>- T-Max: 16&deg;C <br>- Vekt (+-10%): 1,3 kg <br>- Fyllmateriale: 2 x Thermoguard 6000&reg; (850g) <br>- Pose lengde/ bredde: 75x175 cm <br>- Personlengde: 150cm <br>- Glidel&aring;s lengde: 140cm <br>- Volum i trekk komprimert (cm): 17x23 <br>- Kan kobles: Nei <br>- Varmekrage: Ja <br>- Farger: Mandarin Fire/Golden Yellow</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:28', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Glitterheim Airvent LT', 'helsport-glitterheim-airvent-lt', 84000, '0', null, 0, 3000, '<p>Komfortabel ett-lags v&aring;r-og sommerpose med lav vekt, ekstra bredde og luftemulighet.</p>
<p>Soveposene i Glitterheim-serien er utviklet med tanke p&aring; komfort og har smarte detaljer tilpasset overnatting p&aring; kortere turer i telt eller hytte. Ekstra bred passform og flere luftemuligheter gj&oslash;r posen mer behagelig enn vanlige poser med mumiefasong. Nytt i 2010 er Helsport AirVent&trade; systemet. P&aring; motsatt side av glidel&aring;s&aring;pningen kan posen &aring;pnes i full lengde for lufting uten at posen faller av. Dette gir &oslash;kt komfort og utvider bruksomr&aring;det til posene betraktelig. Det er ogs&aring; mulig &aring; sitte med posen over skuldrene og begge armer ut. </p>
<p><strong>Funksjoner:</strong><br> - Helsport AirVent&trade; system gir ekstra lufting i hele posens lengde for &oslash;kt komfort<br> - Bred passform for utmerket komfort<br> - Stretch-lomme for kl&aelig;r eller pute innvendig<br> - Enkel betjening av stramming<br> - Full lengde, 2-veis glidel&aring;ser som er kobbelbare<br> - Lett ripstop ytterstoff og komfortabelt innerstoff<br> - No-Slide&reg; i deler av undersiden<br> - Mulig &aring; sitte med begge armer ut<br> - Lomme for sm&aring;ting<br> - Varmekrage <br> <br> <strong>Spesifikasjoner</strong>:<br> - Helsport Komfort : 0&ordm;C <br> - T-Lim: 4&ordm;C <br> - T-Comf: 8&deg;C <br> - T-Ext: -10&deg;C <br> - T-Max: 19&deg;C <br> - Vekt (+-10%): 1,6 kg <br> - Fyllmateriale: 1 x Thermoguard 6000&reg; (950g) <br> - Pose lengde/ bredde: 85x220 cm <br> - Personlengde: 190cm <br> - Glidel&aring;s lengde: 190cm <br> - Volum i trekk komprimert (cm): 17x20 <br> - Kan kobles: Ja <br> - Varmekrage: Nei <br> - Farger: RiverBlue/Bigblue<br> - Helsport Green/Bright Green</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:28', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Glitterheim Airvent XT', 'helsport-glitterheim-airvent-xt', 100000, '0', null, 0, 3000, '<p>Komfortabel to-lags tresesongers pose som t&aring;ler lavere temperaturer. Ekstra bredde, luftemulighet og innvendig varmekrage.<br><br></p>
<p>Soveposene i Glitterheim-serien er utviklet med tanke p&aring; komfort og har smarte detaljer tilpasset overnatting p&aring; kortere turer i telt eller hytte. Ekstra bred passform og flere luftemuligheter gj&oslash;r posen mer behagelig enn vanlige poser med mumiefasong. Nytt i 2010 er Helsport AirVent&trade; systemet. P&aring; motsatt side av glidel&aring;s&aring;pningen kan posen &aring;pnes i full lengde for lufting uten at posen faller av. Dette gir &oslash;kt komfort og utvider bruksomr&aring;det til posene betraktelig. Det er ogs&aring; mulig &aring; sitte med posen over skuldrene og begge armer ut. </p>
<p><strong>Funksjoner:</strong><br> - Helsport AirVent&trade; system gir ekstra lufting i hele posens lengde for &oslash;kt komfort<br> - Bred passform for utmerket komfort<br> - Stretch-lomme for kl&aelig;r eller pute innvendig<br> - Enkel betjening av stramming<br> - Full lengde, 2-veis glidel&aring;ser som er kobbelbare<br> - Lett ripstop ytterstoff og komfortabelt innerstoff<br> - No-Slide&reg; i deler av undersiden<br> - Mulig &aring; sitte med begge armer ut<br> - Lomme for sm&aring;ting<br> - Varmekrage <br> <br> <strong>Spesifikasjoner</strong>:<br> - Helsport Komfort : -10&ordm;C <br> - T- Lim: -5&ordm;C <br> - T-Comf: 0&deg;C <br> - T-Ext: -22&deg;C <br> - T-Max: 13&deg;C <br> - Vekt (+-10%): 2,1 kg <br> - Fyllmateriale: 2 x Thermoguard 6000&reg; (1475g) <br> - Pose lengde/ bredde: 85x220 cm <br> - Personlengde: 190cm <br> - Glidel&aring;s lengde: 190cm <br> - Volum i trekk komprimert (cm): 21x25 <br> - Kan kobles: Ja <br> - Varmekrage: Ja <br> - Farger: R&oslash;d,Helsport Gr&oslash;nn</p>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
