<p>Soveposene i Glitterheim-serien er utviklet med tanke p&aring; komfort og har smarte detaljer tilpasset overnatting p&aring; kortere turer i telt eller hytte. Ekstra bred passform og flere luftemuligheter gj&oslash;r posen mer behagelig enn vanlige poser med mumiefasong. Nytt i 2010 er Helsport AirVent&trade; systemet. P&aring; motsatt side av glidel&aring;s&aring;pningen kan posen &aring;pnes i full lengde for lufting uten at posen faller av. Dette gir &oslash;kt komfort og utvider bruksomr&aring;det til posene betraktelig. Det er ogs&aring; mulig &aring; sitte med posen over skuldrene og begge armer ut.</p>
<p>&nbsp;</p>
