INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:28', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Isfjorden Dark Olive Venstre', 'helsport-isfjorden-dark-olive-venstre', 183600, '0', null, 0, 1000, '<p>Helsports popul&aelig;re vinterpose i hel fiber, Isfjorden, kommer n&aring; ogs&aring; i lang og kort utgave. Isfjorden er fylt med vannavvisende Helsport Thermoguard&reg; fiber som t&aring;ler fuktig klima godt. Fiberen mister ikke isolasjonsevnen dersom posen skulle bli v&aring;t og passer godt for norske forhold. Isfjorden LT har samme konstruksjon som Isfjorden, men litt mindre fiberfyll og pakkvolum. Posen passer like godt for kalde h&oslash;stnetter som tidlige vinterturer.</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<div>
<ul>
<li>Varmekrage som hindrer varm luft i &aring; slippe ut av posen.&nbsp;</li>
<li>Helsport Modular&reg; System: Ekstra isolasjon i rygg og fotende.</li>
<li>Full lengde, 2-veis glidel&aring;s som er kobbelbar.</li>
<li>Lomme for sm&aring;ting.</li>
<li>Pillow-Pocket&reg;</li>
<li>4SLEEP&reg; BOX KONSTRUKSJON : Helsport 4Sleep&reg; konstruksjonen er en fasongsydd og kroppstilpasset konstruksjon der fire vegger utgj&oslash;r posen. Dette gir et jevnt luftlag rundt hele kroppen med mindre innvendig luftvolum som m&aring; varmes opp.</li>
<li>Selvlysende drager.</li>
</ul>
</div>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>Shell fabric over: Airtex&reg; Polyamide Diamond Ripstop Shell fabric under: Airtex&reg; Polyamide Diamond Ripstop Lining: Airtex&reg; 50D Micro Polyester</p>
