</div>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:29', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Kongsfjorden', 'helsport-kongsfjorden', 580000, '0', null, 0, 3000, '<p>Nytt og unikt 2-pose konsept i X-trem segmentet. Kongsfjorden kombinerer fleksibiliteten fra det kjente Tempelfjordensystemet med den uovertrufne isolasjonsevnen til dun og funksjonelle detaljer for ekstreme vinterturer. Med en komforttemperatur p&aring; -47 grader og en vekt p&aring; kun 3,7 kg, gir Kongsfjordenmaksimal beskyttelse uten &aring; ta for stor plass i oppakningen. Innerposen er en hel dunpose med 1100 gram g&aring;sedun av h&oslash;yeste kvalitet. Ytterposen best&aring;r som p&aring; Tempelfjorden av en tynn fiberpose som trekkes utenp&aring; dunposen. Denne kan ogs&aring; brukes alene som sommerpose eller under toppst&oslash;t. Innerposen kan brukes alene som en fullverdig vinterdunpose. Innerposen har teknisk, sv&aelig;rt lett og pustende 20D duntett innerstoff som t&oslash;rker raskt. Behagelig micropolyester innerstoff i ytterposen. Slitesterkt, vannavvisende 50D ytterstoff med ripstop p&aring; begge posene. 17.mars 2010 ble Kongsfjorden tildelt merket for god design! Les juryens kjennelse her. Dette er ogs&aring; posen Kronprinsesse Mette-Marit nylig omtalte i sin tale ved Norsk designr&aring;ds konferanse "Innovasjon for alle". <br> <br>Helsport Comfort : -47&ordm;C <br>T-Lim: -35&ordm;C <br>T-Comf: -25&deg;C <br>T-Ext: -62&deg;C <br>T-Max: -5&deg;C <br>T-Lim Inner bag: -20&deg;C <br>T-Lim Outer bag: 10&deg;C <br>Weight Inner bag (+-10%): 1,5kg <br>Weight Outer bag (+-10%): 2,0kg <br>Weight Complete (+-10%): 3,7kg <br>Fill Inner bag: 90/10 Goose Down (1100g) <br>Fill Outer bag: 1 x Thermoguard 6000&reg; (400g) <br>Bag lenght/ width Inner bag: 80x225cm <br>Bag lenght/ width Outer bag: 90x225cm <br>Person lenght: 195cm <br>Zipper Lenght Inner bag: 2x70cm <br>Zipper LenghtOuter: 190cm <br>Packed volume (cm): 27x34 <br>Attachable: Only outer bag <br>Heat Trap Collar: Yes <br>Color: Pitch Black/ Plum Red</p>', '', 4, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:29', '2015-07-16 22:40:43', '2015-07-16 22:40:43', ' Lom', 'helsport-lom', 92000, '0', null, 0, 3000, '<p>Alle posene i Lom-serien har et lag fiber og den karakteristiske 4Sleep&reg; boks-konstruksjonen. Lette og kompakte poser som passer perfekt for turer i fjellet v&aring;r og sommer. Lom er lett &aring; komprimere, og tar liten plass i ryggsekken. En veldig praktisk pose for deg som skal g&aring; langt og vil spare vekt. <br> <br>Helsport Komfort : 6&ordm;C <br>T- Lim: 8&ordm;C <br>T-Comf: 12&deg;C <br>T-Ext: -4&deg;C <br>T-Max: 24&deg;C <br>Vekt (+-10%): 1,05 kg <br>Fyllmateriale: 1 x Thermoguard 6000&reg; (500g) <br>Pose lengde/ bredde: 80x220 cm <br>Personlengde: 190cm <br>Glidel&aring;s lengde: 190cm <br>Volum i trekk komprimert (cm): 14x17 <br>Kan kobles: Ja <br>Varmekrage: Nei <br>Farger: Cool Blue/Charcoal Grey <br>Dark Blue/Charcoal Grey</p>', '', 4, 1, 0, 1, null, '', null, '', '', null, null, 0);
