INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:30', '2015-07-16 22:40:47', '2015-07-16 22:40:47', ' Ringstind Superlight 1-2 Grønn', 'helsport-ringstind-superlight-12-gronn', 463600, '0', null, 0, 3000, '<p><span>Ringstind Superlight 1-2 er utviklet for alle som &oslash;nsker et telt som er sv&aelig;rt lett i forhold til innvendig plass, og er skapt etter malen av v&aring;rt mest popul&aelig;re lettvektstelt, Ringstind Light 2.<br> Vi har her utviklet et lett og unikt telt som har det meste et godt 3- sesongers telt skal ha. Vi har tatt hensyn til viktigheten av ekstremt holdbare og tekniske materialer, samt funksjonelle detaljer. Teltet veier kun 940 g komplett, inklusive stenger,<br> plugger og barduner.</span></p>
<p>&nbsp;</p>
<p><span>&bull; Teltet har to store ventiler som kan lukkes, en ved inngangen og en innluftventil nede i fotenden. &nbsp;<br> &bull; Det har godt med barduneringspunkter, to p&aring; front og to p&aring; teltbuen.&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br> &bull; Teltet har tre barduner i fotenden, hvor det ogs&aring; er satt inn tre sm&aring; stenger som gj&oslash;r det mulig &aring; bruke meget korte (50-75 cm) barduner. <br> &bull; Teltet er enkelt &aring; sette opp, og st&aring;r i tillegg st&oslash;tt i sterk vind.</span></p>
<p>&nbsp;</p>
<div style="display: block;"><span>&bull; Helsport Superlight Microfiber 15D i yttertelt<br> &bull; Innertelt i Polyamid Superlight Microfiber 15D<br> &bull; Bunn Helsport Superlight&reg;1000&nbsp;&nbsp; <br> &bull; Scandium Superpole&reg;FC 38cm lengde.</span></div>
<div class="clear">&nbsp;</div>', '', 0, 1, 0, 1, null, '4', null, '', '', null, null, 0);
