INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:32', '2015-07-16 22:40:47', '2015-07-16 22:40:47', ' Rondeslottet 2+', 'helsport-rondeslottet-2', 319600, '0', null, 0, 3000, '<p><span>Rondeslottet 2+ er et selvst&aring;ende telt med inngang p&aring; hver kortside. dette gj&oslash;r teltet til et perfekt overnattingssted for to personer p&aring; tur over en lengre periode. Inngangene kan benyttes for gjennomlufting og gir god mulighet for &aring; skille bagasje og matlaging. kryssende stenger gj&oslash;r teltet s&aelig;rdeles vindstabilt og relativt rette vegger gj&oslash;r at man f&aring;r utnyttet arealet bedre, og komforten i teltet &oslash;ker.</span></p>
<p>&nbsp;</p>
<p><span>&nbsp; &bull;&nbsp;&nbsp; &nbsp;To oppbevaringslommer i innerteltet<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Fargekoder av stenger og stangkanaler<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Opphengspunkter i innerteltet for t&oslash;rkesnor eller lignende<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;To store innganger med hvert sitt fortelt<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Bardunfester som hindrer sammenfiltrede barduner<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Stor myggnetting i innerteltet gir gode ventilasjonsmuligheter<br> &nbsp;&nbsp; &nbsp;&bull;&nbsp;&nbsp; &nbsp;Godt med plugg- og barduneringspunkter<br> <br> Tilleggsutstyr: Footprints</span></p>
<p>&nbsp;</p>
<p><span>Stoff innertelt: Polyester<br> Stoff yttertelt: Helsport Rainguard&reg;, 4000 mm <br> Stoff bunn: Polyamide SI, 5000 mm <br> Stenger: Helsport Superpole&reg; FC (44 cm lengder)</span></p>', '', 0, 1, 0, 1, null, '4', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:32', '2015-07-16 22:40:47', '2015-07-16 22:40:47', ' Rondvassbu 3 Camp', 'helsport-rondvassbu-3-camp', 335600, '0', null, 0, 6000, '<p>&nbsp;<span style="color: #12143f; font-family: Arial; text-align: left;">Rondvassbu er et h&oslash;yt og romslig tunneltelt med stort bagasjerom, og sideinngang med myggnetting. Selv om dette er et romslig telt, er det lett - og godt egnet for de fleste type turer.</span></p>
<p>&nbsp;</p>
<p style="color: #12143f; font-family: Arial; text-align: left;">Noen detaljer p&aring; teltet: "skirt ventilation system", fargekoding p&aring; stenger/stangkanaler, unikt stangkanalsystem med egenutviklet stangkopp, Helsport Airflow II ventilasjonssystem, Helsport Rainguard yttertelt, Innertelt i Polyamid, bunn i Polyamid SI, Helsport Superpole stenger i 44cm lengder.</p>
<p style="color: #12143f; font-family: Arial; text-align: left;">&nbsp;</p>
<p style="color: #12143f; font-family: Arial; text-align: left;">Rondvassbu 3 Camp veier 3,9 kilo, pluggene 400 gram.</p>', '', 1, 1, 0, 1, null, '4', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:32', '2015-07-16 22:40:47', '2015-07-16 22:40:47', ' Spitsbergen 95 Sekkpakke', 'helsport-spitsbergen-95-sekkpakke', 388000, '0', null, 0, 8000, '<p>Spitsbergen er v&aring;r modell for ekstrembruk, den har funksjoner og kvalitet til &aring; v&aelig;re med p&aring; de mest utfordrende og krevende turene. Holdbarhet og stabilitet med mye vekt kommer er prioriterte egenskaper. Ingen kompromisser. Helsport LINK&reg;(pat.pend.) kommer p&aring; denne sekken i en robust utf&oslash;relse dimensjonert for de belastningene som kan forventes p&aring; de lengste turene. Konstruksjonen gir veldig god blodtilf&oslash;rsel til beina og unik bevegelighet i ulendt terreng. Med alle tenkelige muligheter tilgjengelig p&aring; ryggen, er du klar for &aring; forsvinne fra sivilisasjonen s&aring; lenge du m&aring;tte &oslash;nske. <br> <br>- Helsport LINK&reg; b&aelig;resystem <br>- H&oslash;ydejusterbart og avtagbart topplokk med to rom <br>- Topplokk kan brukes som belteveske <br>- H&oslash;y sn&oslash;l&aring;s <br>- Avtagbare sidelommer <br>- Front kan &aring;pnes helt eller delvis <br>- Bunnluke <br>- Lettilgjengelig grovlomme p&aring; fronten <br>- Rikelig med utvendige festepunkter <br>- L&oslash;se remmer for feste av utstyr medf&oslash;lger <br>- Teltfeste p&aring; bunnen som holder teltet borte fra baken <br>- "G&aring;lomme" p&aring; venstre side <br>- Flaskelomme p&aring; h&oslash;yre side <br>- Funksjonslomme med utstyrfeste p&aring; fronten <br>- Kompresjonsreimer <br>- Klargjort for drikkesystem <br>- Innvendige sorteringslommer <br>- Regntrekk medf&oslash;lger<br><br> <strong>Leveres i 3 forskjellige modeller:</strong><br> - 95l Small, Rygglengde 39-45cm, 3.6kg <br>- 95l Medium, Rygglengde 45-51cm, 3.8kg <br>- 110l Medium, Rygglengde 45-51cm, 3.9kg<br> <br> <strong>Du f&aring;r ogs&aring; med:</strong> <br>- Kjelesett <br>- Gassbrenner <br>- Tennst&aring;l <br>- Bestikk <br>- Lykt</p>', '', 5, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:33', '2015-07-16 22:40:47', '2015-07-16 22:40:47', ' Stordalen LT', 'helsport-stordalen-lt', 19920, '0', null, 0, 3000, '<p>Stordalen LT er en liten og lett sommer sovepose. Posen har&nbsp; fasongsydd hodehette, thermoguard 6000&reg; isolasjonsfyll og 1-layer isolasjonssystem.</p>
<p>Soveposen har en komfortemperatur p&aring; 0 grader, veier 1,3 kilo og er beregnet for personlengder opp til 190 cm</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:33', '2015-07-16 22:40:53', '2015-07-16 22:40:53', ' Sveabreen', 'helsport-sveabreen', 239919, '0', null, 0, 3000, '<p>V&aring;r letteste og mest kompakte dunpose, prim&aelig;rt beregnet for v&aring;r og sommer. Fylt med 400gr. g&aring;sedun. Tar sv&aelig;rt liten plass i sekken. En god hjelper p&aring; korte turer eller som back-up i sekken i tilfelle du f&aring;r bruk for sovepose. Sveabreen er ogs&aring; fin &aring; bruke for overnatting inne p&aring; hytter. Helsports tekniske dunkolleksjon har poser for alle typer temperaturforhold. Posene har tekniske detaljer som varmekrage, varmeklaff langs glidel&aring;sen og innvending lomme for sm&aring;ting. Passformen er kroppsn&aelig;r uten &aring; v&aelig;re trang og s&oslash;rger for et jevnt luftlag rundt kroppen. Ingen syntetisk fiber kan m&aring;le seg med isoleringsevnen til dun. Helsports dunsoveposer benytter en h&oslash;ykvalitets g&aring;sedun, med en blanding av 90/10 (dun/sm&aring;fj&aelig;r) og fill power 700. Dette gir meget god spenst og god evne til gjenvinning av form etter komprimering. Ytterstoffet er vannavvisende og beskytter posen mot underlaget mens innerstoffet har gode pustende egenskaper. V&aring;re PRO dunsoveposer er lette, kompakte og prim&aelig;rt beregnet for v&aring;r, sommer og h&oslash;st. X-TR <br> <br>Helsport Komfort : -4&ordm;C <br>T- Lim: 0&ordm;C <br>T-Comf: 5&deg;C <br>T-Ext: -15&deg;C <br>T-Max: 18&deg;C <br>Vekt (+-10%): 0,95 kg <br>Fyllmateriale: 90/10 White Goose down Fill power 700 cuin/oz (400g) <br>Pose lengde/ bredde: 80x215 cm <br>Personlengde: 185cm <br>Glidel&aring;s lengde: 170cm <br>Volum i trekk komprimert (cm): <br>Kan kobles: Ja <br>Varmekrage: Nei <br>Farger: Deep Red/ Plum Red (V)</p>', '', 5, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:33', '2015-07-16 22:40:53', '2015-07-16 22:40:53', ' Trolleheimen Rød Venstre', 'helsport-trolleheimen-rd-venstre2', 151600, '0', null, 0, 1000, '<h2>Trollheimen er en ny, teknisk sovepose i Helsports pro segment.</h2>
<p>Den er designet for aktivt friluftsliv med vanntett stoff i fotenden, lettvekts <br>ytterstoff, varmekrage, putelomme og antiskli underside. P&aring; telttur er <br>det fort gjort at nederste del av soveposen havner utenfor madrassen <br>eller inntil en v&aring;t teltvegg. det vanntette stoffet beskytter da posen. Disse <br>detaljene gj&oslash;r posen til en ny favoritt p&aring; fjellet v&aring;r, sommer og h&oslash;st. <br>Trollheimen best&aring;r av to lag fiber. Kun det innerste fiberlaget er sydd til <br>innerforet, noe som gir god isolasjon og lavere varmetap. Trollheimen er <br>konstruert med bokskonstruksjon for optimal passform og isolasjonsevne.</p>
<p>&nbsp;</p>
<p>- Selvlysende drager og refleksdetaljer <br>- Innerlomme og putelomme <br>- Varmekrage <br>- Antiskli understoff <br>- Hettestrammer for rask lukking <br>- Vanntett stoff og refleksdetaljer i fotende <br>- Komfortabelt innerstoff i myk mikrofiber <br>- Solid ripstop i ytterstoff</p>
