INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:33', '2015-07-16 22:40:53', '2015-07-16 22:40:53', ' Valhall Yttertelt + Stang', 'helsport-valhall-yttertelt-stang', 796000, '0', null, 0, 10000, '<p>Valhall er et stort &rdquo;basecamp&rdquo; telt ideelt for grupper og lag, med full st&aring;h&oslash;yde i det meste av teltet. Som tilleggsutstyr kan man kj&oslash;pe ett eller to innertelt, samt hel bunn. Det er enkelt &aring; sette opp og en rekke ekstra pluggfester og barduneringspunkter gj&oslash;r at teltet st&aring;r godt ogs&aring; i sterk vind. Har 4 side&aring;pninger, hvorav 2 har netting og baldakinl&oslash;sning. I tillegg glidel&aring;s&aring;pning i hver ende av ytterteltet. 170 cm stenger for bruk til baldakin kj&oslash;pes i tillegg. Modellen har ogs&aring; egen &aring;pning i taket som gj&oslash;r de mulig &aring; bruke lavvu vedovn i teltet.<br> <br> <br> <strong>Funksjoner:</strong> <br> - Stor basecamp modell, ideelt for grupper og lag <br> - Stor takh&oslash;yde og mye plass innvendig <br> - 6 innganger, 2 med myggnetting <br> - Oppheng til 2 innertelt (avbildet, tilleggsutstyr) <br> - Kan brukes med Helsport vedovn. <br> - Helsport AirFlow&reg;II ventilasjonssystem &rdquo;skirt ventilation system&rdquo; <br> - Fargekoding av stenger/stangkanaler <br> - Unikt stangkanalsystem <br> - Egenutviklet stangkopp. <br> - Nytt bardunfeste. Bardunen kveiles opp og festes i strikken p&aring; en enkel og grei m&aring;te. <br> <br> <strong>Materialer:</strong> <br> - Helsport Rainguard&reg; yttertelt <br> - Innertelt i Polyamid, bunn i Polyamid SI <br> - Helsport Superpole&reg; stenger i 44cm ledd <br> <br> <strong>Spesifikasjoner:</strong><br> -Type telt: Tunneltelt<br> -Personer: 6-8<br> -M&aring;l pakket: 26x67cm <br> -Vekt telt (+/-10%): 9,5kg<br> -Vekt plugger: 0,5kg<br> -Antall innganger: 6<br> -Antall Bagasjerom: 2<br> -Stanglengde: 2x470 +2x540 +1x580cm <br> -Tilbeh&oslash;r: Rep Kit (+0,15kg)<br> <img src="http://www.helsport.no/no/produkter/TELT/Trek/images/Marketing/produkter/telt/vallhall/valhallVARIANT8.jpg" border="0" alt=""> <br> <a href="http://www.helsport.no/no/SERVICE/totalgaranti/" target="_blank"><img src="http://www.helsport.no/images/Marketing/Service/Helsport_quality_guarantee.png" border="0" alt=""></a></p>', '', 1, 1, 0, 1, null, '4', null, '', '', null, null, 0);
