<li>Oppheng til Helsport innertelt og bunnduk (tilleggsutstyr) &bull; Innvendig regulerbar topphatt.&nbsp;</li>
<li>2 stk innluftventiler med myggnetting</li>
<li>T&oslash;rkestativ.</li>
<li>Nytt bardunfeste. Bardunen kveiles opp og festes i strikken p&aring; en enkel og grei m&aring;te.</li>
<li>D&oslash;r&aring;pning har 2 glidel&aring;s med glidel&aring;sklaff.</li>
<li>Flammehemmende myggnetting i d&oslash;r og ventiler</li>
</ul>
</div>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
