INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:37:35', '2016-01-13 19:57:04', null, 'VX Elite Compression', 'vx-elite-compression', 159, '0', '', 50, 333, '<p>- Hightech kompresjonsstoff sammensatt av 80% polyamid og 20% invista lycra. Dette sikrer god styrke, utmerket stretch og suveren passform.</p>

