<p>Tightsen er normal i st&oslash;rrelse, vipper du mellom M og L er M rette st&oslash;rrelse.&nbsp;</p>

<p>&nbsp;</p>

<p>&nbsp;</p>
', '', 106, 1, 0, 1, null, '31', null, '', '', null, null, 0);
