<p><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">Nyhet! H&auml;rkila introduserer n&aring; en linje av gummist&oslash;vler basert p&aring; de samme prinsipper om kompromissl&oslash;s kvalitet som sine jaktst&oslash;vler. St&oslash;vlene er laget for &aring; klare alle jaktens utfordringer, og utmerker seg bl.a. ved sin fleksibilitet, ventilasjon, isolering, komfort og optimale st&oslash;tte for foten.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">H&auml;rkila Forester 17'''' Zip 3 mm H-Vent har overdel i vulkanisert naturgummi som er 100% vanntett. Det er satt inn en flex-fit kile med spenne i skaftet, noe som gj&oslash;r st&oslash;velen meget enkel &aring; ta av og p&aring;, og hindrer at det trenger vann og fukt inn i st&oslash;velen. Bak p&aring; ytters&aring;len er det en st&oslash;pt ''kicker''-kant som gj&oslash;r det enkelt &aring; ta av st&oslash;vlene. Midt under s&aring;len er det en 90 graders kant som gir bedre grep p&aring; stiger og ujevne overflater. Testet til bruk i -10 grader C i aktivitet.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">F&ocirc;r: St&oslash;velen er f&ocirc;ret med H&auml;rkila H-vent med 3 mm neoprene, et ventilerende f&ocirc;r som sikrer at fukten som oppst&aring;r blir ledet bort, s&aring; st&oslash;velen forblir t&oslash;rr. Liningen avsluttes p&aring; st&oslash;velens kant med et perforert kantb&aring;nd i l&aelig;r, s&aring; den fuktige luften fra st&oslash;velen kan transporteres bort.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">Ytters&aring;le: Vibram H&auml;rkila Hound Icetrek - Utviklet i samarbeid med Vibram, Icetrek-gummiblandingen sikrer godt veigrep selv i ekstrem kulde. Det er lagt inn en glassfibersvang for stivhet og stabilitet.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">H&aelig;linnlegg: St&oslash;tabsorberende og stabiliserende H&auml;rkila power-bridge.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">Melloms&aring;le: Isolerende filts&aring;le.</span></p>
<p><span style="font-family: arial, helvetica, sans-serif; font-size: 13px;">Inners&aring;le: Todelt - Ortholite Adjuster og Ortholite inners&aring;le. Adjusteren &oslash;ker komforten og isolerer, men kan tas ut dersom man &oslash;nsker mer plass til &aring; bruke en tykk sokk.</span></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
