<p>N&aring;r man er p&aring; jakt g&aring;r man gjerne i mange timer, blir varm og svetter, for s&aring; og sette seg ned igjen i flere timer.</p>
<p>&nbsp;</p>
<p>Merinoull er en ulltype som lagrer mere luft i forhold til sin vekt enn andre ulltyper. Merinoull br&aring;ker ikke og har en fabelaktig evne til &aring; absorbere fukt og svette der m&aring;tte oppst&aring; uten at man merker det p&aring; kroppen.</p>
<p>Merinoull er temperaturregulerende, hvilket vil si at den er suveren mht varme, og samtidig egenskapen til &aring; holde kroppen k&oslash;lig p&aring; varme dager.</p>
<p>Det kan maskinvaskes p&aring; 30 grader.</p>
</div>
<p>&nbsp;</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
