<p>&nbsp;<img src="../users/123friluft_mystore_no/Image/logoer_og_tegn/GORE-TEX_Logo.jpg" border="0" width="120" height="120"><img src="../users/123friluft_mystore_no/Image/logoer_og_tegn/Harkila_farge.png" border="0" width="289" height="120"></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
