INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:40:04', '2015-07-16 22:33:35', '2015-07-16 22:33:35', ' Pro Hunter Dog Keeper Light Cap', 'hrkila-pro-hunter-dog-keeper-light-cap', 54320, '0', null, 0, 600, '<p>En av de mest avanserte capser p&aring; markedet. Den har Gore-Tex membran, er foret med Primaloft, har avtagbare nakkeslag, og i bremmen har den en lett, men kraftig diode som s&oslash;rger for masser av lys. Camouflage i Mossy Oak.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:40:04', '2015-07-16 22:33:39', '2015-07-16 22:33:39', ' Pro Hunter GTX 10" ', 'hrkila-pro-hunter-gtx-102', 199920, '0', null, 0, 1000, '<p><span style="font-size: 12px;"><strong><span style="font-family: Arial;">H&auml;rkila Pro Hunter er en jaktst&oslash;vel i toppklasse - den ultimate st&oslash;velen til jegeren som vil ha de beste materialer og masse komfort og beskyttelse. St&oslash;vlene har Vibrams beste ytters&aring;ler og optimal st&oslash;tdemping med H&auml;rkila SUPO melloms&aring;le. 100% vanntett og pustende med Gore-Tex og 25 cm h&oslash;yt skaft. Nubuckl&aelig;r og med kraftig gummikappe rundt hele st&oslash;velen. Den sorte fargen gj&oslash;r st&oslash;vlene ogs&aring; egnet til uniformsbruk.</span></strong></span></p>
<p><br style="font-family: Arial; font-size: 11px;"><span style="font-family: Arial; font-size: 12px;">Ytters&aring;le: Vibram Fire&amp;Ice - Bedre grep i kaldt v&aelig;r, oljeresistent og slitesterk. Ved hjelp av en spesiell gummiblanding sikres optimalt veigrep selv ved ekstremt kalde temperaturer og h&oslash;y varme (-20&deg;C til +250&deg;C). Gummiblandingen oppfyller s&aring; strenge krav som Ross cold flex ved -23&deg;C og NFPAs krav til brannmannsst&oslash;vler. Fire&amp;Ice kan brukes til all slags utend&oslash;rsaktiviteter hvor det kreves optimalt veigrep selv under ekstrem kulde.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: Arial; font-size: 12px;">Melloms&aring;le: H&auml;rkila SUPO - Formst&oslash;pt EVA melloms&aring;le med ekstra stabilitet p&aring; yttersiden av fremfoten (supinasjonskontroll) og innersiden av h&aelig;len (pronasjonskontroll).</span><br style="font-family: Arial; font-size: 11px;"><span style="font-family: Arial; font-size: 12px;">Inners&aring;le: H&auml;rkila footbed - Sikrer optimal passform og korrekt fotstilling. St&oslash;tabsorberende gel&eacute;puter i h&aelig;l og fremfot, samt ekstra stabilitet i h&aelig;l og svang.</span><br style="font-family: Arial; font-size: 11px;"><br style="font-family: Arial; font-size: 11px;"><span style="font-family: Arial; font-size: 12px;">Overdel: Nubuck-l&aelig;r, H&auml;rkila Memory Fit - Sikrer at h&aelig;len sitter fast uansett str&oslash;mpetykkelse og &oslash;ker din komfort.</span></p>
<p><span style="font-size: 12px;">F&ocirc;r: Gore-Tex Performance Comfort - Anbefales til jakt hele &aring;ret rundt i all slags v&aelig;r. Som utgangspunkt fungerer Gore-Tex&reg; Performance Comfort-membranen til all slags v&aelig;r. Du kan justere isolasjonen ved hjelp av tykkere sokker, men er det meget kaldt kan du med stor fordel bruke H&auml;rkila-st&oslash;vler med Gore-Tex&reg; Insulated Comfort. turst&oslash;vel</span></p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
