<p><span style="font-size: 13px;">H&auml;rkilas velkjente og meget lette skallsett med GORE-TEX -membran har i mange &aring;r v&aelig;rt meget popul&aelig;re, fordi de har gitt fantastisk god beskyttelse mot v&aelig;r og vind, samtidig som det er lette og pustende dresser.</span>&nbsp;</p>
