INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:41:28', '2015-12-17 09:55:14', '2015-12-17 09:55:14', 'H-6', 'hodelykt-h6', 399, '0', '', 0, 800, '<p>Hodelykten har en supersterk LED diode og inntil 160lumens lysstyrke - Ypperlig til jakt, fiske, treningsturer,i skil&oslash;ypa og fjellturer i m&oslash;rket.<br />
<br />
Hodelykten kommer med aluminiums lampehus og er vannavst&oslash;tende. O-ring ved gjenger gj&oslash;r at modellen t&aring;ler mer fuktighet, gj&oslash;rme og vanns&oslash;l. Dette gj&oslash;r at modellen er egnet for h&oslash;ststormer, sn&oslash;v&aelig;r og annet uforutsigbart v&aelig;r du kan m&oslash;te p&aring; i fjellet.<br />
Hodelykten har en LED-diode, noe som avgir inntil 160 lumens. Lampehuset kan vinkles opp og ned 90 grader, slik at du kan rette lyset mot skisporet eller hva annet du m&aring;tte &oslash;nske.<br />
Hodelykten har tre lysniv&aring;; H&oslash;y, medium, blinkende i tillegg til zoom inn og ut. 3 justerbare stropper (rundt hodet og over hodet) gir maksimal komfort og passform. Hodelykten har pga. LED dioder lengre holdbarhet.<br />
Ved &aring; bruke LED dioder gir dette et lavere batteriforbruk. Levetiden p&aring; LED diodene er p&aring; inntil 100000 timer!<br />
I tillegg er LED dioder bedre rustet for st&oslash;t, vibrasjoner og temperaturforandringer. Hodelykten b&oslash;r ikke rettes direkte i &oslash;ynene p&aring; folk da lysstr&aring;len er s&aring;pass sterk at det er ubehagelig og i verste fall kan skade synet.<br />
Hodelykten anbefales til jakt, fiske, ridning, l&oslash;ping, langrenn eller annen vinteridrett.<br />
Kan ogs&aring; benyttes til andre bruksomr&aring;der.<br />
<br />
<br />
