Vannavst&oslash;tende niv&aring;: IPX3<br />
Materiale: CNC ALuminium, ABS plastikk<br />
Linse: Lyskjegle<br />
Lyslengde: opptil 150 meter ved minimal lysabsorbering<br />
Brukstid: 2,5t v/ lysniv&aring; h&oslash;y, 8t v/ lysniv&aring; lav Lysstyrke: 140 lumens<br />
Lampetype: LED CREE<br />
Antall modus: 3 Lysniv&aring;<br />
Batteri: 3 x AAA (ikke inkludert) eller oppladbart 18650 batteri.</p>
