<br>
<br>
Classicfamiljen har fått tillökning.
<br>
Vi hälsar modellerna 46 och 58 välkomna.
<br>
Små, läckra och minst lika stilrena som sina syskon. Under den klassiska och stilrena ytan vilar en robust konstruktion med den ultramoderna Power Matrixbromsen. Det helt vattentäta bromssystemet hanterar de tuffaste fiskarna under de hårdaste förhållandena.
<br>
Rullarna har också en ljudlig knarr som signalerar fast fisk genom dina hörselgångar och ut i varenda nervbana. Fiske för alla sinnen.
<br>
<br>
 

Classicrullen är helt rostfri och har ett ergonomiskt vevhandtag med en smart tafshållare på balansvikten. Du kan välja mellan vänster- och högervevad modell. Oavsett vilken Classic Rulle du väljer så får du ett numrerat exemplar levererad i ett handtillverkat läderetui. Sofistikerad och klassisk design med avancerade tekniska lösningar.
