Sedan många år har jag blivit ombedd att designa egna flugspön. Här ser du resultatet Signatureserien, tillverkade i samma fiber och med samma teknik som Optiserien. Spöna har en något djupare aktion som arbetar genom hela handtaget vid full belastning, tillsammans med ett kort slag som tillåter tidiga stopp.
Spöna är lättkastade och passar alla flugfiskare, men ger dig som är en tekniskt duktig kastare en ökad vinklingsförmåga  utan att du förlorar kraft under framkastet. Att fiska med Signatureseriens spön är som poesi för både kropp och själ. Du känner hur spöt nästan talar till dig,sen är det bara att hänga med.<br>//Göran Andersson, Designer<br>
<br><b>Detaljer:</b>
<br>- Märkning på holkarna markerar rätt montering av spödelarna.
