<br>- Rekommenderad linvikt på spöt.
<br>- Trekantigt rullfäste med fast låsring håller rullen på plats.
<br>- Stryktåliga tvåbenta snakeringar av dubbellegering.
<br>- Valfria balansvikter till enhandsspön lina #7 och tyngre', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
