INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:42:02', '2015-07-16 22:37:23', '2015-07-16 22:37:23', 'Loop Multi', 'loop-multi', 159200, '0', null, 0, 700, 'Våra rullar sticker ut. Det har de alltid gjort. Både design och kvalitet har varit vårt adelsmärke. Inte undra på att vi blivit kopierade under åren. Så när vi satte igång utvecklingen av en ny serie rullar var det med tuffa krav och höga ambitioner.<br>br>
 
Rullarna skulle ha en vattentät Loop Power Matrix Broms och ett yttre som får ögonen att tindra på den mest förhärdade flugfiskare. Dessutom skulle de ha ett överkomligt pris. Vi tycker att vi lyckades riktigt bra.
 <br><br>
Loop Multi är byggd för att räcka en livstid. Ändå är den prissatt så att de flesta flugfiskare kan bära vårt namn. Vi är uppriktigt stolta över våra nya rullar.<br><br>
<b>Detaljer:</b><br>
Precis som vår Optiserie är handtaget placerat närmare spolens centrum. Du får snabbare invevning och mer plats när du vill handbromsa.<br>
Motvikt med tafshållare.<br>
Bromsreglaget är utformat så att du inte fastnar med linan i kastet.<br>
Spolen har en V-design som gör linuppläggningen optimal.<br>
Konformade gummihandtag ger dig rätta greppet, men låter linan halka av.<br>
Robust design. Den här rullen är en arbetshäst du kan lita på.<br>
Designad i Sverige.<br>
Viktigaste delarna i bromspaketet är tillverkade i Sverige.<br>
Tre storlekar: 3/6, 6/9 och 9/12', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:42:02', '2015-07-16 22:37:23', '2015-07-16 22:37:23', 'Loop Nano Cross S1 Enhånds', 'loop-nano-cross-s1-enhands', 519200, '0', null, 0, 3000, 'Den nye serien med Loop Cross S1 fluestenger er det aller viktigste og mest revolusjonerende som har skjedd innen fluefiske siden Loop introduserte large arbor-snellene for over 20 år siden.
<br>
<br> 
Hvis du er enig at large arbor-snellene ga en revolusjonerende funksjon når den kom på markedet, så er vi sikker på at du kommer til å kjenne den samme forskjellen når du tester den nye stangserien Cross S1. Det kunne vært skrevet en hel bok om hvordan disse stengene ble til, men den beste måten å beskrive det på er å føle det. Prøv den!
<br>
<br>
