Opti Coast bemästrar snyggt och prydligt tuffa förhållanden längs kust och på öppna vatten. Spöt har en distinkt aktion med korta slag, som tillåter hög linhastighet och generar den smala och obrutna linbåge som är nödvändig för att låta linan färdas genom vind.Båda modellerna har vårt patenterade X-Grip handtag och klingor tillverkade med vpr cross-weave teknik.
