Efter att ha testat prov efter prov i ett års tid introducerar vi nu de nya Opti Power Spey 14'' #9 och 15'' #10 spöna. Dessa spö fungerar lika bra med korta klumpar (typiska för underhands- och skagitkast) eller längre speylinor. Återhämtningen i toppen är extremt precis plus att kraften i butten tar aldrig slut.
