<p>Prisen inkluderer 4gb minnekort!</p>
<p style="margin: 0px; padding: 0px; color: #7c7c7c; font-family: Verdana, Geneva, sans-serif; line-height: 15px; text-align: left;"><span style="color: #000000;">Med 12MP bildeoppl&oslash;sning og 1440x1080 video i HD kvalitet og med lyd, er dette et av de beste viltkameraene p&aring; markedet!</span></p>
<p style="margin: 0px; padding: 0px; color: #7c7c7c; font-family: Verdana, Geneva, sans-serif; line-height: 15px; text-align: left;">&nbsp;</p>
<div style="margin: 0px 10px; padding: 0px; color: #7c7c7c; font-family: Verdana, Geneva, sans-serif; line-height: 15px; text-align: left;" class="productGeneral biggerText">
<p style="margin: 0px; padding: 0px;"><span style="color: #000000;"><strong style="margin: 0px; padding: 0px;">Detaljer:</strong><br style="margin: 0px; padding: 0px;"> - 5M/12M/2M pixel h&oslash;ykvalitets oppl&oslash;sning<br style="margin: 0px; padding: 0px;"> - 1440 x 1080/1280 x 720 / 640x480 H.264/AVC format HD-video med lyd<br style="margin: 0px; padding: 0px;"> - Cam + Video-modus gj&oslash;r at kameraet kan ta b&aring;de bilde og video hver trigger<br style="margin: 0px; padding: 0px;"> - Serieopptak intervall 0,5-1,0 sekunder&nbsp;<br style="margin: 0px; padding: 0px;"> - Lang batteritid (i standby modus, opptil 6 m&aring;neder med 12 x AA batterier)<br style="margin: 0px; padding: 0px;"> - Unik side sensor design gir bredere deteksjonsvinkel og forbedrer kameraets respons hastighet<br style="margin: 0px; padding: 0px;"> - Fungerer i de mest ekstreme temperaturer fra -22 &deg;F (-30 &deg;C) til 158 &deg;F (70 &deg;C)<br style="margin: 0px; padding: 0px;"> - Kompakt st&oslash;rrelse (5 &oelig; x 3 &oelig; x 3 inches).&nbsp;<br style="margin: 0px; padding: 0px;"> - Imponerende rask trigger tid (1,2 sekund)<br style="margin: 0px; padding: 0px;"> - Programmerbar til &aring; jobbe som Time-lapse-kamera &aring; ta bilder / videoer i lang rekkevidde dag og natt<br style="margin: 0px; padding: 0px;"> - N&aring;r Timerinnstilling p&aring;, programmerbar for &aring; bare jobbe i angitt periode<br style="margin: 0px; padding: 0px;"> - Flip-down 2,0 "TFT fargeskjerm &aring; gjennomg&aring; bilder og videoer<br style="margin: 0px; padding: 0px;"> - Dato, tid, temperatur, m&aring;nefase og batteri niv&aring; kan v&aelig;re stemplet p&aring; bilde<br style="margin: 0px; padding: 0px;"> - L&aring;sbar og passordbeskyttet<br> - SD-kort kan settes i "Cykling store"-modus, som automatisk sletter de tidligste bildene eller videoene og gj&oslash;r plass til nye.</span></p>
<p style="margin: 0px; padding: 0px;">&nbsp;</p>
<p style="margin: 0px; padding: 0px;"><span style="color: #000000;"><strong style="margin: 0px; padding: 0px;">Spesifikasjoner:</strong><br style="margin: 0px; padding: 0px;"> - Image Sensor: 5 megapiksler Color CMOS<br style="margin: 0px; padding: 0px;"> - Max. Pixel St&oslash;rrelse: 2560x1920<br style="margin: 0px; padding: 0px;"> - Linse: F = 3,1; FOV = 52 &deg;; Auto IR-Cut<br style="margin: 0px; padding: 0px;"> - IR Blitz: 18m<br style="margin: 0px; padding: 0px;"> - LCD skjerm: 48x35.69mm (2,36 "); 480 (RGB) * 234DOT; 16.7M farger<br style="margin: 0px; padding: 0px;"> - Minne: SD-kort (8MB ~ 32GB)<br style="margin: 0px; padding: 0px;"> - Bildest&oslash;rrelse: 5MP/12MP/2MP = 2560X1920/4000X3000/1600X1200<br style="margin: 0px; padding: 0px;"> - Video St&oslash;rrelse: 1440x1080: 15 fps, 1820x720: 30bps, 640x480: 30 bps<br style="margin: 0px; padding: 0px;"> - PIR F&oslash;lsomhet: H&oslash;y / Normal / Lav<br style="margin: 0px; padding: 0px;"> - PIR F&oslash;leavstand: 82ft/25m (under 77 &deg;C/25 &deg;C ved normal niv&aring;)<br style="margin: 0px; padding: 0px;"> - Prep PIR Deteksjonsvinkel: Venstre og h&oslash;yre lysstr&aring;ler danner en vinkel p&aring; 100 grader, dekker hver linse 10&deg;<br style="margin: 0px; padding: 0px;"> - Hoved PIR Deteksjonsvinkel: 35 &deg;<br style="margin: 0px; padding: 0px;"> - Operation Mode: Dag / Natt<br style="margin: 0px; padding: 0px;"> - Trigger Tid: 1.2/sec (ved bruk av 2GB SD-kort)<br style="margin: 0px; padding: 0px;"> - Trigger Intervall: 0sec - 60min; programmerbar<br style="margin: 0px; padding: 0px;"> - Serie innstilling: 1 - 3 bilder<br style="margin: 0px; padding: 0px;"> - Video Lengde: 1-60sec, programmerbar.<br style="margin: 0px; padding: 0px;"> - Avspilling Zoom inn: 1-16 ganger<br style="margin: 0px; padding: 0px;"> - Time Stamp: On / Off, inkluderer serienummer, temp.. og m&aring;nefase<br style="margin: 0px; padding: 0px;"> - Timer: On / Off, programmerbar<br style="margin: 0px; padding: 0px;"> - Time Lapse: On / Off, 1sek-24 timer, programmerbar<br style="margin: 0px; padding: 0px;"> - Str&oslash;mforsyning: 4xAA, utvidbart til 8xAA<br style="margin: 0px; padding: 0px;"> - Ekstern DC str&oslash;mforsyning: Plug Size - 4.0x.17; 6 ~ 12V (1 ~ 2A)<br style="margin: 0px; padding: 0px;"> - Stand-by forbruk: 0.4mA<br style="margin: 0px; padding: 0px;"> - Stand-by tid: 3-6 m&aring;neder (4xAA ~ 8xAA)<br style="margin: 0px; padding: 0px;"> - Str&oslash;mforbruk: 150mA (350 mA n&aring;r IR LED lyser)<br style="margin: 0px; padding: 0px;"> - Svakt batteri Alert: 4.2 ~ 4.3V<br style="margin: 0px; padding: 0px;"> - Grensesnitt: TV-utgang (PAL), USB, SD-kortspor 6V DC ekstern<br style="margin: 0px; padding: 0px;"> - Montering: Reim; stativ/ festebrakett<br style="margin: 0px; padding: 0px;"> - Vanntett: IP54<br style="margin: 0px; padding: 0px;"> - Driftstemperatur: ~ 22 ~ 158 &deg;F/-30 ~ 70 &deg;C<br style="margin: 0px; padding: 0px;"> - Drift Fuktighet: 5% ~ 95%<br style="margin: 0px; padding: 0px;"> - Sertifikat: FCC &amp; CE &amp; ROHS</span></p>
