er direkte p&aring; den innebygde - - TFT skjermen<br style="margin: 0px; padding: 0px;"> - Kan endre flere spr&aring;k p&aring; menyen gjennom &aring; sette landet i MMS-menyen eller i PC Setup<br style="margin: 0px; padding: 0px;"> - SD-kort kan settes i "Cykling store"-modus, som automatisk sletter de tidligste bildene eller videoene og gj&oslash;r plass til nye<br style="margin: 0px; padding: 0px;"> - Tekst varslel n&aring;r batteriniv&aring;et blir lavt<br style="margin: 0px; padding: 0px;"> - Sjekk mobilnettets signalmottak p&aring; den innebygde TFT-skjermen&nbsp;<br style="margin: 0px; padding: 0px;"> - Intern antenne design, ekstern antenne er tilgjengelig n&aring;r du bruker sikkerhet boks<br style="margin: 0px; padding: 0px;"> - Opererer globalt via GSM / GPRS-nettverk. St&oslash;tter fire band: 850/900/1800 / 1900MHz</span></p>
