me Lapse: On / Off, 1sek-24 timer, programmerbar<br style="margin: 0px; padding: 0px;"> - Str&oslash;mforsyning: 4xAA, utvidbart til 8xAA<br style="margin: 0px; padding: 0px;"> - Ekstern DC str&oslash;mforsyning: Plug Size - 4.0x.17; 6 ~ 12V (1 ~ 2A)<br style="margin: 0px; padding: 0px;"> - Stand-by forbruk: 0.4mA<br style="margin: 0px; padding: 0px;"> - Stand-by tid: 3-6 m&aring;neder (4xAA ~ 8xAA)<br style="margin: 0px; padding: 0px;"> - Str&oslash;mforbruk: 150mA (350 mA n&aring;r IR LED lyser)<br style="margin: 0px; padding: 0px;"> - Svakt batteri Alert: 4.2 ~ 4.3V<br style="margin: 0px; padding: 0px;"> - Grensesnitt: TV-utgang (PAL), USB, SD-kortspor 6V DC ekstern<br style="margin: 0px; padding: 0px;"> - Montering: Reim; stativ/ festebrakett<br style="margin: 0px; padding: 0px;"> - Vanntett: IP54<br style="margin: 0px; padding: 0px;"> - Driftstemperatur: ~ 22 ~ 158 &deg;F/-30 ~ 70 &deg;C<br style="margin: 0px; padding: 0px;"> - Drift Fuktighet: 5% ~ 95%<br style="margin: 0px; padding: 0px;"> - Sertifikat: FCC &amp; CE &amp; ROHS</span></p>
