INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:42:42', '2015-07-16 22:55:35', '2015-07-16 22:55:35', 'Northwave Scorpius SRS Sykkelsko', 'northwave-scorpius-sykkelsko5', 95920, '0', null, 0, 2000, '<p class="p1"><span style="font-size: 13px;">Skoen er tiln&aelig;rmet normal i st&oslash;rrelsen.</span></p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial;"><span style="font-size: 13px;">Kanonsko for herrer, proppet med tekniske egenskaper som ikke forventes til denne prisen. Italiensk kvalitet p&aring; sitt aller beste! Skoen er utviklet i samabeid med proffsyklister.</span><br><br><span style="font-size: 13px;">Dette er en helt ny generasjon sykkelsko, hvor overdelen har minimalt med s&oslash;mmer og asymmetriske borrel&aring;sspenner. Dette gj&oslash;r at skoen er lett, luftig og meget komfortabel, med minimalt med klempunkter.</span></p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial; min-height: 15px;">&nbsp;</p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial;"><span style="font-size: 13px;">Skoen har forsterkninger p&aring; utsatte steder og strammes med en spenne som enkelt kan tilpasses b&aring;de h&oslash;ye og lave vrister. Spennen kan byttes. Videre har skoen har integrert h&aelig;lkappe, som gj&oslash;r at skoen ikke glipper i h&aelig;len.&nbsp;</span></p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial; min-height: 15px;">&nbsp;</p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial;"><span style="font-size: 13px;">Scorpius SRS har karbonforsterket s&aring;le for best mulig kraftoverf&oslash;ring, og underdel i r&aring;gummi. Skruknotter for best mulig grep.</span></p>
<p style="margin: 0px; color: #515151; line-height: 18px; font-size: 13px; font-family: Arial; min-height: 15px;"><br><span style="font-size: 13px;"><strong>Egenskaper:</strong></span><br><br><span style="font-size: 13px;">- Moderne teknologi</span><br><span style="font-size: 13px;">- Italiensk design og kvalitet</span><br><span style="font-size: 13px;">- Assymetrisk, bred lukking og f&aring; s&oslash;mmer</span><br><span style="font-size: 13px;">- Lett, luftig og komfortabel</span><br><span style="font-size: 13px;">- Forsterket p&aring; utsatte steder</span><br><span style="font-size: 13px;">- Lett &aring; tilpasse</span><br><span style="font-size: 13px;">- Utskiftbar spenne</span><br><span style="font-size: 13px;">- Karbonforsterket s&aring;le</span><br><span style="font-size: 13px;">- R&aring;gummi ytters&aring;le, med skruknotter for best grep</span><br><br><span style="font-size: 13px;"><strong>Spesifikasjoner:</strong></span><br><br><span style="font-size: 13px;">- Overdel: Ultralett PU</span><br><span style="font-size: 13px;">- Ytters&aring;le: Jaws karbonforsterket s&aring;le av termoplastisk materiale. Naturgummi ytterlag for best mulig grep og lavere vekt</span><br><span style="font-size: 13px;">- Ventilasjon: Airflow</span><br><span style="font-size: 13px;">- Lukking: SRS (Slim Ratchet System). Presis, aluminiumsforsterket lukking og 2&nbsp;assymetriske borrel&aring;ser</span><br><span style="font-size: 13px;">- H&aelig;lkappe: Integrert h&aelig;lstrammesystem gir bedre passform med lavere vekt</span><br><span style="font-size: 13px;">- Fotseng: Ergonomisk design som holder godt p&aring; foten</span><br><span style="font-size: 13px;">- Teknologi: Termost&oslash;pt, flerlags forsterket PU. Gir rom for tynnere og lettere materialer nesten helt uten s&oslash;mmer</span><br><span style="font-size: 13px;">- Vekt: 373 gram</span><br><br></p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
