INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:42:43', '2016-05-20 14:05:44', null, ' Large Dobbel', 'odin-hundebur-large-dobbel', 1999, 'BDD-01', '13-1', 750, 22000, '<p>Solid og sikkert transportbur i moderne design.</p>

<p>Rammen p&aring; dette buret er laget i ellipse-formet aluminium, noe som gir et mer robust og sikkert bur. Kombinert med tettsittende hardplastledd er dette buret ogs&aring; veldig stille, noe som bidrar til at kj&aelig;ledyret ditt f&oslash;ler seg rolig og trygg.</p>

<p>Panelene er laget i melaminbelagt MDF. Dette gir en mer ripebestanding overflate som er lett &aring; holde ren. Rengj&oslash;res enkelt med en fuktig klut.</p>

<p>Det er god avstand mellom stolpene, s&aring; man er sikret optimal ventilasjon og godt ut/innsyn.</p>

<p>Dette buret har skr&aring; bakside, som gj&oslash;r det enklere &aring; plassere buret i en hvilken som helst bil. Det er forholdsvis lett i vekt ift st&oslash;rrelsen, og er derfor enkelt &aring; ta ut og inn dersom man ikke &oslash;nsker &aring; ha det i bilen permanent.</p>

<p>Skilleveggen i buret er avtagbar.</p>

<ul>
	<li>St&oslash;rrelse bunn:Dybde=87cm Bredde=97cm</li>
	<li>St&oslash;rrelse topp:Dybde=55 Bredde=97cm.</li>
</ul>
