INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:43:17', '2015-07-16 22:56:52', '2015-07-16 22:56:52', 'Power Taper  Triple D- Sink1/Sink3/Sink5', 'power-taper-triple-d-sink1sink3sink5', 54320, '0', null, 0, 250, '<table style="width: 100%;">
<tbody
<body>
                     <div style="text-align: center;">
                        <table class="image-box">

                           <tr>
             
                           </tr>
                        </table> 
                        <div class="left-aligned"><b>Vi</b> er stolte over å kunne presentere neste generasjon Power Taper, TRIPLE-D. Et synkeline-konsept med avanserte taperinger
                           og densiteter, som vi er helt sikre på vil gi deg en fiske- og kasteopplevelse du ikke har erfart tidligere. Ideen til disse
                           snørene kommer i fra Rune Marthinsen. Rune har jobbet systematisk med disse i 2 år og har laget alle prototypene for hånd,
                           akkurat som han pleier. Resultatet av mange timer på klipperommet og i elva kan vi glede oss over nå. Vi har med disse snørene
                           utfordret våre snøreprodusenter maksimalt mht. teknologi og kunnskap. Resultatet er nye skyteklumper som tar synkelinefisket
                           til en helt ny dimensjon. Det revolusjonerende ligger i kombinasjonen av tre ulike densiteter (synkegrader) fordelt g jennom
                           hele snøret, med optimale overganger og taperinger mellom de ulike synkegradene. Dette, sammen med vektfordelingen i snøret
                           sørger for perfekt balanse i snørebukten under kasting og gir en bedre kontroll over linen, både i lufta og<br/>i vannet.<br/><strong><br/></strong></div>
                     </div>
                     <p> </p>
                     <table class="user-table" style="width: 654px; height: 502px;">

                        <tbody>
                           <tr>
                              <td>
                                 <h2>
                                    <table class="image-box">
                                       <tr>
                                          <td><img src="http://www.guideline.no/filestore/powertaper/tripled/triple-d-densities.png?size=700x800" alt="" /></td>
                                       </tr>
                                    </table>

                                 </h2>
                              </td>
                              <td><span style="font-weight: bold;">FLYT/HOVER/INTERM.</span><br/> Snøret fisker høyt i vannet. Densiteten H/I som ligger i den fremre 2/3 av snøret vil fiske<br/> fluen under overflaten med en vanlig mono eller fluorocarbon fortom. Den flytende, bakre<br/> delen i snøret bidrar til å kontrollere farten på flua, og gjør det enklere å mende snøret under fisket. Det vil også være
                                 enklere å løfte snøret ut av vannet for neste kast i forhold til et snøre som ligger helt under overflaten. Tilgjengelig både
                                 i enhånds og tohånds versjon.<br/> <br/><span style="font-weight: bold;">FLYT/INT./SYNK2</span><br/>
                                 <p>F/I/2 dekker et meget viktig sjikt i vannet. Den går litt dypere enn Flyt/Hover/Intermediate og du har fremdeles den flytende
                                    bakenden som du kan styre både flua og snørehastigheten med. Snøret ble meget populært i løpet av 2011 sesongen.
                                 </p>

                              </td>
                           </tr>
                        </tbody>
                     </table>
                     <p> </p>
                     <table cellpadding="5" class="user-table" style="width: 653px; height: 305px;">
                        <tbody>
                           <tr>

                              <td><span style="font-weight: bold;">HOVER/SYNK1/SYNK3</span><br/> Snøret lar deg fiske flua litt dypere ned i vannlagene. Du har full kontroll over farten på flua gjennom den magiske svingen
                                 da laksen gjerne tar. Hemmeligheten ligger i den lettere Hover bakdelen i snøret. Suverent snøre når du skal fiske fluen på
                                 innsiden av strømmen, uten å oppleve bunnhugg når farten på vannet avtar idet fluen svinger inn foran fisken. Tilgjengelig<br/> både i enhånds og tohånds versjon.
                              </td>
                              <td><span style="font-weight: bold;">INTERMEDIATE/SYNK2/SYNK4</span><br/> Kanskje den mest allsidige av dem alle. Dette<br/> ble raskt en favoritt under testing, både pga.<br/> topp kaste- og fiskeegenskaper. Til tross for<br/> varierende dybde og strømhastighet, gir dette<br/> snøret deg følelsen av å fiske fluen i rett dybde<br/> og innen perfekt rekkevidde for fisken. Tilgjengelig både i enhånds og tohånds versjon.
                              </td>

                           </tr>
                           <tr>
                              <td style="width: 50%;"><span style="font-weight: bold;">SYNK1/SYNK3/SYNK5</span><br/> Et viktig snøre som fortjener fast plass i skyteklumpmappen. En allround synkeline som<br/> kan brukes i mange ulike situasjoner. Enten<br/> du vil få fluen litt dypere ned i raskt vann, eller<br/> fiske av en rolig og dyp høl. Dette snøret gjør jobben, og det har også vist seg å være suverent å kaste med, både med presisjon
                                 og lengde. Tilgjengelig både i enhånds og tohånds versjon.
                              </td>
                              <td><span style="font-weight: bold;">SYNK2/SYNK4/SYNK6</span><br/> For de dypeste hølene, hvor det er viktig å senke fluens hastighet, eller komme ned det lille ekstra. Fronten i snøret vil
                                 bringe fluen raskt ned til fisken, og pga. den unike konstruksjonen vil de bakre delene balansere snøret, og gjøre det lettere
                                 å håndtere, både under kastet, og ikke minst ved løft ut av vannet for neste kast. Pga. de ulike densitetene vil snøret synke
                                 med en brattere vinkel, med dette unngår vi at snøret lugger i bunnen under driftet.
                              </td>

                           </tr>
                           <tr>
                              <td colspan="1"><span style="font-weight: bold;">SYNK3/SYNK5/SYNK7</span><br/> Dette er hurtig-synk I likhet med snøret 2/4/6 synker dette med en god vinkel, og bringer fluen helt ned til de største
                                 og vanskeligste fiskene. I tillegg er snøret er suverent å kaste medpga. taperingen og balansen som ligger i de fremre S5/7
                                 delene. Dette er snøre produksjon på sitt beste, den tynne snørediameteren kombinert med høy densitet gjør at dette synker
                                 som en stein. Tilgjengelig bare i tohånds versjon.
                              </td>
                              <td colspan="1"> </td>
                           </tr>
                        </tbody>
                     </table>

                     <p> </p>
                     <h3><strong>STORE FORDELER</strong></h3>
                     <p>De nye taperingene gjør disse snørene ekstremt enkle å håndtere både ved overhodekasting og spey.<br/>Vektfordelingen gir en myk og kontrollert overrulling, både med vanlig monofortom, poly leader og uansett størrelse på flue.
                        Konsentrasjonen av vekt bak gjør snørene svært lettkastet. Stangen lades øyeblikkelig, også i situasjoner med dårlig plass
                        bak, og hvor snøret må legges ned foran med lite av D-loopen bak stanga.<br/><br/>Lengre front-tapering gir bedre energioverføring i snøret. Snøret trenger bedre gjennom motvind og synker raskere. Den nye
                        taperingen bidrar også til lengre kast og bedre kontroll under fisket. På TRIPLE-D anbefaler vi lettere vekter enn du ville
                        brukt på de tideligere Double Density Power Tapere. Årsaken er mer vekt og masse bak i snøret.<br/><br/><br/>
                     </p>
                     <table cellpadding="0" cellspacing="0" style="width: 100%;">
                        <tbody>

                           <tr>
                              <td>
                                 <h3><strong>EGENSKAPER</strong></h3><br/>  Forbedret balanse og sterkere energioverføring i snøret.<br/>  Lengre front og mye energi bak i klumpen gir lengre og mer kontrollerte kast.<br/>  Den velkjente POWER TAPER profilen er forbedret og videreutviklet, noe som gir en enda bedre lading av stanga under kastingen.<br/>  Betydelig forbedret og mer balansert overruling, både med mono- og polyfortommer.<br/>  TRIPLE-D snørene har vektfordelingen lengre bak, noe som gjør snørene lettere å løfte ut av vannet for neste kast.<br/>  TRIPLE-D konseptet gir bedre kontroll over fluen mht dybde og hastighet under fiske.<br/>  Snørene er merket med densitet og snøreklasse.<br/>  Fabrikk-monterte løkker i front for enkel montering av fortom.
                              </td>

                           </tr>
                        </tbody>
                     </table>
                     <p><br/><br/></p>
