                                 </h2>
                              </td>
                              <td><span style="font-weight: bold;">FLYT/HOVER/INTERM.</span><br/> Snøret fisker høyt i vannet. Densiteten H/I som ligger i den fremre 2/3 av snøret vil fiske<br/> fluen under overflaten med en vanlig mono eller fluorocarbon fortom. Den flytende, bakre<br/> delen i snøret bidrar til å kontrollere farten på flua, og gjør det enklere å mende snøret under fisket. Det vil også være
                                 enklere å løfte snøret ut av vannet for neste kast i forhold til et snøre som ligger helt under overflaten. Tilgjengelig både
                                 i enhånds og tohånds versjon.<br/> <br/><span style="font-weight: bold;">FLYT/INT./SYNK2</span><br/>
                                 <p>F/I/2 dekker et meget viktig sjikt i vannet. Den går litt dypere enn Flyt/Hover/Intermediate og du har fremdeles den flytende
                                    bakenden som du kan styre både flua og snørehastigheten med. Snøret ble meget populært i løpet av 2011 sesongen.
                                 </p>

                              </td>
                           </tr>
                        </tbody>
                     </table>
                     <p> </p>
                     <table cellpadding="5" class="user-table" style="width: 653px; height: 305px;">
                        <tbody>
                           <tr>

                              <td><span style="font-weight: bold;">HOVER/SYNK1/SYNK3</span><br/> Snøret lar deg fiske flua litt dypere ned i vannlagene. Du har full kontroll over farten på flua gjennom den magiske svingen
                                 da laksen gjerne tar. Hemmeligheten ligger i den lettere Hover bakdelen i snøret. Suverent snøre når du skal fiske fluen på
                                 innsiden av strømmen, uten å oppleve bunnhugg når farten på vannet avtar idet fluen svinger inn foran fisken. Tilgjengelig<br/> både i enhånds og tohånds versjon.
                              </td>
                              <td><span style="font-weight: bold;">INTERMEDIATE/SYNK2/SYNK4</span><br/> Kanskje den mest allsidige av dem alle. Dette<br/> ble raskt en favoritt under testing, både pga.<br/> topp kaste- og fiskeegenskaper. Til tross for<br/> varierende dybde og strømhastighet, gir dette<br/> snøret deg følelsen av å fiske fluen i rett dybde<br/> og innen perfekt rekkevidde for fisken. Tilgjengelig både i enhånds og tohånds versjon.
                              </td>

                           </tr>
                           <tr>
                              <td style="width: 50%;"><span style="font-weight: bold;">SYNK1/SYNK3/SYNK5</span><br/> Et viktig snøre som fortjener fast plass i skyteklumpmappen. En allround synkeline som<br/> kan brukes i mange ulike situasjoner. Enten<br/> du vil få fluen litt dypere ned i raskt vann, eller<br/> fiske av en rolig og dyp høl. Dette snøret gjør jobben, og det har også vist seg å være suverent å kaste med, både med presisjon
                                 og lengde. Tilgjengelig både i enhånds og tohånds versjon.
                              </td>
                              <td><span style="font-weight: bold;">SYNK2/SYNK4/SYNK6</span><br/> For de dypeste hølene, hvor det er viktig å senke fluens hastighet, eller komme ned det lille ekstra. Fronten i snøret vil
                                 bringe fluen raskt ned til fisken, og pga. den unike konstruksjonen vil de bakre delene balansere snøret, og gjøre det lettere
                                 å håndtere, både under kastet, og ikke minst ved løft ut av vannet for neste kast. Pga. de ulike densitetene vil snøret synke
                                 med en brattere vinkel, med dette unngår vi at snøret lugger i bunnen under driftet.
                              </td>

                           </tr>
                           <tr>
                              <td colspan="1"><span style="font-weight: bold;">SYNK3/SYNK5/SYNK7</span><br/> Dette er hurtig-synk I likhet med snøret 2/4/6 synker dette med en god vinkel, og bringer fluen helt ned til de største
                                 og vanskeligste fiskene. I tillegg er snøret er suverent å kaste medpga. taperingen og balansen som ligger i de fremre S5/7
                                 delene. Dette er snøre produksjon på sitt beste, den tynne snørediameteren kombinert med høy densitet gjør at dette synker
                                 som en stein. Tilgjengelig bare i tohånds versjon.
                              </td>
                              <td colspan="1"> </td>
