<p><span style="font-size: 14px;"><strong>Teknikk:</strong></span></p>
<p><span style="font-size: 14px;"><strong></strong>Imitasjonsfiske. Original Floater er en flytende allround-wobbler for all slags fiske - for kasting og for dorging, for fiske p&aring; dypet eller i overflaten. Kast Original over det punktet du tror fisken st&aring;r og la den ligge p&aring; overflaten et &oslash;yeblikk. N&aring;r du starter innsveivingen, dykker den ned til sitt naturlige fiskedyp og holder seg der mens du sveiver inn. Hvis du slutter &aring; sveive vil Original stige igjen. Slike variasjoner med innsveivingshastigheten vekker ofte hugg-instinktet hos fisk. Original Floater er ogs&aring; meget god i stilleflytende elv, ved at du kan la str&oslash;mmen f&oslash;re den til &oslash;nsket startpunkt for innsveiving. Ved fiske p&aring; grunne plasser med stor vegetasjon er det ogs&aring; lurt &aring; velge en Original fordi det er lett &aring; kontrollere arbeidsdybden. Det er mulig &aring; f&aring; Original til &aring; g&aring; dypere ved &aring; feste litt bly p&aring; sn&oslash;ret, men helst ikke n&aelig;rmere enn 50 cm fra wobbleren.</span></p>
