INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:43:30', '2015-07-16 22:58:46', '2015-07-16 22:58:46', 'Ridge Clear Delta', 'ridge-clear-delta', 39920, '0', null, 0, 250, 'Ridge Clear er som navnet sier helt transparente liner med de samme gode egenskapene som Ridge snørene har: Myke, lite minne og gode gli egenskaper. Hvilket gjør disse snørene meget interessante for både salt- og ferskvannsfiskeren. 
