INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:43:46', '2015-07-16 23:01:44', '2015-07-16 23:01:44', 'Scott G2 en-hånds', 'scott-g2-enhands', 479920, '0', null, 0, 3000, 'Denne medium aksjon stangen er som de selv kaller det "The ultimate fishing tool". G2 stengene slår over de lengste og letteste fortommene uten vanskeligheter og lar deg kontrollere drift i de mest krevende strømmer. Den frembringer den perfekte kombinasjonen av linehastighet og kontroll av dine bukter, samtidig som den også er presis. Når du kun har ett forsøk på å presentere flua for fisken, så skuffer deg den ikke. G2 er Scotts ypperste presentasjonsverktøy. (Ta kontakt om du vil kjøpe et helt sett e.l.)<br><br>

Hvis du fisker etter store og skeptiske ørret med små fluer, lange fortommer og lett utstyr, da har du funnet din nye fiskekompis.
G2 stengene slår over de lengste og letteste fortommene uten vanskeligheter og lar deg kontrollere drift i de mest krevende strømmer.
<br><br>

G2, Scotts ultimate presentasjonsverktøy.

<br><br>
<img src="http://www.scottflyrod.com/img/rod_icons/flex_medium.png" </img>', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
