<br />
Viltkamera baserer seg p&aring; kjent teknologi, og er i prinsippet et 8mpx viltkamera med GSM-teknologi for &aring; kunne sende MMS- bilder direkte til din mobiltelefon eller e-postkonto.&nbsp;<br />
Dette kameraet bruker ogs&aring; GPRS for &aring; sende til e-post&nbsp;<br />
<br />
Kameraet har en f&oslash;lsom PIR- detektor (opp til 20 m) som registrerer varmebevegelse innenfor kameraets rekkevidde. Kameraet kan stilles inn til &aring; ta 1-3 bilder eller en filmsekvens. Kameraet er i stand til &aring; ta bilder og video b&aring;de dag og natt, p&aring; grunn av et en stor og effektiv IR-blits som gir kameraet nattsyn. Kameraet kan ogs&aring; stilles inn til &aring; sende bilde via MMS til inntil 4 forskjellige mobiltelefoner og inntil fire e-postadresser.&nbsp;<br />
<br />
Kameraet har 6v DC tilkobling for drift med eksternt batteri og Norsk bruksanvisning kan lastes ned fra denne nettsiden.&nbsp;<br />
Dette kameraet, et digitalt viltkamera, er et overv&aring;kningskamera som jobber automatisk. Det utl&oslash;ses med en gang en bevegelse detekteres innenfor sektoren det er satt opp til &aring; dekke.&nbsp;<br />
Sektoren overv&aring;kes av en meget sensitiv passiv infrar&oslash;d bevegelses sensor&nbsp;<br />
(kalt PIR) og tar automatisk bilder i god kvalitet eller video-opptak alt etter hva det er programmert til.&nbsp;<br />
<br />
Det kan ta fargebilder og video n&aring;r det er dagslys eller gode lysforhold.&nbsp;<br />
P&aring; natten eller n&aring;r det er m&oslash;rkt tar kameraet klare bilder eller videoer i svart/hvitt ved hjelp av de infrar&oslash;de LED lysene.&nbsp;<br />
<br />
Det er vanntett og t&aring;ler sn&oslash; og kulde for utend&oslash;rs bruk. Det kan likevel v&aelig;re lurt &aring; dekke til det litt pga ekstern str&oslash;mkontakt p&aring; toppen. Kan komme inn vann der.</p>

