<br><br>Molino er naturligvis utstyrt med vindstoppermembran og gir således en perfekt kombinasjon av tilsløring og beskyttelse mot vind og vær.
<br><br>
Egenskaper:
<br>- Erase XT kamuflasje
<br>- Vendbar
<br>- To radiolommer
<br>- Sidelommer
<br>- Toveis glidelås i front
<br>- Stramming nede
<br>- Elastiske mansjetter
<br>- Seetex WindBeater', '', 1, 1, 0, 1, null, '', null, '', '', null, null, 0);
