INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:45:36', '2015-07-16 22:59:53', '2015-07-16 22:59:53', 'Selected CDC 1 Gram', 'selected-cdc-1-gram', 7920, '0', null, 0, 0, 'Meget fine fjær av medium størrelse (3-5cm), dette er den beste størrelsen hvis du skal ha fjær til ørretfluer. Fjærene er håndplukkede og sortert en og en, posen inneholder utelukkende flotte fjær.
<br>
