INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:45:36', '2015-07-16 22:59:53', '2015-07-16 22:59:53', 'SF Blend', 'sf-blend', 4720, '0', null, 0, 0, '<p>SF Blend er blanding av de to mest popul&aelig;re syntet materialene i verden:  Slinky fibre og Angel hair. Materialet er mykere                         enn Flash&rsquo;n Slinky. Egner seg til vinger i mange  typer fluer: Tuber, Decivere, jiggy, gjeddefluer, med mer. Materialet  er                         lett krusete i strukturen og blir vesentlig  mykere- og mer livaktig n&aring;r det kommer i vann.</p>', '', 0, 1, 0, 1, null, '', null, '', '', null, null, 0);
