<p><strong>Karakter 6 </strong>i Alt om Fiske utgave nr. 9 - 2010!<br><br>Shimano Calcutta er for deg som &oslash;nsker det absolutt beste av de multiplikatorsneller som finnes p&aring; markedet. <br><br>Snellehuset er et mesterverk, frest ut av ett stykke flyaluminium av h&oslash;y kvalitet. Styrke, stabilitet og lav vekt er satt i h&oslash;ysetet, uten kompromisser p&aring; kvalitet. Shimanos bremsesystem, VBS, gir kontrollerte kast med minimal risiko for backlash. Samtidig gj&oslash;res kastene enklere takket v&aelig;re den perfekt plasserte tommeltangenten QuickFire II. Calcutta har kulelagre av&nbsp;h&oslash;yeste kvalitet, noe som gj&oslash;r at snella arbeider med en presisjon og mykhet som er helt enest&aring;ende. Shimanos SuperStopper gir maksimal kontroll og eliminerer d&oslash;dgang. Bremsens myke, men likevel kraftige og p&aring;litelige funksjon skyldes bl.a. materialet som er benyttet i skivene; en kombinasjon av titanog bomullslameller. Kraftoverf&oslash;ring og drev klarer de h&oslash;yst tenkelige p&aring;kjenninger.<br><br>&nbsp;</p>
</div>
<div><img src="http://www.elbe.no/fisk/95/426/calcutta_400b.jpg/no?size=product2" border="0" alt="Calcutta 400B"></div>
<p>&nbsp;</p>', '', 0, 1, 0, 1, null, '24', null, '', '', null, null, 0);
