<div>Calcutta har gjennom 20 &aring;r blitt et begrep i norske lakseelver. Mange storlaks er berget p&aring; disse. N&aring; kommer den nye D modellen, og forventningene til en ny Calcutta er blitt til de grader innfridd. Ramme i ett stykke kaldpresset aluminium og X-Ship gir maksimal innsveivingskraft og silkemyk gange. VBS systemet gir lange presise kast. Dartanium II bremselameller gir en myk brems som spenner over et stort spekter, og gir fiskeren den tryggheten man trenger n&aring;r man kj&oslash;rer stor fisk.<br> <br> <strong>Bremsejusteringen er montert p&aring; yttersiden av sveiven, noe som gj&oslash;r det enkelt &aring; justere bremsen ved kj&oslash;ring av fisk!! I tillegg &oslash;ker stivheten slik at vridninger under h&oslash;yt press ikke er mulig.</strong><br> <br>
