<p><span style="font-size: 12px;"><br> </span><span style="font-size: 12px;"><strong>Hva er CI4?<br> </strong>&bull; Nytt&nbsp; high-tec supersterkt og lett materiale som introduseres p&aring; 3 snellemodeller for 2010<br> &bull; CI4 er utviklet av Shinanos sykkeldivisjon til Dura Ace bremsesystem <br> &bull; CI4 st&aring;r for &ldquo;Carbon Interfusion" (Karbonblanding). Karbon blandes med polyamid.<br> &bull; Tallet 4 refererer til antallet elektroner i ytterste skall&nbsp;i karbonatomet.&nbsp; Karbonfibrene i denne forbindelsen er kraftig forsterket <br> &bull; CI4 er halvannen gang sterkere enn Shimanos standard XT-7-grafitt, og over 20% lettere <br> &bull; Fordi det ikke inneholder metaller er det selvsagt 100% rustfritt <br> &bull; Dermed introduseres CI4 som materiale for &aring; kunne produsere lettere og sterkere sneller samtidig som korrosjon kan utelukkes <br> </span></p>
