<p><strong><span style="font-size: 12px;">Terningkast 6 </span></strong><span style="font-size: 12px;">og kommentar </span><strong><span style="font-size: 12px;">&rdquo;Solid maskineri&rdquo;&nbsp;</span></strong><span style="font-size: 12px;">i Jakt &amp; Fiske utgave&nbsp;nr. 7 - 2010!<br> </span><strong><span style="font-size: 12px;"><br> Terningkast 6 </span></strong><span style="font-size: 12px;">og kommentar </span><strong><span style="font-size: 12px;">&rdquo;Godt kj&oslash;p&rdquo;</span></strong><span style="font-size: 12px;">&nbsp;i Alt om Fiske utgave nr. 5 - 2010! </span></p>
<div><span style="font-size: 12px;"><img src="http://www.elbe.no/fisk/95/426/1793/ci4.jpg/no?size=preview" border="0" alt="" width="190" height="67"></span></div>
<span style="font-size: 12px;"><br> </span><span style="font-size: 12px;"><br> Nytt navn, ny teknologi og ekstremt lav vekt er stikkordene for Rarenium CI4 FA. P&aring; denne fantastiske snelleserien bruker Shimano det unike materialet CI4 i b&aring;de snellehus og rotor, dermed oppn&aring;s en helt ekstremt lav vekt for en snelle med s&aring; mye teknologi innebygget. Merk at 3000-st&oslash;rrelsen har en noe grunnere spole, spesielt tilpasset bruk av multifilament.</span>
<ul>
<li><span style="font-size: 12px;">SR-System</span></li>
<li><span style="font-size: 12px;">6 S A-RB +1</span></li>
<li><span style="font-size: 12px;">Super Stopper II</span></li>
<li><span style="font-size: 12px;">Aero Wrap II</span></li>
<li><span style="font-size: 12px;">Slow Speed Oscillation</span></li>
<li><span style="font-size: 12px;">Ci4 Snellehus og rotor</span></li>
<li><span style="font-size: 12px;">One-piece bail</span></li>
<li><span style="font-size: 12px;">Vanntett Micro Click multi disk frontbrems</span></li>
<li><span style="font-size: 12px;">Rigid Support Drag</span></li>
<li><span style="font-size: 12px;">AR-C Spool med V-formet spolekant</span></li>
<li><span style="font-size: 12px;">Kaldpresset aluminium</span></li>
<li><span style="font-size: 12px;">Ekstra spole</span></li>
<li><span style="font-size: 12px;">High Efficiency Gear</span></li>
<li><span style="font-size: 12px;">Floating Shaft II</span></li>
<li><span style="font-size: 12px;">Power Roller</span></li>
<li><span style="font-size: 12px;">Dyna-Balance</span></li>
<li><span style="font-size: 12px;">Maintenance Port</span></li>
<li><span style="font-size: 12px;">Etui og olje</span></li>
</ul>
<p><span style="font-size: 12px;"><br> </span><span style="font-size: 12px;"><strong>Hva er CI4?<br> </strong>&bull; Nytt&nbsp; high-tec supersterkt og lett materiale som introduseres p&aring; 3 snellemodeller for 2010<br> &bull; CI4 er utviklet av Shinanos sykkeldivisjon til Dura Ace bremsesystem <br> &bull; CI4 st&aring;r for &ldquo;Carbon Interfusion" (Karbonblanding). Karbon blandes med polyamid.<br> &bull; Tallet 4 refererer til antallet elektroner i ytterste skall&nbsp;i karbonatomet.&nbsp; Karbonfibrene i denne forbindelsen er kraftig forsterket <br> &bull; CI4 er halvannen gang sterkere enn Shimanos standard XT-7-grafitt, og over 20% lettere <br> &bull; Fordi det ikke inneholder metaller er det selvsagt 100% rustfritt <br> &bull; Dermed introduseres CI4 som materiale for &aring; kunne produsere lettere og sterkere sneller samtidig som korrosjon kan utelukkes <br> </span></p>
</div>
