<p><span style="font-size: 12px;">Maksimalt p&aring;kostet, innovativ og revolusjonerende Twin Power med b&aring;de front- og bakmontert brems samt Fightin&rsquo; Drag. Dette nyutviklede systemet kalles Tri-Drag og gj&oslash;r at man har tre ulike bremsekonsepter i en og samme snelle. Vekten kan likevel holdes forbl&oslash;ffende lav i og med at b&aring;de snellehus og rotor er produsert av det nye superlette og sterke karbonmaterialet CI4. Merk at st&oslash;rrelsene 3000 og 4000 har noe grunnere spoler, spesielt tilpasset bruk av multifilament.<br> </span><br> <span style="font-size: 12px;"><strong>Hva er CI4?<br> <br> </strong>&bull; Nytt&nbsp; high-tec supersterkt og lett materiale som introduseres p&aring; 3 snellemodeller for 2010<br> &bull; CI4 er utviklet av Shinanos sykkeldivisjon til Dura Ace bremsesystem <br> &bull; CI4 st&aring;r for &ldquo;Carbon Interfusion" (Karbonblanding). Karbon blandes med polyamid.<br> &bull; Tallet 4 refererer til antallet elektroner i ytterste skall&nbsp;i karbonatomet.&nbsp; Karbonfibrene i denne forbindelsen er kraftig forsterket <br> &bull; CI4 er halvannen gang sterkere enn Shimanos standard XT-7-grafitt, og over 20% lettere <br> &bull; Fordi det ikke inneholder metaller er det selvsagt 100% rustfritt <br> &bull; Dermed introduseres CI4 som materiale for &aring; kunne produsere lettere og sterkere sneller samtidig som korrosjon kan utelukkes <br> </span></p>
</div>
