INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:46:10', '2015-07-16 23:00:06', '2015-07-16 23:00:06', 'Sigma ONYX Easy', 'sigma-onyx-easy', 55920, '0', null, 0, 300, '<p>Digitalt kodet basismodell pulsklokke med detaljert treningsanalyse program og opplyst display. Enkel betjening.</p>
<p>Enkel &aring; bruke som den er, og utstyrt med basisfunksjonene, er denne pulsklokken virkelig egnet for alle som vil trene p&aring; en sunn og m&aring;lrettet m&aring;te. For &aring; kunne dokumentere trenings&oslash;kter har klokken minne for detaljert treningsanalyse og totalverdier- selv for perioder p&aring; uker, m&aring;neder eller fritt valgte tilfeldige tidsrom. Treningsaktiviteter blir ikke p&aring;virket av m&oslash;rket, takket v&aelig;re det opplyste displayet.</p>
<div style="margin: 0px; padding: 0px; float: left; width: 775px; font-family: Arial; font-size: 11px; text-align: left;" class="singlesupplierspic"></div>
<p style="padding: 0px; margin: 0px; font-family: Arial, Verdana, sans-serif; font-size: 11px; text-align: left;"><strong>Funksjoner:</strong></p>
