<li style="margin: 0px; padding: 0px;">Digital kodet overf&oslash;ring</li>
<li style="margin: 0px; padding: 0px;">4&nbsp;hjertefrekvens funksjoner</li>
<li style="margin: 0px; padding: 0px;">6&nbsp;tids funksjoner, inkludert nedtelling og alarm</li>
<li style="margin: 0px; padding: 0px;">Treningsmodus med 1 justerbar&nbsp;hjertefrekvens sone</li>
<li style="margin: 0px; padding: 0px;">Totalt forbrente kalorier</li>
<li style="margin: 0px; padding: 0px;">Totalverdier per uke, per m&aring;ned og siden restart</li>
<li style="margin: 0px; padding: 0px;">Minne for 1 trenings&oslash;kt</li>
</ul>', '', 5, 1, 0, 1, null, '', null, '', '', null, null, 0);
