<p><span style="font-size: 13px;">Flotte detaljer som neopren p&aring; utvalgte steder for &aring; gi bedre grep og dempe lydene. Det dreibare hodet gj&oslash;r skytestokken meget anvendelig, og det avtagbare hodet gj&oslash;r stokken brukbar som stativ til kamera eller spotting scope. </span></p>
<p><span style="font-size: 13px;">K</span><span style="font-size: 13px;">an heves og senkes trinnl&oslash;st fra sittende/knelende til st&aring;ende stilling.</span></p>', '', -1, 1, 0, 1, null, '', null, '', '', null, null, 0);
