INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-07-15 23:46:51', '2015-07-16 22:41:18', '2015-07-16 22:41:18', 'Thick Clear Cure Goo Syringe', 'thick-clear-cure-goo-syringe', 7920, '0', null, 0, 100, '<div>
<div>I motsetning til Epoxy gj&oslash;r Clear Cure Goo jobben 100%.</div>
</div>
<div>Slipp problemene med Epoxy og benytt heller Clear Cure Goo. Massen er ferdigblandet og fargen er helt klar. Herdetiden er p&aring; under 10 sekunder.</div>
<div><br>Clear Cure Goo levers i 5 forskjellige versoner, og alle er skikkelig motstandsdyktige mot &aring; sprekke.</div>
<div>Clear Cure Goo herder ved hjelpt av en UV-lampe.</div>
<div>Prouktet kan bygges i flere lag. Og de fem forskjellige variantene kan benyttes i kombinasjon.</div>
<div>
<div><strong>Clear Cure Goo &ndash; Tack free</strong> <br> Dette er det nyeste tilskuddet i Clear Cure Goo &ndash; familien. Denne er like tykk som Clear Cure Goo Thick, men den er absolutt helt klebefri etter herding. Allerede en favoritt blant brukerne av Clear Cure Goo.</div>
<div><strong></strong>&nbsp;</div>
<div><strong>Clear Cure Goo - Thick</strong> <br> Denne massen er perfekt til &aring; lage fluer som krever at det bygges opp st&oslash;rre mengder av masse, som for eksempel surf candy. Denne flyter ikke p&aring; langt n&aelig;r like mye som den tynne eller flesible versjonen, men som alltid kan man benytte ulike typer etter hverandre.</div>
<div>&nbsp;</div>
<div>Link til produktvideo: <a href="http://clearcuregoo.com/page5/page13/page13.html">http://clearcuregoo.com/page5/page13/page13.html</a></div>
<div>&nbsp;</div>
<div><strong>Clear Cure Goo - Thin</strong> <br> Denne flyter mye mer enn b&aring;de den tykke og den fleksible versjonen. Sluttresultatet blir mye glattere, og den har evnen til &aring; penetrere materialer p&aring; en unik m&aring;te. Denne passer perfekt til binding av for eksempel nymfer og lopper.</div>
<div><strong></strong>&nbsp;</div>
<div><strong>Clear Cure Goo &ndash; Flexible</strong> <br> Dette materialet vil revolusjonere m&aring;ten du binder p&aring;, samt at det garantert kommer til &aring; &aring;pne d&oslash;rer til m&oslash;nstre du tidligere trodde var umulig. Om du er lei av &aring; grise med silikonbaserte materialer og du er lei av &aring; vente p&aring; herdingen. Clear Cure Goo flexible er l&oslash;sningen for deg. Denne herder p&aring; 10-12 sekunder for hele fluen.</div>
<div>&nbsp;</div>
<div>Link til produktvideo: <a href="http://www.clearcuregoo.com/page5/page20/page20.html">http://www.clearcuregoo.com/page5/page20/page20.html</a></div>
<div>Link til produktvideo: <a href="http://clearcuregoo.com/page5/page21/page21.html">http://clearcuregoo.com/page5/page21/page21.html</a></div>
<div>&nbsp;</div>
<div><strong>Clear Cure Goo - Brushable</strong> <br> Tanken bak dette produktet var &aring; lage et produkt som man enkelt og greit kunne bruke som coating og som raskt og pent glatte ut overflater. I ettertid har man funnet mange flere bruksomr&aring;der, blant annet &aring; stive opp materialer, og man kommer sikkert til &aring; finne flere etter hvert.</div>
<div>&nbsp;</div>
<div><strong>Clear Cure Goo &ndash; Curing Light</strong> <br> Her har du uv-lampen som herder alle typene av Clear Cure Goo. Lampen benytter 3stk. AAA-batterier, men den trekker lite str&oslash;m slik at levertiden er lang. Lampen herder en hel flue p&aring; ca. 5 sekunder (Clear Cure Goo Flexible tar litt lengre tid &ndash; ca. 10-12 sekunder). Batterier medf&oslash;lger ikke.</div>
</div>
<p>&nbsp;</p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
