<div><strong>Clear Cure Goo &ndash; Flexible</strong> <br> Dette materialet vil revolusjonere m&aring;ten du binder p&aring;, samt at det garantert kommer til &aring; &aring;pne d&oslash;rer til m&oslash;nstre du tidligere trodde var umulig. Om du er lei av &aring; grise med silikonbaserte materialer og du er lei av &aring; vente p&aring; herdingen. Clear Cure Goo flexible er l&oslash;sningen for deg. Denne herder p&aring; 10-12 sekunder for hele fluen.</div>
<div>&nbsp;</div>
<div>Link til produktvideo: <a href="http://www.clearcuregoo.com/page5/page20/page20.html">http://www.clearcuregoo.com/page5/page20/page20.html</a></div>
<div>Link til produktvideo: <a href="http://clearcuregoo.com/page5/page21/page21.html">http://clearcuregoo.com/page5/page21/page21.html</a></div>
<div>&nbsp;</div>
<div><strong>Clear Cure Goo - Brushable</strong> <br> Tanken bak dette produktet var &aring; lage et produkt som man enkelt og greit kunne bruke som coating og som raskt og pent glatte ut overflater. I ettertid har man funnet mange flere bruksomr&aring;der, blant annet &aring; stive opp materialer, og man kommer sikkert til &aring; finne flere etter hvert.</div>
<div>&nbsp;</div>
<div><strong>Clear Cure Goo &ndash; Curing Light</strong> <br> Her har du uv-lampen som herder alle typene av Clear Cure Goo. Lampen benytter 3stk. AAA-batterier, men den trekker lite str&oslash;m slik at levertiden er lang. Lampen herder en hel flue p&aring; ca. 5 sekunder (Clear Cure Goo Flexible tar litt lengre tid &ndash; ca. 10-12 sekunder). Batterier medf&oslash;lger ikke.</div>
</div>
<p>&nbsp;</p>', '', 2, 1, 0, 1, null, '', null, '', '', null, null, 0);
