<p>Melloms&aring;le: H&auml;rkila SUPO &ndash; Formst&oslash;pt EVA melloms&aring;le med ekstra stabilitet p&aring; yttersiden av fremfoten (supinasjonskontroll) og innersiden av h&aelig;len (pronasjonskontroll).<br />
