<p>En fleksibel og fin brenner p&aring; 2450W med justering p&aring; ventilen.Tre sammenleggbare st&oslash;tteben sikrer god st&oslash;tte. To-kanals oppvarmer gj&oslash;r det til en veldig effektiv brenner som gir nok kraft til &aring; lage middag til flere. Brenneren kommer i hardplast-boks som gj&oslash;r at den trygt kan oppbevares i ryggsekken p&aring; tur.<br />
Vekt: 308g<br />
Materiale:Rustfritt st&aring;l<br />
Styrke:2450W</p>

<p><strong>Kjelesett:</strong></p>

<p>Komplett sett med kjeler, stekepanner, boller og bestikk til beste markedspris! Her har du det du trenger for lange turer i skog og mark.<br />
<br />
Vekt: 710g<br />
Materiale:Aluminium</p>

<p><strong>Kaffekjele:</strong></p>

<p>En liten og smidig kaffekjele som f&aring;r plass i de minste tursekkene. Den er laget i anodisert aluminum. Dette gj&oslash;r at den er lett i vekt, lett &aring; vaske, og ikke blir s&aring; lett ripet opp. H&aring;ndtaket kan felles ned.</p>

<p>Med varmeveksler for raskere oppvarming.<br />
<br />
Vekt:150gr<br />
St&oslash;rrelse:153x67mm</p>
', '<p>Alt du trenger for en vellykket turmiddag!</p>

<p>2 kjeler, 2 stekepanner, gassbrenner og en kaffekjele!</p>

<p>Her i et komplett sett til en fantastisk pris!</p>
', 0, 0, 1, 1, 4, ',67,', null, '', '', ',334,336,410,', null, 0);
