INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-12-15 08:25:16', '2017-02-14 21:30:26', null, '2l Drikkesystem', '2l-drikkesystem', 79, '', '13-3', 20, 500, '', '<p>to-liters drikkesystem. Camelbak-systemet er den optimale garantien mot dehydrering og sikrer optimal prestasjon. Du har drikken enkelt med deg, integrert i sekken. Sekken passer perfekt til enkle treningsturer, enten det er l&oslash;p, sykkel eller langrenn. Sekken har ogs&aring; en liten glidel&aring;slomme utenp&aring;, s&aring; man har plass til lommebok, n&oslash;kler, powerbars, multiverkt&oslash;y e.l., i tillegg til drikken. Egenskaper: - Lettvekts lukkemekanisme p&aring; drikkeposen - Ventilerte skulderremmer - Ergonomisk formet - Lav profil, behagelig &aring; b&aelig;re - Lett &aring; rengj&oslash;re - L&oslash;kker til &aring; henge eksternt utstyr p&aring; - Re</p>
', 4, 1, 37, 1, 6, ',53,', null, '', '', null, null, 2);
INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2015-12-15 16:23:11', '2016-10-17 09:40:47', null, 'Varmevest', 'varmevest', 799, 'JS-608', '', 596, 600, '', '<p>N&aring; trenger du ikke lenger v&aelig;re bekymret for &aring; fryse p&aring; kalde vinterdager! Denne blir du avhengi av! Med en varmevest holder du varmen selv p&aring; de kaldeste dager. Enten du sitter p&aring; post, fisker p&aring; isen, g&aring;r p&aring; ski, ja stort sett all type aktivitet i kaldt v&aelig;r, s&aring; kan du ha god nytte av en varmevest. Produsert i deilig fleece som i seg selv gir isolasjon. Den har 3 varmeelementer fordelt p&aring; nedre og &oslash;vre del av ryggen. Batteripakken har lav profil og lav vekt noe som gj&oslash;r at den nesten ikke merkes. Den ligger i en lomme p&aring; venstre side i front. 3 varmeniv&aring;er; h&oslash;y: 65-75 grader, middels: 50-55 grader og lav: 40-45 grader. Av/P&aring;-bryter i front som lyser henholdsvis r&oslash;dt, hvitt og bl&aring;tt. P&aring; full varme holder vesten i hele 4-5 timer! Middels varme holder den i 6-7 timer. 2 stk romslige lommer i front. Litt liten i st&oslash;rrelse, g&aring; opp en st&oslash;rrelse fra hva du normalt bruker. Denne er s&aring; behagelig at du f&aring;r lyst til &aring; ha den p&aring; hele tiden. Vi garanterer kvaliteten, vesten st&aring;r ikke tilbake p&aring; varmevester som koster betydelig mer!</p>
', 0, 1, 39, 1, 52, ',17,69,71,', '{"1":"0","2":"0","3":"0","4":"0"}', '', '', null, null, 0);
