INSERT INTO friluft.products (created_at, updated_at, deleted_at, name, slug, price, articlenumber, barcode, inprice, weight, description, summary, stock, enabled, sales, vatgroup_id, manufacturer_id, categories, variants_stock, meta_description, meta_keywords, children, sizemap_id, `order`) VALUES ('2016-08-27 18:49:29', '2017-03-15 14:06:02', null, 'Amundsen Herre Stealth Black', 'amundsen-herre-stealth-black', 479, 'NF-AMPM01', '5-2', 240, 600, '<ul>
	<li>Stretchstoff: 95% nylon/5% spandex</li>
	<li>Forsterkede partier: 65% polyester/35% bomull</li>
	<li>Ventilasjons&aring;pninger med glidel&aring;s p&aring; side av l&aring;r</li>
	<li>Forsterkede partier i NFUltra1000</li>
	<li>Knappejustering i bunn p&aring; buksebein</li>
	<li>Romslige frontlommer</li>
	<li>1stk baklomme</li>
	<li>2stk romslige l&aring;rlommer med klaff</li>
	<li>Lissekrok i bunn p&aring; buksebein for optimal feste</li>
</ul>
', '<p>Suveren kvalitet, utmerket funksjonalitet og perfekt passform kjennetegner AmundsenPro-serien. Her har man en multifunksjonell turbukse som passer til en rekke utend&oslash;rsaktiviteter. Enten du g&aring;r lange turer i fjellet, er p&aring; fisketur, klatrer etc, vil du f&aring; stor glede av AmundsenPro. Kun de beste materialer er benyttet, og buksen best&aring;r av 2 materialer for &aring; sikre optimal bevegelsesfrihet, slitestyrke og passform. &Oslash;verste parti og parti bak kne er produsert i NFActiveStretch som best&aring;r av 95% nylon og 5% spandex. Det m&oslash;rkegr&aring; parti er produsert i NFUltra1000 som best&aring;r av 65% polyester og 35% bomull. Dette stoffet kan vokses inn for &aring; gi ekstra gode vannavst&oslash;tende egenskaper. Buksen har en rekke smarte detaljer som blant annet lufting p&aring; side av l&aring;r, romslige lommer i front og lissefeste. Normal passform, se st&oslash;rrelseskart for &aring; v&aelig;re sikker p&aring; at du f&aring;r riktig st&oslash;rrelse.</p>
', 0, 1, 331, 1, 58, ',70,', '{"1":"10","2":"9","3":"14","4":"6","5":"7","6":"14","7":"0"}', '', '', null, 21, -3);
